(1, 1, 1, 0, '2017-03-08', 'Mandravarava i ENAWO 3 maty, 6 naratra mafy', 'misongadina/Mandravarava-i-ENAWO-3-maty-6-naratra-mafy-08032017-1', 'Mahery vaika ny rivodoza Enawo izay niditra an-tanety tany Ampahana Antalaha omaly talata 7 martsa tamin’ny 12 ora antoandro.', 'Mahery vaika ny rivodoza Enawo izay niditra an-tanety tany Ampahana Antalaha omaly talata 7 martsa tamin’ny 12 ora antoandro.', '<p>Olona 3 no fantatra fa maty ka lehilahy iray tany Mananara avaratra ary ankizy roa kosa tany Maroantsetra, olona miisa 468 no tsy maintsy nafindra toerana mbola tao Maroantsetra ihany. Enina no fantatra fa naratra aloha hatreto, araka ny fampitam-baovao ofisialy avy amin&rsquo;ny fitondram-panjakana.&nbsp;Cyclone Tropical Intense&nbsp;no iantsoana an&rsquo;i Enawo&nbsp;&nbsp;ankehitriny, 5km isan&rsquo;ora ny fikisahany ary tafio-drivotra hatrany amin&rsquo;ny 200 km isan&rsquo;ora no entiny. Tena mahery vaika ity rivodoza ity. Mijojo hatrany ny orana matevina amin&rsquo;izay faritra misy azy toa an&rsquo;Antalaha, Maroantsetra, Mananara avaratra, Soanierana Ivongo, Toamasina &hellip; Mikisaka miadana miankandrefana i Enawo. Arakaraka ny maha kely ny hafainganam-pandeha no maha betsaka ny fahasimbana entin&rsquo;ny rivodoza. Ny faritr&rsquo;i SAVA sy Atsinanana no tena nandalovany omaly ary vinavinaina handalo eto Analamanga izy anio. Orana mikija sy rivotra mahery no entiny ary sokajian&rsquo;ny teknisianina ho anisan&rsquo;ireo rivodoza matanjaka indrindra nandalo teto Madagasikatra izy ity. Ao anatin&rsquo;ny faritra mena na loza mitatao ka mila mitandrina fatratra ny faritra DIANA, Sofia, SAVA, Analanjirofo, Toamasina, Brickaville, Vatomandry, Alaotra, Mahajanga I sy II, Marovoay, Ambatoboeny, Maevatanana ary Tsaratanana. Araka ny fampitam-baovao azo, efa maro ny zavatra simba any Maroantsetra, Toamasina &hellip; Andrasana ny fijerena ifotony hahafantarana ny zava-misy marina. Nofoanana avokoa ny fihetsiketsehana manodidina ny fanamarihana ny 8 martsa andron&rsquo;ny vehivavy manerana ny nosy, anisan&rsquo;izany ny hetsika lehibe saika hotanterahana anio eny Mahamasina. Efa namoaka fanambarana ny fitondram-panjakana fa tsy mianatra ny mpianatra rehetra manerana an&rsquo;i Madagasikara anio alarobia 8 martsa ary tompon&rsquo;andraikitra amin&rsquo;ny&nbsp;&nbsp;fanapahan-kevitra rehetra hafa ireo DREN isam-paritra ny amin&rsquo;ny mety ho tohiny. Mila manara-baovao ny rehetra satria misy fivoarana ny andro ratsy ka miova araka izay ihany koa ny toromarika.Tonga nitsidika ny BNGRC moa omaly ny filoha Hery Rajaonarimampianina ary nanamafy fa tokony ho mailo ny rehetra ary efa mivonona amin&rsquo;ny fanampiana ny fitondram-panjakana.</p>', 1, 1, 1, 'upload/17-03-11-1489216500.jpg'),
(2, 1, 5, 0, '2017-03-11', 'Kaominina Andoharanofotsy Nandaitra ny fanentanana ny mponina', 'politika/Kaominina-Andoharanofotsy-Nandaitra-ny-fanentanana-ny-mponina-11032017-2', 'Tsy nahitana rano niandrona mihitsy ny araben’Andoharanofotsy ny Alarobia sy omaly tontolo andro na dia nirotsaka tsy ato aza ny orana teto an-drenivohitra sy ny manodidina', 'Tsy nahitana rano niandrona mihitsy ny araben’Andoharanofotsy ny Alarobia sy omaly tontolo andro na dia nirotsaka tsy ato aza ny orana teto an-drenivohitra sy ny manodidina', '<p><span lang="EN-US">Noho ny ezaky ny kaominina sy ny Fokonolona izay samy nanadio ny tata-drano rehetra no anisan&rsquo;ny antony nahatonga izany, raha araka ny fanazavan&rsquo;ny Ben&rsquo;ny tan&agrave;na Ranirison Hasina. Nandaitra ihany koa hoy izy ny fanentanana ny mponina ny amin&rsquo;ny tsy tokony hanarina fako any anaty tata-drano ka tsy nisy intsony ny rano nihandrona. Raha tsiahivina anefa dia miaina anaty rano hatrany ny mponina ao Andoharanofotsy isaky ny fotoam-pahavaratra tahaka izao ka misy mihitsy ireo tsy afaka manohy ny asa fivelomany andavanandro toy ny mpivarotra&hellip; raha misedra olana ihany koa ny mpiasa sy ny mpianatra. Voasoroka hatrany amin&rsquo;ireo tokantrano nahiana ho traboina hoy hatrany ny Ben&rsquo;ny tan&agrave;na, asa izay ezahina hotohizana hatrany hananan&rsquo;ny mponina filaminan-tsaina sy hahafahana miaina ao anaty tan&agrave;na madio.</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 2, 'upload/17-03-11-1489216217.jpg'),
(3, 1, 3, 0, '2017-03-11', 'Vidim-piainana Tsy mandray andraikitra ny mpitondra', 'toe-karena/Vidim-piainana-Tsy-mandray-andraikitra-ny-mpitondra-11032017-3', 'Miaina vanim-potoana sarotra ny vahoaka Malagasy amin’izao fotoana. Saika ny 80%-n’ny faritra eto Madagasikara no nizaka ny voka-dratsin’ny rivodoza.', 'Miaina vanim-potoana sarotra ny vahoaka Malagasy amin’izao fotoana. Saika ny 80%-n’ny faritra eto Madagasikara no nizaka ny voka-dratsin’ny rivodoza.', '<p>Efa tafiditra ao anaty fotoam-pahavaratra rahateo isika, ka maro ireo endri-pahasahiranana isan-karazany miseho. Vao andro vitsy nisian&rsquo;ny orana sy rivodoza dia efa miseho sahady ny olana amin&rsquo;ny fidangan&rsquo;ny vidin&rsquo;ny entana ilaina amin&rsquo;ny andavanandro.&nbsp;<span lang="EN-US">Tafakatra 20 000 ka hatramin&rsquo;ny 25&nbsp;000 ariary sahady ny vidin&rsquo;ny harina fandrehitra eto Antananarivo. Toraka izany koa ny vidin&rsquo;ny vary izay efa mananika ny 2 000 ariary indray ny iray kilao. Saika ahitana izany avokoa ny faritra rehetra eto an-drenivohitra. Raikitra ny fananararaotana isan-karazany. Tokony hisy ny sazy henjana hampiharina amin&rsquo;ireo mpandraharaha manararaotra ny fahasarinam-bahoaka toy izao satria tsy ara-dal&agrave;na sy tsy ara-drariny no miseho. Raha tena mitsinjo ny vahoakany ny mpitondra dia vitany ny manara-maso sy misoroka ny fidangan&rsquo;ny vidin-javatra. Mila jerena koa ny fahasahiranana.</span></p>\r\n<p><span lang="EN-US">Toky R</span></p>', 0, 1, 1, 'upload/17-03-11-1489216343.jpg'),
(4, 1, 1, 0, '2017-03-11', 'Tandindomin-doza Antananarivo Miakatra Ikopa sy Sisaony', 'misongadina/Tandindomin-doza-Antananarivo-Miakatra-Ikopa-sy-Sisaony-11032017-4', 'Omaly tamin’ny 11 ora sy sasany antoandro dia vaky ny fefiloha manamorona ny reniranon’i Sisaony', 'Omaly tamin’ny 11 ora sy sasany antoandro dia vaky ny fefiloha manamorona ny reniranon’i Sisaony', '<p><span lang="EN">Andrefan&rsquo;Ambohimandroso, 500m miala ny lalam-pirenena voalohany (RN1) hiditra ny kaominina Fenoarivo. Samy tonga teny ireo Ben&rsquo;ny tan&agrave;na manodidina sy ny zandary avy eo Fenoarivo sy Ampitatafika nizaha ny zava-misy ary nandray ny fepetra ho fisorohana ny loza mety hiseho. Nanomboka omaly alakamisy 9 martsa antoandro dia nanao ny fandaminana sy ny fanentanana ny olona mba tsy hampiasa intsony ny fefiloha ho lalana hivezivezena ny zandarimariam-pirenena eny Fenoarivo noho ny fahavakisan&rsquo;ny reniranon&rsquo;i Sisaony, izay atahorana hitera-doza ho an&rsquo;ireo mponina. Raha ny zava-nisy dia ny maraina tamin&rsquo;ny 6 ora dia efa hita fa tena niakatra be ny haavon&rsquo;ny renirano ary efa maro ireo tra-boina niala ny trano fonenany. Ny antoandro dia vaky ilay fefiloha. Efa nahitana fahavakisana ny reniranon&rsquo;i Sisaony teny Ambohijoky, ka toerana maro no dibo-drano, ary an&rsquo;arivony ny traboina toy ny teny Anosizato. Nahitana fiakarana 0,48 metatra ny reniranon\'Ikopa teny Anosizato tao anatin\'ny 4 ora ka efa tafakatra 3,60 metatra omaly hariva raha 2,86 metatra ny marain. 3,50 metatra ny refy hamaritana ny loza mitatao eny amin\'ny reniranon\'Ikopa eny Anosizato, izay izay efa nihoarana ihany koa. Efa loza mihatra no misy eny an-toerana.</span></p>\r\n<p><span lang="EN">Efa maro ny mponina teny no niala vokatry ny fanentanana. Mbola misy ihany ny misisika ny hiverina haka ny entany. Hentitra anefa ny zandary hiarovana ny ain&rsquo;izy ireo. Nanohy ny fanentanana ny olona mba tsy hanakaiky ilay fefiloha vaky ary nanentana ireo olona izay mbola tavela mba hiala ny trano dibo-drano ny zandary izay hijanona eny an-toerana mandra-piovan&rsquo;ny toe-draharaha ho fiarovana ny ain&rsquo;ireo mponina.</span></p>\r\n<p><span lang="EN">&nbsp;</span></p>\r\n<p><span lang="EN">Toky R</span></p>', 0, 1, 1, 'upload/17-03-11-1489218397.jpg'),
(5, 1, 3, 0, '2017-03-11', 'VEHIVAVY MIZAKA TENA ARA-TOEKARENA Lasan’ny “Ampela Miray Asa” ny amboara', 'toe-karena/VEHIVAVY-MIZAKA-TENA-ARA-TOEKARENA-Lasanny-Ampela-Miray-Asa-ny-amboara-11032017-5', 'Lasan’ny fikambanam-behivavy “Ampela Miray Asa”, iray tamin’ireo 578 nandray anjara ny amboara tamin’ilay fifaninanana tetikasa “vehivavy mizaka tena ara-toekarena” nokarakarain’ny minisiteran’ny Mponina.', 'Lasan’ny fikambanam-behivavy “Ampela Miray Asa”, iray tamin’ireo 578 nandray anjara ny amboara tamin’ilay fifaninanana tetikasa “vehivavy mizaka tena ara-toekarena” nokarakarain’ny minisiteran’ny Mponina.', '<p><span lang="EN-US">Tetsy amin&rsquo;ny Carlton Anosy omaly no nanambarana izany tamim-pomba &ocirc;fisialy&nbsp;&nbsp;ka nanomezana loka ho an&rsquo;ity fikambanana iray ity izay marihina fa tsy ho tombontsoan&rsquo;ny mpikambana ihany fa mahakasika vehivavy maro ihany koa. Lelavola mitentina 20 tapitrisa Ar no azon&rsquo;ity fikambanam-behivavy iray ity tamin&rsquo;izany, fikambanam-behivavy izay tsiahivina fa&nbsp;&nbsp;avy ao amin&rsquo;ny faritra Androy. Ny tetikasa fambolena zanakazo no tena novolovolain&rsquo;ireo mpikambana tamin&rsquo;izany. Ny fikambanam-behivavy &ldquo;Jeudi des femmes entrepreneur&rdquo;, avy eto amin&rsquo;ny Faritra Analamanga kosa, no nibata ny amboara faharoa ka notolorana&nbsp;&nbsp;lelavola 10 tapitrisa Ar. Ilay tetikasa fanamboarana harona taratasy indray no nosafidian&rsquo;ireto farany, hahafahana miady amin&rsquo;ny fihanaky ny harona sachet eto amintska sy ho fiarovana ny tontolo iainana.&nbsp;</span>Ny fikambanam-behivavy Siana, avy any amin&rsquo;ny distrikan&rsquo;Analalava Faritra&nbsp;&nbsp;Sofia&nbsp;&nbsp;no nibata ny laharana fahatelo ka notolorana lelavola 5 tapitrisa Ar raha lelavola 1 tapitrisa Ar avy&nbsp;&nbsp;kosa no nomena&nbsp;&nbsp;ireo fikambanana 15 nandray anjara tamin&rsquo;ny dingana famaranana. Tsiahivina moa fa nahatratra 1.526 ireo nandray anjara tamin&rsquo;ity fifaninana ity teny am-piandohana saingy ny&nbsp;&nbsp;578 tamin&rsquo;ireo&nbsp;&nbsp;ihany no azo nekena ary ny 18 tamin&rsquo;ireo indray&nbsp;&nbsp;izay nahitana fikambanana telo isaky ny Faritany no voafidy niatrika ny dingana famaranana.</p>\r\n<p>Pati</p>', 0, 1, 2, NULL),
(9, 1, 5, 0, '2017-03-08', 'Filoham-pirenena sy praiminisitra Tsy nisy tany Antsakabary', 'politika/Filoham-pirenena-sy-praiminisitra-Tsy-nisy-tany-Antsakabary-08032017-9', 'Ny minisitry ny asa vaventy, Eric Razafimandimby, izay sady minisitra mpiahy ny faritr’i Sofia no nirahin’ny filoham-pirenena Hery Rajaonarimampianina sy ny praiminisitra Mahafaly Olivier', 'Ny minisitry ny asa vaventy, Eric Razafimandimby, izay sady minisitra mpiahy ny faritr’i Sofia no nirahin’ny filoham-pirenena Hery Rajaonarimampianina sy ny praiminisitra Mahafaly Olivier', '<p><span lang="EN-US">Nisolotena ny fitondram-panjakana nitondra fanampiana ho an&rsquo;ireo traboina tany amin&rsquo;ny kaominina Ambanivohitra Antsakabary ao amin&rsquo;ny distrikan&rsquo;i Befandriana Avaratra ny fiandohan&rsquo;ny herinandro teo. Vary 84 lasaka miampy kojakoja fampiasa amin&rsquo;ny fiainana andavanandro, toy ny sio miisa 50, koveta 50 ary simenitra 20 lasaka no natolotry ny fitondram-panjakana ho an&rsquo;ireo traboina na teo aza ny tsikera isan-karazany nametra-panontaniana ny maro ny amin&rsquo;ny mbola hifampieran&rsquo;ireo manampahefana nialoha ny nidinana tany an-toerana. Nolazain&rsquo;ny praiminisitra fa hifanaraka ny tenany sy ny filoham-pirenena izay hidina hijery ny zava-misy any amin&rsquo;ity toerana nahamaizana trano maherin&rsquo;ny 400 sy naha traboina vahoaka maro ity.</span></p>\r\n<p><span lang="EN-US">Mirija</span></p>', 0, 1, 1, NULL),
(10, 1, 5, 0, '2017-03-08', 'Distim sy vehivavy TIM Boriborintany faha-6 Hanao DIABE hihazo ny Lapan’ny tanàna etsy Analakely', 'politika/Distim-sy-vehivavy-TIM-Boriborintany-faha-6-Hanao-DIABE-hihazo-ny-Lapanny-tanna-etsy-Analakely-08032017-10', 'Ho fanohanana an\'i Neny Lalao Ravalomanana izay vehivavy voalohany nitantana ny Renivohitr\' ity Nosintsika ity dia ho avy hanohana sy ankahery azy amin’ny adidy', 'Ho fanohanana an\'i Neny Lalao Ravalomanana izay vehivavy voalohany nitantana ny Renivohitr\' ity Nosintsika ity dia ho avy hanohana sy ankahery azy amin’ny adidy', '<p><span lang="EN-US">Iantsorohany ny DISTIM eny amin&rsquo;ny boriborintany faha-6 eto andrenivohitra miaraka amin&rsquo;ny depiote Rasoanoromalala Horace sy ireo vehivavy TIM dia hanao DIABE miainga eny amin&rsquo;ny Firaisana Anosisoa ka hihazo ny&nbsp;&nbsp;Lapan\'ny tan&agrave;na etsy Analakely. Hanotrona azy ireo koa ireo lehilahy ao amin&rsquo;ity Distim ity.</span></p>\r\n<p><span lang="EN-US">Ntsoavina Evariste</span></p>', 0, 1, 1, NULL),
(11, 1, 17, 0, '2017-03-08', 'Asehoy amin’izay e !', 'taratasy-ho-ani-jean/Asehoy-aminizay-e--08032017-11', 'Aiza amin’izay ry Jean ilay fahaizanareo tamin’ny andron’ny frankofonia ireny a ! Hainareo ery ny nifaninana tamin’ilay nahary ka nanakana ny orana tokony hirotsaka mba tsy hanimba ny rendrarendranareo mianakavy.', 'Aiza amin’izay ry Jean ilay fahaizanareo tamin’ny andron’ny frankofonia ireny a ! Hainareo ery ny nifaninana tamin’ilay nahary ka nanakana ny orana tokony hirotsaka mba tsy hanimba ny rendrarendranareo mianakavy.', '<p>Tamin&rsquo;ireny no nilana izany orana izany ho an&rsquo;ny fambolen&rsquo;ny Malagasy efa mitrongy vao homana saingy ny sitraponareo aloha no laharam-pahamehana, hany ka nivadika ambony ambany ny tantara ka dia nijinja ny hetraketraketrakareo tamin&rsquo;ny alalan&rsquo;ny fiaretana haintany mahatsiravina ny Malagasy tsy vakivolo. Asehoy amin&rsquo;izay ry Jean ny fahaizanareo tamin&rsquo;ireny fa ianareo anie no handrasanay amin&rsquo;izao loza tsy roa aman-tany mahazo anay izao. Aiza ilay fanakanana ny orana tsy hilatsaka no tsy mba hampiasaina hanakanana ity rivo-doza mahatsiravina ity e&nbsp;! Asehoy ry Jean ny talenta fa ianareo anie toa mibontsimbotsina ery hoe afaka mifaninana amin&rsquo;ilay nahary e!&nbsp;<span lang="EN-US">Miandry anareo izahay ry Jean fa aza misitri-belona any ianareo mianakavy a&nbsp;! Ary tadidio ihany koa fa ianareo no fototry ny loza rehetra eto amin&rsquo;ity firenena ity. Raha tsy nampanjakainareo ny fandripahana ny ala sy ny harem-pirenena tsy dia hamotika zavatra betsaka firy io loza voajanahary tombanana hamotika sy handripaka olona io. Izay no mahavoa antsika tsy mahalala afatsy ny anio, ka atao ahoana fa tsy maintsy mizaka ny vokany e !</span></p>\r\n<p><span lang="EN-US">Marco&nbsp;&nbsp;leo sy tofoka an&rsquo;i Jean</span></p>', 0, 1, 1, NULL),
(12, 1, 1, 0, '2017-03-15', 'Fosafosa amin’ny facebook Migadra herintaona i Hiary', 'misongadina/Fosafosa-aminny-facebook-Migadra-herintaona-i-Hiary-15032017-12', 'Na dia efa nanala ny fitoriany an’ilay mpanakanto mpandrindra ny vondrona ao anaty tambajotra facebook “Fifosana hanatsarana people gasy”, Hiary Rampanoelina, daholo aza ireo voatohintohina rehetra tamin’ity raharaha ity dia tsy afa-bela ny voampanga', 'Na dia efa nanala ny fitoriany an’ilay mpanakanto mpandrindra ny vondrona ao anaty tambajotra facebook “Fifosana hanatsarana people gasy”, Hiary Rampanoelina, daholo aza ireo voatohintohina rehetra tamin’ity raharaha ity dia tsy afa-bela ny voampanga', '<p><span lang="EN-US">Noraisin&rsquo;ny fampanoavana ho anisan&rsquo;ny firaisana tsikombakomba amin&rsquo;ny mpanao ratsy ny famelana ilay fandrahonana haka an-keriny zanaky ny depiote Harijaona Randriarimalala na Jaona Elite nivoaka tao amin&rsquo;ny rindrin&rsquo;ity vondrona ity ka dia izay no antony tsy nahafahan&rsquo;ny fitsarana hanafaka madiodio an&rsquo;i Hiary. Voasazy higadra herintaona sazy mihatra izy ary nafahana noho ny fisalasalana kosa ny vadiny. Omaly moa no nivaly teny amin&rsquo;ny lapan&rsquo;ny fitsarana Anosy ity raharaha ity rehefa avy nisintona sy nandinika izany hatramin&rsquo;ny 28 febroary teo ireo mpitsara. Mbola afaka mampiakatra fitsarana ambony na miantso fandravana ny didy ny mpisolovava an\'i Hiary. Maro no taitra tamin\'ity didim-pitsarana ity saingy raha ny filazana mpitsara iray dia io no izy ary mitombina tsara satria izay no mifanaraka amin\'ialy vesatra niampangana azy.</span></p>\r\n<p>Mirija</p>', 0, 1, 0, NULL),
(13, 2, 1, 0, '2017-03-15', 'Bemarenina ny fanjakana Hiverina ny Magro ?', 'misongadina/Bemarenina-ny-fanjakana-Hiverina-ny-Magro--15032017-13', 'Efa tena nandefitra i Marc Ravalomanana raha ny zavatra niainany sy nampizakaina azy teto Madagasikara no dinihina. Naongana teo amin’ny fitondrana ka voatery nanao sesitany ny tenany tany ivelany', 'Efa tena nandefitra i Marc Ravalomanana raha ny zavatra niainany sy nampizakaina azy teto Madagasikara no dinihina. Naongana teo amin’ny fitondrana ka voatery nanao sesitany ny tenany tany ivelany', '<p><span lang="EN-US">Taorian&rsquo;ny naha sesitany azy 7 taona dia nogadraina sy nanaovana antsojay isan-karazany indray izy rehefa tonga teto an-tanindrazana. Ny fahapotehan&rsquo;ny fananany tsy misy resaka fa mbola tadiavina ny hevitra rehetra hanagiazana ny fananany sisa tavela toy ny Tiko any Andranomanelatra sy ny tany misy ny Magro Toamasina, ny tany eny Andohatapenaka&hellip; Manaja hatrany ny fanjakana i Marc Ravalomanana, manaja ny lal&agrave;na, fa ilay fanapenam-bava kosa efa tena mihoatra ny mety. Miezaka miresaka sy mangataka am-pahatsorana amin&rsquo;ny fanjakana ny hanokafana ny haino aman-jery&nbsp;&nbsp;MBS (Malagasy Broadcasting System) izy saingy minia tsy te hahalala ny mpitondra fa manao bemarenina hatrany, izay endrika iray hanaporofoana fa tapenam-bava sy sakanana mafy tsy hanapariaka ny heviny manoloana ny raharaham-pirenena ny tenany. Ny fanokafana io orinasan-tserasera io no mba hany hahafahan&rsquo;i Marc Ravalomanana sy mpiara-dia aminy mifanerasera. Rehefa tsy manana haino aman-jery hanaovany ny serasera amin&rsquo;ny mpomba azy izy dia mazava ho azy izany fa mety hifanerasera mivantana amin&rsquo;ny vahoaka eny an-kianja indray ary eny mifampita vaovao. Efa nilaza ny ho firotsahany hofidiana filoham-pirenena i Marc Ravalomanana sy ny mpanao politika sasany saingy ny maro manana vahana sy tombondahiny amin&rsquo;ny resaka orinasan-tserasera fa izy kosa hanaovana antsojay. Manana tombo-dahiny hatrany i Hery Rajaonarimampianina amin&rsquo;ny famelana an-kalalahana ireo haino aman-jery tsy miankina maro mpanohana ny fitondrana HVM, izay vao haingana avokoa no niforonan&rsquo;ny ankamaroany. I Andry Rajoelina manana ny orinasan-tseraserany, i Edgard Razafindravahy manana ny azy manokana, Hajo Andrianainarivelo manana&hellip; Eny amin&rsquo;ny Magro izany i Marc Ravalomanana no mety hifamotoana amin&rsquo;ny mpanohana azy atsy ho atsy rehefa minia manampi-tsofina sy te hanampim-bava azy ny fanjakana.</span></p>\r\n<p><span lang="EN-US">&nbsp;</span></p>\r\n<p align="right">Toky R</p>', 0, 1, 1, 'upload/17-03-15-1489566266.jpg'),
(14, 2, 5, 0, '2017-03-14', 'Antalaha Niesona tao amin’ny Aéroport ny praiminisitra', 'politika/Antalaha-Niesona-tao-aminny-Aroport-ny-praiminisitra-14032017-14', 'Tonga ny mpandeha, ny mpanamory tsy hita. Niesona tao amin’ny seranam-piaramanidina Antalaha efa ho adim-pamantaranandro iray latsaka ny delegasion’ny governemanta notarihin’ny\r\n\r\npraiminisitra Solonandrasana Mahafaly Olivier ny zoma 10 martsa teo', 'Tonga ny mpandeha, ny mpanamory tsy hita. Niesona tao amin’ny seranam-piaramanidina Antalaha efa ho adim-pamantaranandro iray latsaka ny delegasion’ny governemanta notarihin’ny\r\n\r\npraiminisitra Solonandrasana Mahafaly Olivier ny zoma 10 martsa teo', '<p><span lang="EN-US">Tsy firindran&rsquo;ny fandaharam-potoana no niteraka ny fangalapiery. Samy tany an-toerana nijery ny takaitra vokatry ny fandalovan&rsquo;ny rivodoza Enawo ny filoha sy ny praiminisitra. Nandeha helik&ocirc;ptera avy any Maroantsetra ny filoha ary namantana avy hatrany tao amin&rsquo;ny kianja monisipalin&rsquo;Antalaha. Nandeha fiaramanidina kosa ireo mambran&rsquo;ny governemanta notarihin&rsquo;ny praiminisitra ary niantsona ao amin&rsquo;ny seranam-piaramanidina. Tamin&rsquo;ny sivy ora no tokony ho nahatongavan&rsquo;ireto mpitondra ireto tany an-toerana saingy nisy fahatarana ora telo ny fahatongavan&rsquo;ny filoha, hany ka nanala fehi-tenda manga hatramin&rsquo;ny mpanotrona, ny andro rahateo nafana nigaingaina. Tamin&rsquo;ny 11ora no nihazo an&rsquo;Antalaha, 12km miala ny seranam-piaramanidina ny delegasionan&rsquo;ny governemanta.</span><span lang="EN-US">&nbsp;Tokony ho amin&rsquo;ny roa ora sy sasany latsaka teo no tafaverina tao amin&rsquo;ny seranam-piaramanidina ireto farany. Tsy tratra tao an-toerana ireo mpanamory fa nitady sakafo tany an-tan&agrave;nan&rsquo;Antalaha noho ny fiovan&rsquo;ny fandaharam-potoana, niala antsasakadiny talohan&rsquo;ny nahatongavan&rsquo;ireo minisitra. Tamin&rsquo;ny telo ora tolakandro ireo mpanamory vao tafaverina. Niesona niandry teo ireo manampahefana, izay tonga tanam-polo nanatitra kabary sy fampanantenana rahateo.</span></p>\r\n<p><span lang="EN-US">Nangonin&rsquo;i Jean D.</span></p>', 0, 1, 1, NULL),
(15, 2, 5, 0, '2017-03-15', 'Filankevitry ny Fampihavanana Malagasy 11 amin’ny 33 no hotendren’ny filoha', 'politika/Filankevitry-ny-Fampihavanana-Malagasy-11-aminny-33-no-hotendrenny-filoha-15032017-15', 'Nankatoavin’ny filankevitry ny minisitra ny herinanrdo lasa teo ny fananganana ny komity hisahana ny fifantenana sy fanendrena ireo mpikambana vaovao handrafitra ny Filankevitry ny Fampihavanana Malagasy (FFM) amin’ny endriny vaovao.', 'Nankatoavin’ny filankevitry ny minisitra ny herinanrdo lasa teo ny fananganana ny komity hisahana ny fifantenana sy fanendrena ireo mpikambana vaovao handrafitra ny Filankevitry ny Fampihavanana Malagasy (FFM) amin’ny endriny vaovao.', '<p><span lang="EN-US">Miisa 9 izy ireo, izay ahitana mpanao politika, fiarahamonim-pirenena, mpahay lal&agrave;na, ary raiamandreny ara-panahy sy ara-drazana. Nambaran&rsquo;i Maka Alphonse, iray amin&rsquo;ireo komity omaly, fa miisa&nbsp;&nbsp;33 ireo mpikambana handrafitra ny FFM, ka ny 22 dia hotendrena ary ny 11 kosa no hotendren&rsquo;ny filoham-pirenena mivantana. Iray avy isaky ny faritra kosa no hivoahan&rsquo;ireo 22 hotendren&rsquo;ny komity manokana, ka mila manatitra ny antontan-taratasiny eo anivon&rsquo;ny komity mpanao sivana ireo izay te hiditra ho mpikambana vaovao anatin&rsquo;ny FFM. Araka ny andininy faha-13 ao anatin&rsquo;ny lal&agrave;na mikasika ny fananganana io filankevitra io, dia tsy tokony ho mpanao politika no handrafitra azy io. Voafaritra ao anatin&rsquo;ny andininy faha-16 kosa fa olona mizaka ny zom-pirenena Malagasy, tsy latsaky ny 40 taona ary tsy mbola nigadra. Olona tokony hanana fahaiza-manao momba ny fampihavanana sy fametrahana lamina politika eto amin&rsquo;ny firenena ihany koa ary tsy mbola nanao fanambarana ampahibemaso fa tsy ilaina ny fampihavanam-pirenena. Raha ny fahitana azy ary efa niteraka adihevitra teto amin&rsquo;ny firenena ny hoe ny filoha dia anisan&rsquo;ny olona hampihavanina, kanefa izy no hanendry ny ampahany ao anatin&rsquo;ity filankevitra ity, izay mety hiteraka fitongilanana ihany. Ny hirariana dia mba handeha amin&rsquo;izay ny tena fampihavanam-pirenena satria efa tena mijaly ary leo krizy ny Malagasy.</span></p>\r\n<p><span lang="EN-US">&nbsp;</span></p>\r\n<p>Toky R</p>', 0, 1, 1, NULL),
(16, 2, 17, 0, '2017-03-14', 'Ho tratra foana anie e…', 'taratasy-ho-ani-jean/Ho-tratra-foana-anie-e-14032017-16', 'Miarahaba anao jean a..efa tena mandeha tsara ve ilay ankety e, sao mantsy vitan’ny raharaham-pihavanana misy tsindry bokotra eo indray ny raharaha famonoan’olona sy fandoroana tanana tany avaratra andrefana farany teo iny a.Fa tena fady anareo mihitsy ve ilay mba mampita vaovao e ?Avy eo rehefa misy zavatra mivoaka tonga fofona be nareo fa hoe vaovao diso.', 'Miarahaba anao jean a..efa tena mandeha tsara ve ilay ankety e, sao mantsy vitan’ny raharaham-pihavanana misy tsindry bokotra eo indray ny raharaha famonoan’olona sy fandoroana tanana tany avaratra andrefana farany teo iny a.Fa tena fady anareo mihitsy ve ilay mba mampita vaovao e ?Avy eo rehefa misy zavatra mivoaka tonga fofona be nareo fa hoe vaovao diso.', '<p><span lang="EN-US">Ka omeo ny vaovao marina sy ara-potoana ary izahay e.Sao ianao ry jean mihevitra fa hoe adino iny afera iny a, tena manaraka akaiky an&rsquo;iny na ny eto an-toerana na ny any ivelany koa raha mitamatama eo ianareo dia ahita raharaha a.Sao dia heverinao fa nandra daholo ary ny olona eto an-tanana eto ry jean a.Iny eo ihany fa mba ahoana koa moa ry jean ny momba an&rsquo;ireo boaderozy trata teny afovoan-dranomasina nifanenjehana iny a..Toa tsy nisy tohiny intsony, aiza izao ireny hazo tratra ireny.Mbola mananatra anao ihany aho ry jean a, mba matahora an&rsquo;Andriamanitra dia aza tia an&rsquo;io kiafinafina io fa tsy maintsy ho hitan&rsquo;ny olona foana anie ny nafenina e.Izay aloha fa mazotoa ianao ry jean a.</span></p>\r\n<p><span lang="EN-US">Marco</span></p>', 0, 1, 1, NULL),
(17, 2, 1, 0, '2017-03-14', 'Takaitra navelan\'i Enawo Mankahery ny Malagasy i Etazonia sy Frantsa', 'misongadina/Takaitra-navelani-Enawo-Mankahery-ny-Malagasy-i-Etazonia-sy-Frantsa-14032017-17', 'Sesilany ny fanambarana ataon’ireo firenen-dehibe, izay maneho hatrany ny fiombonam-po amin’ny Malagasy manoloana ny loza voajanahary izay namoizana ain’olona maro.', 'Sesilany ny fanambarana ataon’ireo firenen-dehibe, izay maneho hatrany ny fiombonam-po amin’ny Malagasy manoloana ny loza voajanahary izay namoizana ain’olona maro.', '<p><span lang="EN-US">Nanamafy ny azy ny Amerikanina omaly, ka&nbsp;&nbsp;maneho ny fiaraha-miory tanteraka amin\'ireo fianakaviana izay namoy ny havany vokatry ny fandalovan\'ny rivodoza Enawo, tamin&rsquo;ny alalan&rsquo;ny masoivohony eto Madagasikara. Nanamafy ny fiaraha-miasa akaiky amin\'ny governemanta Malagasy sy ireo mpiara-miombon\'antoka aminy amin\'ny fandrefesana ireo fahasimbana sy takaitra navelan\'i Enawo ity firenen-dehibe ity. Tsiahivina fa efa nisy fanolorana fanampiana ara-tsakafo milanja 100 taonina toy ny vary, voamaina, menaka ho an\'ireo traboina manodidina ny 20.000 eto Antananarivo Renivohitra nataon&rsquo;ny fandaharan\'asa iraisam-pirenena momba ny sakafo na ny PAM ny faran\'ny herinandro teo. Niara-niombon\'antoka betsaka tamin\'izany ny Amerikanina tamin\'ny alalan\'ny USAID. Nanao fanambarana ihany koa ny "Quai d\'Orsay"&nbsp;&nbsp;na ny ministeran\'ny raharaham-bahiny Frantsay omaly, ka maneho fiaraha-miory amin\'ny fianakavian\'ireo namoy ny ainy sy ireo traboina ana hetsiny tamin\'ny rivodoza "Enawo" . Mafy ny fahavoazana tany avaratry ny Nosy izay namotika zavatra maro. Maneho firahalahiana amin\'ireo niharam-boina rehetra ny Frantsay ary milaza ho vonona amin\'ny fanampiana ara-materialy.</span></p>\r\n<p>Toky R</p>', 0, 1, 1, NULL),
(18, 2, 1, 0, '2017-03-14', 'TRABOINA AO ANOSIPATRANA Tafakatra 200 ireo milahatra fanampiana raha 50 no tena izy', 'misongadina/TRABOINA-AO-ANOSIPATRANA-Tafakatra-200-ireo-milahatra-fanampiana-raha-50-no-tena-izy-14032017-18', '14/03/2017\r\n\r\nTena be dia be tokoa ireo olon-tsotra manararaotra ireo traboina tsy manan-kialofana eto an-drenivohitra amin’izao fotoana izao.', '14/03/2017\r\n\r\nTena be dia be tokoa ireo olon-tsotra manararaotra ireo traboina tsy manan-kialofana eto an-drenivohitra amin’izao fotoana izao.', '<p><span lang="EN-US">Araka ny fitarainan&rsquo;ireo traboina mitoby etsy amin&rsquo;ny fokontany Anosipatrana Atsinanana omaly dia tafakatra 200 izy ireo rehefa tonga ny fanampiana nefa 50 isa no tena ho izy. Zara raha&nbsp;&nbsp;misy tonga any amin&rsquo;ireo traboina ny anjara fanampiany vokatr&rsquo;izany fa ireo olon-kafa avy any ivelany avokoa no mahazo ny tombontsoa. Miantso ireo tompon&rsquo;andraikitra voakasika araka izany ireto traboina ao Anosipatrana ireto mba hanara-maso akaiky ny fanampiana hatolotra azy ireny.</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 1, NULL),
(19, 2, 18, 0, '2017-03-14', 'Fidirana ho mpiasam-panjakana 200 monja ireo mpampivelona voaray ', 'fahasalamana/Fidirana-ho-mpiasam-panjakana-200-monja-ireo-mpampivelona-voaray--14032017-19', '200 monja tamin’ireo mpampivelona marobe nifaninana hiditra ho mpiasam-panjakana tamin’ity taona 2017 ity no voaray ary telo ny mpitsabo mpanampy', '200 monja tamin’ireo mpampivelona marobe nifaninana hiditra ho mpiasam-panjakana tamin’ity taona 2017 ity no voaray ary telo ny mpitsabo mpanampy', '<p><span lang="EN-US">Tena nitotongana tokoa ireo isa ireo raha oharina tamin&rsquo;ny taon-dasa, antony nanosika ny sekoly ambony INSPNMAD tarihin&rsquo;ny filoha tale jeneraliny Razanadrakoto Roland Albert namolavola ilay boky misy ny &ldquo;Programme national &eacute;ducatif Inspnmad&rdquo; taom-pianarana 2016-2017 hampiharina tsy ho ela ho an&rsquo;ireo mpianatra Paramed manaraka fiofanana ao aminy. Ankoatra izay, mbola betsaka amin&rsquo;ireo sekoly ambony any amin&rsquo;ny faritra eto amintsika no tsy mahalala akory ny mikasika ilay fanadinana nasionaly tokana sy ny rafitra LMD kasain&rsquo;ny fakiolten&rsquo;ny mpitsabo hotanterahina eto amintsika ny volana novambra ho avy izao ho an&rsquo;ny IFIRP sy ny sekoly manofana ho paramed tsy miankina nahazo fankatoavana avy amin&rsquo;ny fanjakana. Tamin&rsquo;ny alalan&rsquo;ny fitsidiham-paritra notanterahin&rsquo;ny CMR-Paramed no nahafantarana izany ka teraka ho azy io fandaharam-pianaran&rsquo;ny sekoly manokana io. Tanjony ny hanofana olona Hendry, mahay ary manam-pahalalana hisorohana ireo karazana tranga eny anivon&rsquo;ny hopitaly mampihen-danja ny mpitsabo mpanampy sy mpampivelona. Eo ihany koa ny hahafahana miaro ny ain&rsquo;ny vahoaka manontolo amin&rsquo;ny alalan&rsquo;ny fanofanana omena ireo mpianatra sy ny toe-tsaina vonona apetraka any anatin&rsquo;izy ireo.</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 1, NULL),
(20, 2, 3, 0, '2017-03-15', 'Fitrandrahan’ny Sinoa “gaz” ao Sakaraha Ahiana hivadika gidragidra', 'toe-karena/Fitrandrahanny-Sinoa-gaz-ao-Sakaraha-Ahiana-hivadika-gidragidra-15032017-20', 'Tsy eken’ireo vahoaka ny fanitarana tany ataon’ireo sinoa mitrandraka etona natoraly mankany amin’ny faritra fanajariana razana alohan’ny toeram-pandevenana.', 'Tsy eken’ireo vahoaka ny fanitarana tany ataon’ireo sinoa mitrandraka etona natoraly mankany amin’ny faritra fanajariana razana alohan’ny toeram-pandevenana.', '<p><span lang="EN-US">Nanizingizina ireo vahoaka tamin&rsquo;ny fanambarana nataon&rsquo;izy ireo tamin&rsquo;ny fidinana ifotony nataon&rsquo;ny Solombavambahoakan&rsquo;i Madagasikara voafidy tao Sakaraha Tinoka Roberto, nijery ny zava-misy taorian&rsquo;ny fitarainan&rsquo;ny vahoaka sy ny avy ao amin&rsquo;ny foko Tesomangy (tompon&rsquo;ny toeram-pandevenana) ary Ben&rsquo;ny tan&agrave;nan&rsquo;i Mahaboboka, ny faramparan&rsquo;ny herinandro iny, fa &ldquo;&nbsp;lavinay hatramin&rsquo;ny farany ny hakana sy hitrongisana an&rsquo;ireo toerana masina misy ny fasanay.&ldquo;.&nbsp;Maro amin&rsquo;ireo fifanarahana nifanaovana tamin&rsquo;ny sinoa mpitrandraka no tsy tanteraka mandrak&rsquo;ankehitriny, toy ny fananganana sekoly, hopitaly ary ny fanomezana rano fisotro madio. &ldquo;&nbsp;Tsy misy tombontsoa azonay mihitsy amin&rsquo;ity fitrandrahana ity. Na ny vola onitra amin&rsquo;ny tanimbarinay nosimbana sy nopotehina aza tsy azo. In-dray nandeha ihany izahay nomen&rsquo;ny sinoa vola, raha tokony ho isan-taona ny fandoavana izany, araka ny fifanarahana nisy sy natao. Rahonana sy fitapitahina ary ampihorohoroana foana izahay vahoaka raha vao mitaky ny volanay&nbsp;&ldquo;.</span></p>\r\n<h3><span lang="EN-US">&nbsp;Baikon&rsquo;ny minisitra</span></h3>\r\n<p><span lang="EN-US">&nbsp;</span><span lang="EN-US">Raha tian&rsquo;ireo sinoa, hoy ny rodoben&rsquo;ireto vahoaka, ny hitohizan&rsquo;ny fitrandrahana etona eto, dia tokony hotanterahina aloha ireo fampanantenana natao. Raha ny fanazavana azo hatrany, tsy hajain&rsquo;ireto sinoa mitrandraka etona ao Mahaboboka ihany koa ny voasoratra ao anatin&rsquo;ny bokin&rsquo;andraikitra. Raha nanontaniana kosa ny ampahany amin&rsquo;ireo sinoa mpiandry raharaha tao amin&rsquo;ity toeram-pitrandrahana ity, dia nilaza fa tsy mahafantatra na inona na inona. &ldquo;&nbsp;Any amin&rsquo;ny minisitra ianareo manontany&nbsp;fa mpanatanteraka baiko fotsiny&nbsp; izahay eto&nbsp;&ldquo;, hoy ireo sinoa. Ahiana ho toy ny tranga niseho tao Soamahamanina ny zavatra hisy any amin&rsquo;ny kaominina ambanivohitr&rsquo;i Mahaboboka, any amin&rsquo;ny distrikan&rsquo;i Sakaraha, faritra Atsimo Andrefana, raha tsy voalamin&rsquo;ny tompon&rsquo;andraikitra mahefa haingana ny toe-draharaha misy any an-toerana ankehitriny.</span></p>\r\n<p align="right"><span lang="EN-US">Eric R.</span></p>', 0, 1, 1, NULL),
(21, 2, 11, 0, '2017-03-14', 'Sarisary', 'sarisary-zaritena/Sarisary-14032017-21', '', '', '', 0, 1, 1, 'upload/17-03-15-1489569180.jpg'),
(23, 5, 5, 0, '2017-03-31', 'Andry Rajoelina Mikononkonona valifaty goavana ?', 'politika/Andry-Rajoelina-Mikononkonona-valifaty-goavana--31032017-23', 'Tapina ny daomy ho an’i Andry Rajoelina, raha ny hoavy politikany no dinihina.', 'Tapina ny daomy ho an’i Andry Rajoelina, raha ny hoavy politikany no dinihina.', '<p><span lang="EN-US">Efa mahatsapa tena izy fa tsy hisy mangirana ho azy intsony eto amin&rsquo;ny firenena ka naleony nisafidy ny hangina ?&nbsp;</span>Sa mbola miandry fahagagana ? Voatsipaka am-bavafo Rajoelina vao nahazo seza ny HVM. Potika sy nivaky tanteraka ny mpomba azy, ary toa ratsy fiafara avokoa ny ankamaroany. Misy ny migadra, misy ny misitri-belona noho ny fanenjehana ataon&rsquo;ny HVM ihany &hellip; Hatramin&rsquo;ny firotsahan-kofidiany aza sakanana ka nampidingin-drambo azy ny 12 febroary, nilazany fa tsy misy hahasakana azy tsy ho kandida. Tsy niandry ela ny HVM fa 2 andro taorian&rsquo;izay, ny 14 febroary, dia nivoaka ny didim-pitsarana manameloka an&rsquo;i Lylison, namany mahafatra-po higadra 1 taona an-tranomaizina, ka nangina indray izy, raha samy nihevitra ny rehetra fa tsy hikoso-maso amin&rsquo;ny fitondrana ankehitriny intsony ny tenany nanomboka tamin&rsquo;iny fanambarany iny. Midika zavatra maro ny fahanginany ankehitriny. Maro no manombana fa mbola mikaro-kevitra fatratra hihoarana amin&rsquo;ny tangena hampisotroin&rsquo;ny HVM azy izy, ary manomana ny valifatiny mihitsy.</p>\r\n<h3><strong>TSY FAHAFAHANA MIROTSAKA</strong></h3>\r\n<p>Raha halalinina ny zava-nisy na ara-tantara na miainga amin&rsquo;ny rivotra politika ankehitriny, efa naman&rsquo;ny tsy misy hevitra intsony ny momba an-dRajoelina. Mbola maloto tanteraka izy noho fanonganam-panjakana, izay fakana fahefana tsy tamin&rsquo;ny fomba demokratika. Midika zavatra be izany ka manimba tanteraka ny ho avy politikany. Etsy an-daniny, efa naloan&rsquo;ny firenen-dehibe izay voalaza fa tao ambadiky ny fanonganam-panjakana tamin&rsquo;ny 2009 ny tenany satria vita ny nilany azy, ka tapi-dalan-kaleha sy tsy misy hamikirana intsony. Mbola manenjika azy koa ny lal&agrave;na iraisam-pirenena amin&rsquo;ny alalan&rsquo;ny &ldquo;Fifanarahan&rsquo;i Cotounou&rdquo; noho ny raharaha 2009 ka tsy hahafahany mandray anjara amin&rsquo;ny fifidianana noho izy tompon&rsquo;antoka tamina raharaha fanonganam-panjakana. Hitady hevitra aza hataon&rsquo;ny fanjakana HVM noho ny hakanosana, ka mainka fa mahita hirika mazava azo hanapahan-doha ny olona atahoran&rsquo;ny tena. Fanirian&rsquo;ny rehetra anefa ny hirotsahan&rsquo;izay te hirotsaka, mba hahafahan&rsquo;ny Malagasy manan-tsafidy, indrindra hahafahan&rsquo;ny vahoaka mitsara ny tena mendrika sy nahavita nampandroso. Iza no namotika sy tsy nisaina afa tsy ny nameno paosy ?</p>\r\n<p>Toky R</p>', 1, 1, 1, 'upload/17-04-01-1491045787.jpg'),
(24, 5, 5, 0, '2017-03-31', 'TIM Atsimo Andrefana 1 er tour dia lany Ravalomanana', 'politika/TIM-Atsimo-Andrefana-1-er-tour-dia-lany-Ravalomanana-31032017-24', 'Nambaran’ny mpandrindra ny REG TIM any Atsimo Andrefana, Atoa Sazalahy Tsianihy fa manamafy ny tsy maintsy', 'Nambaran’ny mpandrindra ny REG TIM any Atsimo Andrefana, Atoa Sazalahy Tsianihy fa manamafy ny tsy maintsy', '<p>Nambaran&rsquo;ny mpandrindra ny REG TIM any Atsimo Andrefana, Atoa Sazalahy Tsianihy fa manamafy ny tsy maintsy &nbsp;<span lang="EN-US">hahatanteraka ny 1 er Tour dia vita ny fifidianana hahalany ny prezid&agrave; Ravalomanana amin&rsquo;ny fifidianana ho filoham-pirenena hotanterahina amin&rsquo;ny taona 2018 satria mila olona eken-tenin&rsquo;ny mpamatsy vola mahazatra avy any ivelany ady mila fandriampahalemana sy fampandrosoana mirindra koa i Madagasikara ka ny filohan&rsquo;ny antoko TIM Marc Ravalomanana irery ihany no afaka hanatanteraka an&rsquo;ireo voalaza ireo. Feno ny fepetra ho an&rsquo;ny TIM Atsimo Andrefana hampanjariana an&rsquo;io 1 er Tour dia vita io amin&rsquo;ny ara-dal&agrave;na satria efa voatsangana avokoa ireo DISTIM miisa 8 any amin&rsquo;ity Faritra ity afa-tsy ny DISTIM faha-9, ao Ampanihy, izay hatsangana amin&rsquo;ity faran&rsquo;ny herinandro ity. Menabe no nananganana DISTIM farany tamin&rsquo;ny 10 febroary 2017 teo. Efa tafatsangana ihany koa ny COMTIM 26 amin&rsquo;ny kaominina 30 misy ao Toliara faha-2 hiaraka hisalahy amin&rsquo;ny fanatanterahana ny 1er tour dia vita izany. Mikasika ny hetsika fitakiana ny hanokafana ny MBS Tv sy Radio indray, dia manohana izany 100% izahay aty Atsimo Andrefana, hoy Atoa Sazalahy Tsianihy, satria mila misitraka haino aman-jery ahenoana vaovao maro loko sy marim-pototra izahay.</span></p>', 0, 1, 1, NULL),
(25, 5, 5, 0, '2017-03-31', 'Filohan’ny CRN Mahajanga « Hahitsoky ny fitondrana ny fampihavanam-pirenena ! »', 'politika/Filohanny-CRN-Mahajanga--Hahitsoky-ny-fitondrana-ny-fampihavanam-pirenena---31032017-25', 'Noho ny tahotra ny marina no mahatonga ny fitondram-panjakana hanitsoka ny fampihavanana tena izy, hoy ny filohan’ny komitin’ny fampihavanam-pirenena (CRN) ao Mahajanga, Philémont.', 'Noho ny tahotra ny marina no mahatonga ny fitondram-panjakana hanitsoka ny fampihavanana tena izy, hoy ny filohan’ny komitin’ny fampihavanam-pirenena (CRN) ao Mahajanga, Philémont.', '<p>Ny fampihavanana notarihin&rsquo;ny filoha teo aloha, Zafy Albert, raha ny heviny, no tena izy satria ity farany no efa nanao fitetezam-paritra namantatra ny hetahetan&rsquo;ny Malagasy. Raha ny fahitana azy izao anefa dia malaina hanao io fampihavanana tena izy io ny fitondrana ka mandrirarira no ataony. Tsy misy afa-tsy dinika hanamboarana rafitra vaovao mialoha ny fifidianana no hany vahaolana raha tiana ny tsy hisian&rsquo;ny korontana, hoy izy.</p>', 0, 1, 2, NULL),
(26, 5, 17, 0, '2017-03-31', 'Taratasin’i Jean Ianareo re no favy e !', 'taratasy-ho-ani-jean/Taratasini-Jean-Ianareo-re-no-favy-e--31032017-26', 'Miarahaba ry Jean a ! Ianareo re no favy e ! izahay maka anareo ! Tena manao zavatra io fitondrana entinareo io fa miaiky izahay. Efa hitanay mihitsy ireny fihetsiketsehanareo mamonjy tra-pahavoazana amin’izao fotoana izao ireny.', 'Miarahaba ry Jean a ! Ianareo re no favy e ! izahay maka anareo ! Tena manao zavatra io fitondrana entinareo io fa miaiky izahay. Efa hitanay mihitsy ireny fihetsiketsehanareo mamonjy tra-pahavoazana amin’izao fotoana izao ireny.', '<p>Efa zarinareo ho tra-pahavoazana matetika mihitsy koa moa ilay havanay ka dia zaranareo aza mankalaza anareo foana angamba. Tena lasa saina aho ry Jean. Toa isan&rsquo;andro misy traboina foana ! Rehefa tsy izany dia mpanangona fanampiana ho an&rsquo;ny traboina ianareo. Dia manasongadin-tena, dia mamerimberina fa tsy manadino sy miarak&rsquo;ory. Ireo havanay koa moa etsy an-daniny efa difotry ny fahavoazany ka faly fa mahita mesia lalandava. Lasa aretiny mihitsy aza. Favy ho aho ianareo ! Marina e !</p>', 0, 1, 2, NULL),
(27, 5, 1, 0, '2017-03-31', 'Ny Rado Rafalimanana Hofohazina ny dosie 6 miliara ariary ?', 'misongadina/Ny-Rado-Rafalimanana-Hofohazina-ny-dosie-6-miliara-ariary--31032017-27', 'Efa saika hirotsaka hofidiana ho filoham-pirenena i Ny Rado Rafalimanana ny taona ny 2013, saingy tsy navela noho ny fepetra tsy feno.', 'Efa saika hirotsaka hofidiana ho filoham-pirenena i Ny Rado Rafalimanana ny taona ny 2013, saingy tsy navela noho ny fepetra tsy feno.', '<p><span lang="EN-US">Ankehitriny, anisan&rsquo;ny kandida amin&rsquo;ny 2018 indray ny tenany. Misy mamoha anefa ny tantara, raharaha maloto mahasaringotra azy, izay efa tena miparitaka any anaty tranokalam-pifandraisana. Mifoha ny resaka momba ny fifanarahana nataon&rsquo;ny fanjakana Malagasy sy ny orinasa Anxious Holding, tany amin&rsquo;ny fiandohan&rsquo;ny taona 2009. Raha tsiahivina, nahazo famatsiam-bola mitentina 25 tapirisa Euros avy amin&rsquo;ny fanjakana Indianina tamin&rsquo;ny alalan&rsquo;ny Exim Bank ny fanjakana tamin&rsquo;ny taona 2008 hividianana fitaovam-pamokarana ho an&rsquo;ny fambolena. Io orinasa Anxius Holding, azy io, no nifanaraka tamin&rsquo;ny fanjakana. Nisy anefa ny korontana ny taona 2009, ka tsy fantatra intsony izay tohin&rsquo;ny tantara. 6.151.564.920 ariary, voalaza fa volam-panjakana tamin&rsquo;izany no nampiasaina ary tokony honerany. Manjavozavo mandrak&rsquo;ankehitriny ny fanonerana io vola io. Ny tahirimbolam-panjakana aza tsy mahalala sy tsy mahita rirany amin&rsquo;izany. Nahoana no izao vao fohazina ny resaka ? Misy ambadika politika hoentina hikakana azy any anaty fifidianana ihany koa ve ? Maro ny mihevitra fa hanimbana ny ho avy politikan&rsquo;i Ny Rado Rafalimanana ity raharaha ity.</span></p>\r\n<p><span lang="EN-US">Toky R</span></p>', 0, 1, 2, NULL),
(28, 5, 1, 0, '2017-03-31', 'Traboina eto Antananarivo Hanaovana trano manara-penitra', 'misongadina/Traboina-eto-Antananarivo-Hanaovana-trano-manara-penitra-31032017-28', 'Notaterin’ny mpiandraiki-draharaha eo anivon’ny kaominin’Antananarivo Renivohitra, Sarah Zoé, tamin’ireo mpanao gazety tonga tetsy amin’ny lapan’ny tanàna etsy Analakely tamin’ny fomba ofisialy omaly ireo votoatin’ny dian’ny ben’ny tanànan’Antananarivo,', 'Notaterin’ny mpiandraiki-draharaha eo anivon’ny kaominin’Antananarivo Renivohitra, Sarah Zoé, tamin’ireo mpanao gazety tonga tetsy amin’ny lapan’ny tanàna etsy Analakely tamin’ny fomba ofisialy omaly ireo votoatin’ny dian’ny ben’ny tanànan’Antananarivo,', '<p><span lang="EN-US">Lalao Ravalomanana, tany ampitan-dranomasina farany teo. Lafin-javatra 2 lehibe no anton-dian&rsquo;ny ben&rsquo;ny tan&agrave;na sy ireo delegasioniny nandritry ny herinandro, dia ny fanavaozana ny fiaraha-miasa amin&rsquo;ny region &icirc;les de France sy ny kaominina izay efa 25 taona izao sy ny fiaraha-miasa amin-dry zareo Ivoarianina amin&rsquo;ny ady atao amin&rsquo;ny aretina Sida sy ny fiahiana ny reny sy ny zaza. Fantatra ary fa hanome tanana an&rsquo;Antananarivo ny Region &icirc;les de France (RIF) amin&rsquo;ny fananganana trano manara-penitra ho an&rsquo;ireo faritra eto Antananarivo izay saika traboina isan-taona mba hitoeran&rsquo;izy ireo amin&rsquo;ny toerana maina sy voaaro ho vahaolana maharitra ialana amin&rsquo;ny fahasahiranany. Hohamafisina ihany koa ireo fotodrafitrasa efa mizotra, toy ny fandaminana ny tan&agrave;na sy fanamboarana saha maitso. Nanazava ny avy eo anivon&rsquo;ny kaominina fa vonjimaika ihany aloha ny fanamboaran-dalana mandra-pahatapitry ny fahavaratra any amin&rsquo;ireo toerana heverina fa tena misy fikatsoam-pifamoivoizana fa efa eo am-pamolavolana kosa ny tena fanarenana ireny lalana simba ireny ny kaominina ary efa miezaka mandrindra ny fifamoivoizana.</span></p>\r\n<p><span lang="EN-US">Mirija</span></p>', 0, 1, 2, NULL),
(29, 5, 19, 0, '2017-03-31', 'Fanjakana miala aina !', 'edito/Fanjakana-miala-aina--31032017-29', 'Roso mankany amin’ny fitakiana ny demokrasia isika izao. Hatreto, resabe no nataon’ireo mpitondra fa tsy mba nisy ny fahalalahana, indrindra fa tamin’ity fitondrana ity.', 'Roso mankany amin’ny fitakiana ny demokrasia isika izao. Hatreto, resabe no nataon’ireo mpitondra fa tsy mba nisy ny fahalalahana, indrindra fa tamin’ity fitondrana ity.', '<p><span lang="EN-US">Izay miteny dia amoahana didy fampisamborana sy gadraina. Ny fahalalahan&rsquo;ny fampahalalam-baovao moa dia nofy tanteraka. Natao an-terisetra ny lal&agrave;na izay miendrika fanakantsakanana ny fanehoan-kevitra sy ny fampahalalam-baovao. Giazana ho an&rsquo;ny mpitondra samirery ny radio sy ny televizionim-panjakana. Afaka manangana orinasan-tserasera handokafana ny mpitondra avokoa izay manana vola azo ampiasaina amin&rsquo;izany. Ny hafa kosa anaovana antsojay sy sakanana ka eny an-kianja sisa no hifampitana vaovao noho ny didin&rsquo;ny be sandry tsy mahazaka fifaninanana ka jamban&rsquo;ny tahotra ny ho takona sy tsy hisy mpanaraka ara-poto-kevitra. Fa fanjakana inona loatra ity mihevi-tena tsy ho tratry ny aloka ity e ? Raha mahatoky tena dia mamela malalaka ny rehetra. Sao dia fanjakana miala aina ?</span></p>\r\n<p><span lang="EN-US">Toky R</span></p>', 0, 1, 1, NULL),
(30, 5, 18, 0, '2017-03-31', 'Marary voa eto Madagasikara 300 ihany no afaka mitsabo tena', 'fahasalamana/Marary-voa-eto-Madagasikara-300-ihany-no-afaka-mitsabo-tena-31032017-30', 'Anisan’ny aretina iray mahazo vahana ny aretin’ny voa eto amintsika.', 'Anisan’ny aretina iray mahazo vahana ny aretin’ny voa eto amintsika.', '<p><span lang="EN-US">sy manavaka taona intsony izy io amin&rsquo;ny ankapobeny fa ireo tanora vao herotrerony mpianatry ny anjerimanontolo 18, 20, 22 taona no tena mahita faisana raha 14 taona no zandriny indrindra izay marihina fa tsy azo hatao &ldquo;dialyse&rdquo; fa tsy maintsy alefa any ivelany. Mbola ambany dia ambany anefa ny tahan&rsquo;ireo marary afaka mitsabo tena eto amintsika, izany hoe afaka manao dialyse in-telo isam-bolana amin&rsquo;ny sarany 210.000 Ar isaky ny mandeha. 300 monja amin&rsquo;ireo marary miisa 2.000 manerana ny Nosy, hoy Rasoahanta Pascaline, filohan&rsquo;ny fikambanana FMRI ( Federasion des Maladies Insuffisance R&eacute;nale de Madagascar). Tsy afa-manoatra ny ambiny fa miandry fahafatesana&nbsp;&nbsp;any an-trano na lazoan&rsquo;ny aretina fotsiny. Raha indray mandeha monja anefa ny fahafahan&rsquo;ny marary iray manao dialyse ao anatin&rsquo;ny iray volana dia mivonto avokoa ny tongotra aman-tanany ary tsy&nbsp;&nbsp;afaka manao ny asany ara-dal&agrave;na toy ny mahazatra intsony izy ireo. Mba hanampiana azy ireny dia hangatahiny amin&rsquo;ny fanjakana ny hahafahana mitsabo azy ireny maimaimpoana toy ny iainan&rsquo;ireo marary voa any amin&rsquo;ny Nosy rahavavy Maurice amin&rsquo;izao fotoana izao. Toraka izany koa ny hanaparitahana ny toerana fanaovana dialyse fa tsy avela hivangongo amina faritra toerana vitsy monja. Tsy latsa-danja amin&rsquo;ireo ny fandanian&rsquo;ireo olom-boafidy ny lalana ny amin&rsquo;ny tokony hahafahantsika eto Madagasikara manao ilay fanoloana voa na fanaovana grefy ho tombontsoan&rsquo;ny marary. Anisan&rsquo;ny mahatonga ny aretin&rsquo;ny voa ny fihinanana sakafo matavy loatra, ny voamaina matetika&hellip;</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 1, NULL),
(31, 5, 3, 0, '2017-03-31', 'Minisiteran’ny varotra sy ny fanjifana Nitsidika tampoka an’Antsirabe', 'toe-karena/Minisiteranny-varotra-sy-ny-fanjifana-Nitsidika-tampoka-anAntsirabe-31032017-31', 'Nitsidika tampoka ireo mpamongady vitsivitsy ao Antsirabe ny tale jeneralin’ny minisiteran’ny varotra sy ny fanjifana, Atoa Rakotomanga Soloalitiana omaly alakamisy 30 martsa.', 'Nitsidika tampoka ireo mpamongady vitsivitsy ao Antsirabe ny tale jeneralin’ny minisiteran’ny varotra sy ny fanjifana, Atoa Rakotomanga Soloalitiana omaly alakamisy 30 martsa.', '<p><span lang="EN-US">Ny vidim-bary no tena notsirihan&rsquo;izy ireo nandritra ny fisafoana tampoka nataony. Tsy nisy ny olana tao Antsirabe satria efa nidina ambany dia ambany ny vidim-bary teny amin&rsquo;ireo mpamongady notsidihina. Manodidina ny 1250 Ariary ny kilaon&rsquo;ireo vary vao niakatra. Ny vidin&rsquo;ireo vary avy any ivelany kosa tsy mbola nahitana fidinany, 1550 Ar ny kilao. Nambaran&rsquo;ity tompon&rsquo;andraikitra ity moa fa anisan&rsquo;ny mahatonga ny vidim-bary hidangana ny fandanian&rsquo;ireo mpaninjara ireo vary efa novidiany tamin&rsquo;ny masonkarena ambony. Mety hidina ihany ny vidim-bary any an-toerana satria miakatra ny vary vao.</span></p>\r\n<p align="right"><span lang="EN-US">Caius R</span></p>', 0, 1, 0, NULL),
(32, 5, 6, 0, '2017-03-31', 'FITANTANANA SY LALANA Lalam-piofanana tena mahaliana ny tanora', 'fanabeazana/FITANTANANA-SY-LALANA-Lalam-piofanana-tena-mahaliana-ny-tanora-31032017-32', 'Anisan’ny lalam-piofanana mbola tena mahaliana ny tanora ankehitriny ny fitantanana sy ny lalàna.', 'Anisan’ny lalam-piofanana mbola tena mahaliana ny tanora ankehitriny ny fitantanana sy ny lalàna.', '<p><span lang="EN-US">&nbsp;Ho an&rsquo;ny fitantanana manokana dia hahafahana mampandroso ny firenena ny fahaizana azy ka mahasarika ny tanora. Tsy very mandeha kosa izay mahay lal&agrave;na ka izay no antony hifanotofan&rsquo;ny tanora aminy. Niampy 70 isa indray ireo tanora manampahaizana tafiditra ao anatin&rsquo;izany eto amintsika. Mpianatra navoakan&rsquo;ny sekoly ambony ISSUP izy ireo notolorana ny maripahaizana Dipl&ocirc;mes de technicien&nbsp;&nbsp;Superieur sy ny Licence. Omaly no nanatanterahana ny lanonana teny Ampitatafika, notronin&rsquo;ny solontenan&rsquo;ny minisitry ny fampianarana ambaratonga ambony.</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 1, NULL);
