(33, 5, 20, 0, '2017-03-31', 'Fikaonandohan’ny Akademia Malagasy Hamantatra ny tena marina momba ny raharaha 1947', 'kolon-tsaina/Fikaonandohanny-Akademia-Malagasy-Hamantatra-ny-tena-marina-momba-ny-raharaha-1947-31032017-33', 'Nanokatra ny fikaonan-doha mifantoka amin’ny fanamarihana ny faha-70 taonan’ny tolom-panafahana 1947 notanterahina teny amin’ny Akademia Malagasy teny Tsimbazaza ny Filoham-pirenena Hery Rajaonarimampianina omaly', 'Nanokatra ny fikaonan-doha mifantoka amin’ny fanamarihana ny faha-70 taonan’ny tolom-panafahana 1947 notanterahina teny amin’ny Akademia Malagasy teny Tsimbazaza ny Filoham-pirenena Hery Rajaonarimampianina omaly', '<p>Nandritra io fotoana io no nilazany fa ny fampitana ny faneva sy ny afom-pitiavan-tanindrazana nananan&rsquo;ireo nitolona fahiny amin&rsquo;ny tanora dia antoka lehibe mitarika any amin&rsquo;ny firaisam-pirenena, ary l&agrave;lana mizotra mankany amin&rsquo;ny fampandrosoana an&rsquo;i Madagasikara. Tanjona goavana tamin&rsquo;ny fanatanterahana ity fikaonan-doha ity ny mba hahafantarana ny tantara tena marina manodidina ny raharaha 1947, ka ho an&rsquo;ny Pr Marcel Razanaparany, Filohan&rsquo;ny Akademia Malagasy, dia ilay ny mamamtatra ny olana izay lasa sakana amin&rsquo;ny fiombonam-pirenena, izay l&agrave;lana hahatongavana amin&rsquo;ny tanjona dia ny hoe Madagasira tsy voageja sy mahaleo tena. Ho an&rsquo;ny Pr Raymond Ranjeva kosa, dia isan&rsquo;ny zava-dehibe ny famotopotorana ny sata aman-dal&agrave;na ary ny lal&agrave;m-panorenana, ny anjara toeran&rsquo;ireo avara-pianarana, ny resaka loharanon-karena miainga amin&rsquo;ireo harentsika tsy hita noanoa, ny setriny avy amin&rsquo;ny Malagasy manoloana ny sehatra Iraisam-pirenena. Nivoatra nandritra ity fikaonanan-doha ity ny tokony handrehetana hatrany ny afon&rsquo;ny fitiavan-tanindrazana sy ny fampitana ny fanilo ho an&rsquo;ireo tanora sy taranaka aty&nbsp;aoriana. Notsiahivin&rsquo;ny filoham-pirenena Hery Rajaonarimampianina rahateo fa lohahevitra nitondrana ny fanamarihana ny faha-70 ny tolom-panafahana 1947&nbsp;&nbsp;ny hoe &laquo;&nbsp;Fanilo miampiata, ny lasa tsy fanadino&nbsp;&raquo;.</p>\r\n<p>&nbsp;</p>\r\n<p>Toky R</p>', 0, 1, 1, NULL),
(34, 5, 20, 0, '2017-03-31', 'Fampisehoan\'i Njila sy Poopy Mpanohana ofisialy ny Airtel', 'kolon-tsaina/Fampisehoani-Njila-sy-Poopy-Mpanohana-ofisialy-ny-Airtel-31032017-34', 'Ny alahady 9 aprily ho avy izao, manomboka amin’ny 3 ora folakandro no hotanterahina etsy amin’ny lapan’ny kolontsaina sy ny fanatanjahantena etsy Mahamasina ilay fampisehoana goavambe nampitondraina ny lohateny hoe : “Firaisankina”, tanterahin’i Njila sy Poopy.', 'Ny alahady 9 aprily ho avy izao, manomboka amin’ny 3 ora folakandro no hotanterahina etsy amin’ny lapan’ny kolontsaina sy ny fanatanjahantena etsy Mahamasina ilay fampisehoana goavambe nampitondraina ny lohateny hoe : “Firaisankina”, tanterahin’i Njila sy Poopy.', '<p>Tafiditra ao anatin&rsquo;ny fankalazana ny faha-40 taona niakaran&rsquo;ny roa tonta an-tsehatra izany, izay efa misy fan&rsquo;s club an&rsquo;alin-kisa. Anisan&rsquo;ny manohana ofisialy ity hetsika ity&nbsp;&nbsp;ny orinasam-pifandraisana Airtel Madagascar hahafahana manandratra avo ny talentan&rsquo;ireto mpanakanto Malagasy efa fanta-daza ireto. Tsy mandalo fotsiny mantsy ilay lohateny&nbsp;&nbsp;Firaisankina ho an&rsquo;ny Airtel Madagascar fa tena mifanaraka amin&rsquo;ny foto-kevitra izay&nbsp;&nbsp;voizin&rsquo;izy ireo. Mampanantena ny tarika Njila fa hanao izay ho afany amin&rsquo;io daty io ary mihoatra lavitra noho izany amin&rsquo;ny fitsingerinan&rsquo;ny taona niakarany an-tsehatra. Ny Mah-ki Productions no mpikarakara ny lanonana izay marihina fa mpirevy Njila 100 %, toy izany koa i Poopy ilay mpanakanto vehivavy nivoaka avy tao anaty vondrona.&nbsp;<span lang="EN-US">Marihina fa ho avy ao koa i Anyah, Melky, Mahery ary Christian kely hanotrona azy ireo.</span></p>\r\n<p><span lang="EN-US">Pati</span></p>', 0, 1, 1, NULL),
(35, 5, 11, 0, '2017-03-31', 'Sovenira ratsy', 'sarisary-zaritena/Sovenira-ratsy-31032017-35', '', '', '', 0, 1, 2, 'upload/17-04-01-1491071272.jpg'),
(36, 6, 5, 0, '2017-04-03', 'Marc Ravalomanana Hosamborina indray ?', 'politika/Marc-Ravalomanana-Hosamborina-indray--03042017-36', 'Nanaitra ny maro ny fanambarana nataon’i Zafilahy Stanislas teny amin’ny kianjan’ny Finoana Magro Behoririka ny sabotsy 1 aprily lasa teo.', 'Nanaitra ny maro ny fanambarana nataon’i Zafilahy Stanislas teny amin’ny kianjan’ny Finoana Magro Behoririka ny sabotsy 1 aprily lasa teo.', '<p><span lang="EN-US">Mbola henjana ny fifidianana 2018 ary misy ny fandripandrika, ka aleo aloha ny raiamandrenintsika tsy hofandrihana fa aleo isika no mahita loza, toy izay ny raiamandrenintsika ka mety tsy ho afaka hirotsaka, izay mety hahavery maina ny tolona natao hatrizay&rdquo;, hoy izy. Fanambarana izay midika fa mailo i Marc Ravalomanana sy ny TIM. Mety misy indray mantsy ny paikady maizina any ambadibadika any hampijabahana ity filoha teo aloha ity ka mety hitarika ny fisamborana sy ny fanagadrana azy indray, tahaka ny efa nataon&rsquo;ny fitondrana HVM ny 13 oktobra 2014. Mialoha izao dia efa nisy feo nivoaka koa&nbsp;&nbsp;fa tsy avela miditra eto Madagasikara ka hampiharana NOTAM indray i Marc Ravalomanana izay nijanona naharitra tany Eoropa. Tsy noraisina indray moa io fanapahan-kevitra io ary tafaverina an-tanindrazana izy.</span></p>\r\n<h3><span lang="EN-US">&ldquo;Ultimatum&rdquo; herinandro</span></h3>\r\n<p><span lang="EN-US">Ankoatra izay, manome fe-potoana herinandro ny filankevi-panjakana mba hitsara ny raharaha MBS ny zanak&rsquo;i Dada sy ny Tiako i Madagasikara nivory tetsy amin&rsquo;ny Magro ny sabotsy tolakandro teo. Tsy adala ny vahoaka Malagasy amin&rsquo;izao zavatra hita fa tsy mety izao. Matoky ny fahendrenareo izahay, ka mba hamoaka ny didy mikasika izany, hoy i Zafilahy Stanislas. Nanamarika ny fotoana teny amin&rsquo;ny Magro afak&rsquo;omaly iny ihany koa ny fahatongavan&rsquo;i Leriva Manahirana, tsy vahiny amin&rsquo;ny mpikambana TIM, izay mandrisika hatrany amin&rsquo;ny hanohizana ny tolona. Tsy hiato ary vao mainka hihamafy ny hetsika eny amin&rsquo;ny kianja Magro mba hisokafan&rsquo;ny haino aman-jery MBS, ary ilaina ny hanitarana izany any amin&rsquo;ny faritra manerana ny Nosy, hoy hatrany ny fanehoan-kevitra teny amin&rsquo;ny Magro Behoririka ny sabotsy teo. Tapa-kevitra ny zanak&rsquo;i Dada ary tsy hihemotra intsony.</span></p>', 1, 1, 1, 'upload/17-04-04-1491294497.jpg'),
(37, 6, 5, 0, '2017-04-03', 'Fanomanana ny fifidianana 2018 Tany Côte d’Ivoire i Orlando Robimanana', 'politika/Fanomanana-ny-fifidianana-2018-Tany-Cte-dIvoire-i-Orlando-Robimanana-03042017-37', 'Manomboka heno amin’ny sehatra politika i Robimanana Orlando, tale jeneralin’ny tahirimbolam-panjakana teo aloha.', 'Manomboka heno amin’ny sehatra politika i Robimanana Orlando, tale jeneralin’ny tahirimbolam-panjakana teo aloha.', '<p><span lang="EN-US">Re mantsy fa miketrika mafy amin&rsquo;ny firotsahan-kofidiany ho filoham-pirenena amin&rsquo;ny taona 2018 ihany koa ny tenany amin&rsquo;izao fotoana izao. Araka ny loharanom-baovao iray dia tany C&ocirc;te d&rsquo;Ivoire izy ny herinandro teo nitady mpiara-miombon&rsquo;antoka ary voalaza fa nandalo tany Frantsa ihany koa, saingy tsy fantatra aloha hatreto na efa tafaverina eto an-tanindrazana na tsia. Voalaza ihany koa fa niara-dia taminy ny praiminisitra teo aloha Camille Vital, izay azo heverina fa hiara-dalana sy hifanohana aminy amin&rsquo;ny 2018. Tombanana ho anisan&rsquo;ny olona hampiasa volabe i Robimanana Orlando raha jerena amin&rsquo;ny toerana efa niantsorohany. Amin&rsquo;izao fotoana dia efa manomboka hita ireny karazana alimanaka izay misy ny sariny ireny, mba ho fampahafantarana azy sahady.</span></p>\r\n<p><span lang="EN-US">Toky R</span></p>', 0, 1, 2, NULL),
(39, 9, 5, 0, '2017-05-06', 'Filoha sy Praiminisitra Mifampiandry kendritohana ?', 'politika/Filoha-sy-Praiminisitra-Mifampiandry-kendritohana--06052017-39', 'Re fa toa samy manana ny ekipany ny filoham-pirenena Hery Rajaonarimampianina sy ny praiminisitra  Solonandrasana Mahafaly Olivier, izay tsy nety voailika teo amin’ny toerany na dia efa ela aza no nandeha ny resaka fa hoesorina izy.', 'Re fa toa samy manana ny ekipany ny filoham-pirenena Hery Rajaonarimampianina sy ny praiminisitra  Solonandrasana Mahafaly Olivier, izay tsy nety voailika teo amin’ny toerany na dia efa ela aza no nandeha ny resaka fa hoesorina izy.', '<p class="resume">Milaza azy ho tsy miady tsy miady ny fitondrana ankehitriny, saingy tsikaritra fa efa mifanipaka sy samy manao izay saim-patany.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;Vao mainka aza toa niha nahazo faka sy mamahatra ao anaty fitondrana na dia efa nalaza ratsy ho mpiray tsikombakomba amin-dRamatoa Claudine Razaimamonjy aza. Tsy sahin&rsquo;ny filoham-pirenena kosa anefa ny manala azy mivantana noho ny efa fananany olona miara-dia aminy ao anatin&rsquo;ny governemanta, izay efa nalaza ratsy fa tokony horoahina tsy ho minisitra noho ny resaka afera, saingy mbola tafajanona ao miaraka amin&rsquo;ny praiminisitra, ary miray hina sy miray saina ny tsy hanaiky lembenana hiala tsotra eo anivon&rsquo;ny fitondrana. Voalaza fa manana ny olony ny praiminisitra, ary manana ireo mitapikitra sy miezaka mijoro ho namana mahatoky azy ihany koa i Hery Rajaonarimampianina, ka tsy sahy mifampikitikitika, hany ka samy manao izay danin&rsquo;ny kibony sy tsy mifampijabaka fotsiny satria samy manana ny aferany, ary samy matahotra mafy ny hipoahan&rsquo;ny afera malotony avy. Tsy atao mahagaga raha tsy misy mety mivoaka ny marina amina resaka afera maro, toy ny raharaha Claudine Razaimamonjy satria mifampiandry kendritohana ny an-daniny sy ny an-kilany, ka raha vao mipoaka ny aferan&rsquo;ny iray, dia hanapoaka sy hamaky bantsilana ny an&rsquo;ny iray ihany koa, ka aleo samy mamgina sy mifampihatsaravelatsihy <br /> <br /> Filohana andrim-panjakana mampiahiahy<br /> Tsy mbola hay ihany koa izay tena kajin&rsquo;ireo filohan&rsquo;ny Antenimiera 2 tonta, izay tsikaritra ho efa te ho lohany. Tsy tena olon&rsquo;ny HVM rahateo izy ireo fa samy nanana ny foto-kevitra sy antoko politikany no tonga akaiky ny HVM, izay mety ho resaka tombotsoa no naharoboka azy, ka rehefa hita fa tena tsy misy antenaina intsony amin&rsquo;ny fitondrana dia tsy ho sarotra ho azy ireo ny hikopak&rsquo;elatra sy hitady famaharana amin&rsquo;ny hafa. Tafiditra ao anatin&rsquo;ireo mpanao poltika sokajian&rsquo;ny mpanara-baovao ho isan&rsquo;ireo tsy mpitaingina soavaly maty izy ireo, ka any amin&rsquo;izay mahatolotolotra ihany no mamahatra. Mafampana ny raharaha, toy ny resaka fitsipaham-pitokisana eny amin&rsquo;ny antenimieram-pirenena, ka solombavambahoaka hatrany amin&rsquo;ny 75 no voalaza fa efa vonona sy miombon-kevitra amin&rsquo;ny fitsipahana an&rsquo;i Solonandrasana Mahafaly Olivier sy ny ekipany. Ho hita eo izay mety ho tohiny.</p>', 1, 1, 1, 'upload/17-05-08-1494225300.jpg'),
(41, 10, 5, 0, '2017-05-06', 'Tsy misy ilana azy ny fitondrana HVM  Ho eny amin’ny 13 mey ny RMTF', 'politika/Tsy-misy-ilana-azy-ny-fitondrana-HVM--Ho-eny-aminny-13-mey-ny-RMTF-06052017-41', 'Hanao hetsika eny amin’ny kianjan’ny 13 mey ny Rodobe Malagasy ho an’ny Tolon’ny Fanorenana (RMTF) ny 13 mey izao, hoy Rainidina Rajoharison, anisan’ireo mpitarika ity vondron-kery politika ity.', 'Hanao hetsika eny amin’ny kianjan’ny 13 mey ny Rodobe Malagasy ho an’ny Tolon’ny Fanorenana (RMTF) ny 13 mey izao, hoy Rainidina Rajoharison, anisan’ireo mpitarika ity vondron-kery politika ity.', '<p><span lang="EN-US">Ao anatin&rsquo;ny lalan-tsaina famondronana ny herim-bahoaka no hanatanterahana ny hetsika. Tokony haneho ny vahoaka fa tsy mety intsony izao fitondrana misy amin&rsquo;izao fotoana izao fa efa tena latsaka an-katerena loatra ny firenena, miha mahantra ny vahoaka ary mihavery hatrany ny hareny. Tokony hihetsika izy hitaky fa tsy maintsy misy ny fanovana fitondrana. Ary izany no tokony hanehoany hery hoe ireto izahay vahoaka manohitra izao fitondrana izao ary mitaky ny fanovana mankany amin&rsquo;ny fanorenana ifotony ny firenena, ka hanangana ny tetezana miampita mankany, hoy hatrany ity mpitarika ny RMTF ity. Raha ny fahalalanay azy dia tsy misy fangatahana alalana ny hidirana eny amin&rsquo;ny 13 mey tamin&rsquo;ny herintaona ary tsy hay na hiova hevitra ny prefektiora na ahoana fa ny fantatray dia fahatsiarovana hetsi-bahoaka, fanehoana herim-bahoaka no hatao fa tsy misy resaka fandehanana eny Ambohitsorihitra hanongam-panjakana, hoy Rainidina Rajoharison.</span></p>\r\n<p><span lang="EN-US">Toky R</span></p>', 0, 1, 2, NULL),
(42, 11, 1, 0, '2017-05-08', 'Senatera Olga Ramalason   Ilaina fankatoavana lalàna ny fampandrosoana firenena', 'misongadina/Senatera-Olga-Ramalason---Ilaina-fankatoavana-lalna-ny-fampandrosoana-firenena-08052017-42', '', '', '<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Tranga iray mampiseho ny fahantran&rsquo;ny mponina eto Madagasikara ny lafiny tsy fahampian-tsakafo. Lasibatra manokana amin&rsquo;ity zava-misy ity ny zaza sy ny vehivavy Malagasy. Tandindomin&rsquo;ny tsy fanjarian-tsakafo miaraka amin&rsquo;ny fahabangana vitamina A, ohatra, ny ankizy 1 amin&rsquo;ny 2 eo anivon&rsquo;ny fiarahamonina Malagasy. </span><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Mandray andraikitra manoloana azy io ankehitriny ireo parlemantera mpanao lal&agrave;na mivondrona ao anatin&rsquo;ny APMSAN (Alliance Parlementaire Malagasy pour la S&eacute;curit&eacute; Alimentaire et la Nutrition). Tsy mijanona ho mpanentana amin&rsquo;ny ady amin&rsquo;ny hanoanana sy ny sakafo tsizarizary intsony fotsiny moa izy ireo fa mpiara-miombon&rsquo;antoka stratezika feno amin&rsquo;ny fandrafetana politika sy fandaharanasa. Ho zava-poana ihany anefa ny fananantsika ireo karazam-pitaovana ireo raha mbola manjaka ny gaboraraka sy ny tsy fanajana ny lal&agrave;na velona eto Madagasikara, hoy ny loholona Olga Ramalason. Ilaina soloina fankatoavana ilay foto-pisainana fandikan-dal&agrave;na mihamahazo vahana eo anivon&rsquo;ny fiarahamonina Malagasy ankehitriny. Antoky ny fampandrosoana ny firenena mantsy ny fisian&rsquo;ny fifampifehezana miaraka amin&rsquo;ny finiavana ananan&rsquo;ny olom-pirenena manomboka amin&rsquo;ny mpitondra fanjakana, araka ny fanamarihan&rsquo;ity senatera Tiako I Madagasikara ity. </span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Sary fampihaingoana&nbsp;: Olga Ramalason, loholona Tiako I Madagasikara</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\r\n  DefSemiHidden="true" DefQFormat="false" DefPriority="99"\r\n  LatentStyleCount="267">\r\n  <w:LsdException Locked="false" Priority="0" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Normal"/>\r\n  <w:LsdException Locked="false" Priority="9" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="heading 1"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 2"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 3"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 4"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 5"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 6"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 7"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 8"/>\r\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 9"/>\r\n  <w:LsdException Locked="