(43, 12, 6, 0, '2017-05-09', 'Paul Rabary  Mandamin-dresaka amin’ny Silamo', 'fanabeazana/Paul-Rabary--Mandamin-dresaka-aminny-Silamo-09052017-43', ' \r\n\r\nTonga nitsidika ny “Centre Rassouloul Akram” misy ny “Institut Islamique de Madagascar” etsy Antohomadinika omaly maraina ny minisitry ny fanabeazam-pirenena Paul Rabary.', ' \r\n\r\nTonga nitsidika ny “Centre Rassouloul Akram” misy ny “Institut Islamique de Madagascar” etsy Antohomadinika omaly maraina ny minisitry ny fanabeazam-pirenena Paul Rabary.', '<p>Niara-nanangan-tsaina tamin&rsquo;ireo mpianatry ny sekoly La Sagesse mihitsy izy, fihetsika izay nanehoany hatrany fa mitovy avokoa ny sekoly rehetra eto amintsika, tsy misy fanavahana na iza na iza fa samy mitaiza sy manabe ny zanaka Malagasy ka tokony ho samy hanara-dal&agrave;na. Nisy ny fanazavana nentiny mikasika ny finoana sy ny fanabeazana izay nantitranteriny fa tsy tokony hafangaro velively. Minisitry ny fanabeazam-pirenena no asako ary ny mampanara-dal&agrave;na ny sekoly rehetra no andraikitro, hoy hatrany izy. Raha misy zava-mitranga eny anivon&rsquo;ny sekoly dia tompon&rsquo;andraikitra hatrany ny minisitera iadidiako. Tsy misy hidirako ny resaka finoana, antony nanaovany antso avo ny sekoly Silamo rehetra mba hivondrona anatin&rsquo;ny &ldquo;Direction Nationale des &eacute;coles de Confession Musulmane&rdquo; hahafahan&rsquo;ny roa tonta miady hevitra. Nomarihiny manokana fa miisa 160 sisa ireo sekoly 600 tsy nanara-dal&agrave;na teo&nbsp; aloha izay tsy nakatona avy hatrany akory fa mbola nampitandremana avokoa ka ny 16 amin&rsquo;ireo no sekoly Coranique. Nisy ny tablette miisa 50 sy fanomezana ho an&rsquo;ireo mpampianatra natolotry ny minisitera ho an&rsquo;ity sekoly iray ity. Ho avy tsy ho ela ny anjara birikin&rsquo;izy ireo entina hanohanana ny sekoly. Pati Legende : Nandritra ny fandalovan&rsquo;ny minisitra Paul Rabary teny amin&rsquo;ny Centre&nbsp; Rassouloul Akram Antohomadinika omaly</p>', 1, 1, 1, 'upload/17-05-09-1494353762.jpg');
