g="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></span></p>\r\n<p class="m5392054274410519827s4" style="margin: 0cm; margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%;"><span class="m5392054274410519827bumpedfont15"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">, dia Antokototanintsara, Ampefiloha, Ambanimaso, Antananambony, Ambodivona, Antandrokomby ary Ankazotoho no nisitraka izany. Misy ny asa tanamaro na &ldquo;HIMO&rdquo; fanadiovana lakandrano mirefy 400m ny lavany ary 6m ny sakany, ka miasa adiny 3 isan&rsquo;andro ao anatin&rsquo;ny 3 andro ireo vahoaka ireo, ary sandaina 5.000Ariary isan&rsquo;andro. Toerana anisan&rsquo;ny nizaka ny mafy nandritra ny rivodoza Enawo iny faritra iny, ka raha vantany vao misy ny orana mahery vaika, dia tsy azo ihodivirana ny fiakaran&rsquo;ny rano. Izay no<span style="mso-spacerun: yes;">&nbsp; </span>nanaovana ny asa satria sady vola miditra ho an&rsquo;ny mponina no fisorohana ny loza ateraky ny fiakaran&rsquo;ny rano rehefa fotoanany. Nisy ihany koa ny fanoloran&rsquo;ny minisitra Onitiana Realy fitaovana ho an&rsquo;ny fikambanam-behivavy eny Anosizato Andrefana, ka masinina fanjaraina miisa 3 miampy ny kojakoja miaraka aminy ary lamba 50m no natolony ho an&rsquo;ny fikambanana izay ahitana ahitana vehivavy 240. Nisy ihany koa ny fitsinjovana ireo zokiolona, ka 100 izy ireo no nizarana vary 5kg avy, siramamy 1kg, ary savony isan&rsquo;olona.</span></span></p>\r\n<p class="m5392054274410519827s4" style="margin: 0cm; margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%;"><span class="m5392054274410519827bumpedfont15"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, NULL),
(45, 12, 5, 0, '2017-05-09', 'Fivoriana teny Mahazoarivo  Tsy mahatoky ny mpitondra ireo mpamatsy vola', 'politika/Fivoriana-teny-Mahazoarivo--Tsy-mahatoky-ny-mpitondra-ireo-mpamatsy-vola-09052017-45', 'Ny daty sy ny toerana no  miovaova fa ny omaly ihany no anio momba ilay fihaonana eo amin’ireo mpiara-miombon’antoka sy mpamatsy vola sy ny governemanta Malagasy. Andiany faha-10 no notanterahana teny Mahazoarivo omaly', 'Ny daty sy ny toerana no  miovaova fa ny omaly ihany no anio momba ilay fihaonana eo amin’ireo mpiara-miombon’antoka sy mpamatsy vola sy ny governemanta Malagasy. Andiany faha-10 no notanterahana teny Mahazoarivo omaly', '<p>&nbsp; &nbsp;ary dia mbola niverina noresahana indray ny resaka ady amin&rsquo;ny kolikoly sy ny fandripahana ny harem-pirenena, ny tokony hisian&rsquo;ny mangarahara amin&rsquo;ny vola ampiasain&rsquo;ny antoko politika. Somary namantsika ny governemanta Rtoa Violette Kakyomya lehiben&rsquo;ny PNUD eto Madagasikara raha nandray fitenenana ka nanambara fa tokony hahay hizara vaovao sy hampahafantatra ny zava-misy marina amin&rsquo;ireo mpiara-miasa sy mpiara-miombon&rsquo;antoka ny governemanta fa izay no hahafahana manafaingana ny ady amin&rsquo;ny kolikoly. Mbola nanamafy ny maha zava-dehibe io serasera sy fifampitam-baovao io ihany koa i Robert Yamate masoivoho Amerikanina. Nanome toky, tahaka ny mahazatra moa ny praiminisitra fa miasa mafy miady amin&rsquo;ny kolikoly ny fitondram-panjakana ary efa maro ny rafitra napetraka sy mbola apetraka hahafahana manao izany an-tsakany sy an-davany. Namelabelatra ny momba ireo ezaka sy asa natao ny minisitry ny fitsarana, eo aloha ny fametrahana lal&agrave;na sy ny asa mivaingana mihitsy ka nahafahana nisakana fanondranana hazo sarobidy ohatra sy nahatrarana fikasana hanadio vola maloto. Tsapa tamin&rsquo;ny fifanakalozan-kevitra sy ny kabary nifandimbiasana teny Mahazoarivo omaly ihany anefa fa tena mbola velon&rsquo;ahiahy amin&rsquo;ny mpitondra ireo mpiara-miasa sy mpiara-miombon&rsquo;antoka ary manindry mafy ny hanatevenana ny ady amin&rsquo;ny kolikoly sy ny ady amin&rsquo;ny fanondranana an-tsokosoko ny harem-pirenena. RTT</p>', 0, 1, 0, NULL),
(46, 12, 5, 0, '2017-05-09', 'Fanovana ny lalam-pifidianana  Hodinihan’ny parlemanta atsy ho atsy', 'politika/Fanovana-ny-lalam-pifidianana--Hodinihanny-parlemanta-atsy-ho-atsy-09052017-46', 'Mifarana ny 25 janoary 2019 ny fotoam-piasan’ny filoham-pirenena, milaza ny lalàmpanorenana fa tsy maintsy tanterahana ao anatin’ny 30 ka hatramin’ny 60 andro mialoha io 25 janoary io ny fifidianana ny filoham-pirenena vaovao', 'Mifarana ny 25 janoary 2019 ny fotoam-piasan’ny filoham-pirenena, milaza ny lalàmpanorenana fa tsy maintsy tanterahana ao anatin’ny 30 ka hatramin’ny 60 andro mialoha io 25 janoary io ny fifidianana ny filoham-pirenena vaovao', '<p>&nbsp; . Midika izany fa tokony hatao eo anelanelan&rsquo;ny 25 novambra ka hatramin&rsquo;ny 25 desambra 2018 ny fifidianana. Tafiditra ao anatin&rsquo;ny vanim-potoan&rsquo;ny orana tanteraka anefa io ka raha misy ny filazana avy amin&rsquo;ny fitsarana avo momba ny lal&agrave;mpanorenana fa misy ny tranga na antony lehibe tsy azo hanoharana dia azo aroso na ahemotra io datim-pifidianana io. Mihevitra izahay ato amin&rsquo;ny CENI, hoy i Thierry Rakotonarivo fa hatolotra ny parlemanta mialoha ny hifaranan&rsquo;ity fivoriana ara-potoana voalohany ity amin&rsquo;ny volana jona ny soso-kevitra amin&rsquo;ny fanavaozana tanteraka ny lalam-pifidianana rehetra. Mandra-piandry izany anefa dia manana andraikitra lehibe amin&rsquo;ny fampianarana sy fanabeazana ny olom-pirenena momba ny didy aman-dal&agrave;na mahakasika ny fifidianana ny vaomiera mahaleotena misahana ny fifidianana (CENI). Efa nisy moa ny fakan-kevitra nataon&rsquo;ny CENI tamin&rsquo;ireo herivelona rehetra momba ity resaka lalam-pifidianana ity ary &nbsp;mbola mitohy ihany koa ny fifanakalozan-kevitra momba ny zotram-pifidianana tahaka ny hotanterahana rahampitso alarobia eny amin&rsquo;ny foiben&rsquo;ny CENI. L&eacute;gende&nbsp;:Thierry Rakotonarivo, filoha lefitry ny CENI RTT</p>', 0, 1, 0, 'upload/17-05-09-1494338968.jpg');
