 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Raha ny vaovao azo anefa dia nampanantsoin&rsquo;ny zandary izy noho ny raharaha fandrahonana nataony tamin&rsquo;ny Sendikan&rsquo;ny Mpitsara (SMM) tany anaty tambajotram-pifandraisana ara-tsosialy, ka nisian&rsquo;ny fitoriana nataon&rsquo;ity sendikan&rsquo;ny mpitsara ity azy. Anisan&rsquo;ny vesatra iampangana azy ihany koa ny fitarihana andian&rsquo;olona nitora-bato ny ny foiben&rsquo;ny Bianco teny Ambohibao nandritra ny fakana am-bavany an&rsquo;i Claudine Razaimamonjy. Voamarina ny resaka fitarihan&rsquo;olona hikomy sy hanakorontana, ka nanomezan&rsquo;ny tonian&rsquo;ny mpampanoa lal&agrave;na Ambony tamin&rsquo;ny alalan-Randrianasolo Jacques, baiko an&rsquo;ny zandarimaria hampiantso ny loholona Riana Andriamandavy VII hanaovana fanadihadiana. Tsy nisy kosa ny fandrarana azy tsy hivoaka an&rsquo;i Madagasikara na ny IST raha ny vaovao azo. Nanamafy ny polisy ana habakabaka sy ny fiarovana ny sisin-tany (PAF) fa lasa nivoaka malalaka an&rsquo;i Madagasikara izy.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Antenimierandoholona&nbsp;tsy mahalala n&rsquo;inona n&rsquo;inona</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Nilaza ho tsy mahalala ny resaka fampiantsoana an&rsquo;i Riana Andriamandavy VII sy ny toerana misy azy kosa ny filohan&rsquo;ny Antenimierandoholona Honor&eacute; Rakotomanana. Raha misy ny fampiantsoana ataon&rsquo;ny fitsarana mikasika ny loholona dia anjaran&rsquo;ny avy eo amin&rsquo;ny tonian&rsquo;ny mpampanoa lal&agrave;na ambony no mandefa taratasy mankany amin&rsquo;ity filohana andrim-panjakana ity milazalaza ny anton-javatra, ka ahafahana manambara ny fampiantsoana sy fakana azy hatao famotorana na ny didy fampisamborana, hoy izy omaly. Nilaza anefa i Honor&eacute; Rakotoamana fa tsy naharay an&rsquo;izany. Rehefa tsy mahazo taratasy avy amin&rsquo;ny mpampanoa lal&agrave;na ao anatin&rsquo;ny andro vitsy dia hanontany ny mombamomba ny antony hampiantsoana na ny fisamborana azy izy ireo, hoy i Honor&eacute; Rakotomanana. Anio dia hisy fivorian&rsquo;ny birao maharitra, ka hoentina eo amin&rsquo;ny birao maharitra satria rehefa misy zava-dehibe dia ny Birao maharitra no tompon&rsquo;ny teny farany. Aorian&rsquo;izay dia hisy ny famaritana sy fandinihana ny heloka nataony, izay holanian&rsquo;ny 2/3-n&rsquo;ny antenimierandoholona ny resaka fanapahan-kevitra. Tsy misy ihany koa ny iraka manokana amin&rsquo;ny maha loholona azy amin&rsquo;izao fivoahana any ivelany izao, izay toa manamafy fa nandositra ny fanenjehana azy ity loholona, izay ambaran&rsquo;ny maro ho mihevi-tena ho ambonin&rsquo;ny lal&agrave;na ity. Nilaza kosa ny mpisolovava Willy Razafinjatovo fa tsy tokony tsy hanavahana olona, fa rehefa manao ny tsy mety, indrindra fa tratra ambodiomby dia azo henjehina tsara.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, NULL),
(48, 12, 1, 0, '2017-05-09', 'Asa fanaovan-gazety  Nidoboka any am-ponja i Cello', 'misongadina/Asa-fanaovan-gazety--Nidoboka-any-am-ponja-i-Cello-09052017-48', '\r\nNaiditra am-ponja vonjimaika ao amin’ny fonjaben’i Ihosy ny mpanao gazetin’ny Radio Jupiter any Ilalaka, Fernand Cello taorian’ny nitondrana azy tao amin’ny fitsarana tao Ihosy, omaly misandratr’andro.', '\r\nNaiditra am-ponja vonjimaika ao amin’ny fonjaben’i Ihosy ny mpanao gazetin’ny Radio Jupiter any Ilalaka, Fernand Cello taorian’ny nitondrana azy tao amin’ny fitsarana tao Ihosy, omaly misandratr’andro.', '<p>&nbsp; Mpitandro ny filaminana tsy latsaky ny 20 isa no nitondra azy tao amin&rsquo;ny fitsarana, ary vory ny olona. Sambasamba tao Ihosy nahitana ny toe-javatra toy izao, hoy ireo nanatri-maso. Raharaha roa no nitorian&rsquo;ny mpandraharaha iray azy, dia ny resaka fanalam-baraka sy halatra taratasim-bola tamin&rsquo;ny taona 2015. Nahazoany fahafahana vonjimaika ny resaka fanalam-baraka fa ilay vesatra faharoa kosa no nampidirana azy am-ponja, dia ilay resaka seky. Mbola misy vesatra miisa 5 tsy maintsy handalovan&rsquo;ity mpanao gazety ity ny fitsarana, raha ny fanomezam-baovaon&rsquo;ny fampanoavana any Ihosy. Fanosihosena ny asa fanaovan-gazety Taorian&rsquo;ny fampidirana am-ponja an&rsquo;i Fernand Cello, io omaly io, dia nanao valandresaka tamin&rsquo;ny mpanao gazety tao Ihosy, ny mpisolo vava azy, ary nilaza fa &ldquo; fanosihosena ny asa fanaovan-gazety izao nihatra amin&rsquo;ny Fernand Cello izao, satria mpanao gazety sahy nilaza ny marina sy namaky bantsilana ny kolikoly avo lenta amin&rsquo;ny fitrandrahana safira ao Ilakaka ka potehina tanteraka ny fiainany ankehitriny. &ldquo; &ldquo; Tsy voahaja ihany koa ny zo miaro tena tokony hataon&rsquo;i Fernand Cello omaly nandritra ny fandalovany teny amin&rsquo;ny tribonaly, satria nogiazan&rsquo;ny fitsarana ny finday misy ny porofo rehetra ananan&rsquo;ity mpanao gazety ity &ldquo;, hoy Me Marie Claudia Yvonne. Nahitsy kosa ny valin-tenin&rsquo;ny tonia mpampanoa lal&agrave;na ao amin&rsquo;ny fitsarana ambaratonga voalohany Ihosy, fa nisy S.T miisa fito navoakan&rsquo;ny fitsarana mandidy an&rsquo;ity mpanao gazety ity hosamborina hatao famotorana mahakasika ireo fitorian&rsquo;olona misesy azy. &ldquo; Tsy misy ifandraisany amin&rsquo;ny fanehoan-kevitra tamin&rsquo;ny fandaharana manokana tamina haino aman-jery tsy miankina iray tao Antananarivo, ny 3 mey teo, ny fisamborana an&rsquo;ity mpanao gazety ity &ldquo;, hoy Rtoa Mpampanoa lal&agrave;na nanipika sady namaly an&rsquo;ireo fanosoram-potaka samihafa inian&rsquo;ny olona sasany aely ankehitriny handotoana endrika ny fitsarana. Araka ny resaka an-tariby nifanaovana tamin&rsquo;ny filohan&rsquo;ny holafitry ny mpanao gazety (OJM) G&eacute;rard Rakotonirina omaly hariva kosa, dia manaraka hatrany ny fizotry ny raharaha ny OJM, ary manentana hatrany ny mpanao gazety mba hanaja ny etika sy ny deontolojia eo am-panatanterahana ny asany. Andrasana ny fivoaran&rsquo;ity raharaha ity. Eric R/Toky R &nbsp;</p>', 0, 1, 0, 'upload/17-05-09-1494338760.JPG'),
(49, 12, 5, 0, '2017-05-09', 'Rakotoamboa Jean Louis  « Mila saziana ireo nanao tantely afa-drakotra… »', 'politika/Rakotoamboa-Jean-Louis---Mila-saziana-ireo-nanao-tantely-afa-drakotra--09052017-49', 'Isaorana ny Bianco sy ny sendikan’ny mpitsara, hoy ny filoha nasionalin’ny antoko Teza, Rakotoamboa Jean Louis, tamin’ny ezaka efa vitan’izy ireo.', 'Isaorana ny Bianco sy ny sendikan’ny mpitsara, hoy ny filoha nasionalin’ny antoko Teza, Rakotoamboa Jean Louis, tamin’ny ezaka efa vitan’izy ireo.', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--></p>\r\n<p style="font-size: 16.0pt; line-height: 115%;"><!