r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;Tsy ireo trondrobe teo amin&rsquo;ny resaka kolikoly ihany anefa, raha ny heviny, no tokony hosaziana sy hampiharana lal&agrave;na fa ireo nanao tantely afa-drakotra ny harem-pirenena koa. Ny taona 2009, hoy izy, no tena nirongatra izany ary tsiahivina fa 500 tapitrisa dolara no tentim-bidin&rsquo;ireo andramena naondrana an-tsokosoko tamin&rsquo;ny fotoan&rsquo;androny. Mahagaga ny tsy nahitana ny fivoahan&rsquo;izy ireny teto, hoy izy, nefa dia voaisan&rsquo;ny sehatra iraisam-pirenena. Anisan&rsquo;ny tokony hohadihadiana koa ireo raharaha mikasika ny sokatra sy volamena ary harena an-dranomasina sy ankibon&rsquo;ny tany be dia be nivoaka an-tsokosoko hatramin&rsquo;izao raha tiana ny hiroso amin&rsquo;ny fampihavanana.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%;">Mirija</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></strong></p>', 0, 1, 0, NULL);
INSERT INTO `article` (`idarticle`, `idjournal`, `idcategorie`, `idadministrateur`, `dateparution`, `titre`, `url_tag`, `extrait`, `resume`, `contenue`, `laune`, `etatpublication`, `niveau`, `lien_image_une`) VALUES
(50, 12, 5, 0, '2017-05-09', 'Manadio tena ny filoha  Vao mainka nijabaka indray…', 'politika/Manadio-tena-ny-filoha--Vao-mainka-nijabaka-indray-09052017-50', 'Manomboka izao dia milaza ny hiresaka amin’ny vahoaka amin’ny alalan’ny fandefasana horonantsary miendrika fandaharana anaty tranonkala “Youtube” sy tambajotra “facebook” isan-kerinandro ny filoham-pirenena Hery Rajaonarimampianina,', 'Manomboka izao dia milaza ny hiresaka amin’ny vahoaka amin’ny alalan’ny fandefasana horonantsary miendrika fandaharana anaty tranonkala “Youtube” sy tambajotra “facebook” isan-kerinandro ny filoham-pirenena Hery Rajaonarimampianina,', '<p>&nbsp;ka ny &ldquo;Fotoam-bita&rdquo; na &ldquo;Le rendez-vous&rdquo; no anaran&rsquo;izany, ary faran&rsquo;ny herinandro no nanombohany. Ambarany fa hitondra fanazavana mivantana sy mahitsy mikasika ireo toe-draharaha miteraka resabe eo anivon\'ny fiarahamonina sy ny firenena izy ary hiresaka mazava mikasika ireo fanapahan-kevitra goavana raisin\'ny fanjakana momba ny raharaham-pirenena. Fa taiza izany fanazavana sy resaka mazava izany no tsy natao hatrizay ? Nahoana no misitri-belona sy miezaka mandamina ary mangina manoloana ireo raharaha maloto mahavoatonona ny olona akaiky hatramin&rsquo;izay, ka izao vao mody mandamin-dresaka ? Aiza ho aiza, ohatra, ny famaliana ny antso avo nataon&rsquo;ny Sendikan&rsquo;ny Mpitsara eto Madagasikara (SMM) amin&rsquo;ny handraisany andraikitra momba ny raharaha Claudine Razaimamonjy amin&rsquo;ny maha filohan&rsquo;ny filankevitra ambonin&rsquo;ny mpitsara ny filohan&rsquo;ny Repoblika ? Sa mbola ny valy boraingina hoe hipetraka ho raimandreny foana no hasesika ? Mihevitra ny hanadio tena sy haka ny fon&rsquo;ny maro indray ny filoha. Vao mainka nijabaka anefa izy raha ny fanehoan-kevitra tao anaty tambajotra &ldquo;facebook&rdquo; misy ny pejy mikasika io fandaharana io. Ny 78,3%-n&rsquo;ny olona amin&rsquo;ny 309 naneho hevitra no manakiana sy tsy mankasitraka an-dRajaonarimampianina amin&rsquo;izao zavatra ataony izao, ary zara raha nisy 12% no mankasitraka, raha toa ka 9,7% no tsy nanan-kolazaina. Manampy trotraka izany, resaka aterineto no fitaovana hoenti-mampita hafatra, izay midika avy hatrany fa fanilihana ny maro an&rsquo;isa ary mety ho tahotra amin&rsquo;ny fisehoana vahoaka noho ny efa tsy fankasitrahan&rsquo;ny maro an&rsquo;isa intsony ny tenany sy ny fanjakana HVM manontolo, ka dia an-kolaka no hanaovana azy. Toky R &nbsp;</p>', 0, 1, 0, NULL),
(51, 12, 1, 0, '2017-05-09', 'Fitantanana ny ASOIMI  Mamofompofona resaka politika', 'misongadina/Fitantanana-ny-ASOIMI--Mamofompofona-resaka-politika-09052017-51', 'Mbola hitoerana savorovoron-dresaka mandraka ankehitriny ny amin’ny fitantanana mandritra ny 4 taona ho avy ny rafitra ASOIMI na ny « Association ominisport interministerielle et institution » eto Madagasikara.', 'Mbola hitoerana savorovoron-dresaka mandraka ankehitriny ny amin’ny fitantanana mandritra ny 4 taona ho avy ny rafitra ASOIMI na ny « Association ominisport interministerielle et institution » eto Madagasikara.', '<p>&nbsp;Raha nanatanteraka fifidianana mantsy ity rafitra ity ny 22 febroary 2017 dia nivoaka ho mpandresy tamin&rsquo;ny isam-bato 63 Randriamiarinarivo Jean Bruno Abel ary 4 monja ny azon&rsquo;ny kandid&agrave; Randimbiarisoa Oliva mifanandrina taminy. Namoahan&rsquo;ny DSPT avy amin&rsquo;ny minisitera mpiahy naoty laharana faha-033/MJS/SG, ny 21 febroary 2017 nanambara fa hahantona ity fifidianana ity noho ny antony tsy mazava ka nanatanteraka fifidianana vaovao tsy nahitana afa-tsy&nbsp; kandid&agrave; 1, Atoa Randimbiarisoa Oliva ny 21 martsa indray ry zareo ary nahalany ity farany tamin&rsquo;ny isam-bato 97,5 %. Raha ny fantatra dia kandid&agrave; notohanan&rsquo;ny mpandraraha malaza Razaimamonjy Claudine sy ny minisiteran&rsquo;ny tanora Atoa Oliva ka mamofompofona HVM.&nbsp; Manana ny fahaleovantenany tanteraka amin&rsquo;ny fanatanterahana ny fifidianana anefa ny ASOIMI, hoy Atoa Randriamiarinarivo Jean Bruno Abel, ary ny AG no rafitra manankery hanatontosa sy hampanankery izany. Ny tenanay no nahazo ny &laquo;&nbsp;r&eacute;c&eacute;piss&eacute;&nbsp;&raquo; mazava avy amin&rsquo;ny minisiteran&rsquo;ny atitany&nbsp; manambara ny maha filoha ara-dal&agrave;na ny tena dia izao nanatanteraka hetsika Baskety &laquo;&nbsp;Inter saison&nbsp;&raquo; tontosaina eto amin&rsquo;ny kianja Mitafon&rsquo;i Mahamasina amin&rsquo;ny sabotsy 6 mey izao mialoha ny hanokafana ofisialy ny fifaninanana 2017. Azo ambara fa mamofompofona resaka politika ao anatin&rsquo;ny fitantanana an&rsquo;ity ASOIMI ity. Ntsoavina Evariste &nbsp;</p>', 0, 1, 0, 'upload/17-05-09-1494339026.JPG'),
