tle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;Eo koa ny fahalalahan&rsquo;ny asa fanaovan-gazety izay lasa faha-57 raha faha 56 amin&rsquo;ny firenena 180 teo aloha. Manampy trotraka ny fisondrotan&rsquo;ny vidim-piainana vokatry ny fiakaran&rsquo;ny vidin-tsolika izay isam-bolana hatreto tamin&rsquo;ity taona ity. Fa mahakivy lavitra anefa ny fihetsiketsehana mitranga sy ny zara mitanila atao amin&rsquo;ireo trondrobe amin&rsquo;ny kolikoly voatery namoahana didy toa an&rsquo;ny talen&rsquo;ny kabinetran&rsquo;ny fifandraisana teo aloha izay asaina mandoa ny 1/4<span style="mso-spacerun: yes;">&nbsp; </span>monja amin&rsquo;ny vola voalaza ho nahodiny ary ilay mpandraharaha ikoizana vetivety dia nahazo fahafaha-mitsabo tany andafy kanefa na olon-tsotra tsy voapanga aza mitaraina ho sahirana vao mahazo izany. Izao ve no famerenana ilay politika tranainy novoizina tamin&rsquo;ny taona 70 sy 80 hoe &laquo;&nbsp;Raha tiana ny hijanona mandra-pahafaty eo amin&rsquo;ny fitondrana dia abadohy ny vahoaka, hampahantrao ary poteho ireo manana ny ampy izay misy ny tia karokaroka&nbsp;?&nbsp;&raquo;</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%;">Mirija </span></strong><span style="font-size: 16.0pt; line-height: 115%;"><span style="mso-spacerun: yes;">&nbsp;</span></span></p>', 0, 1, 0, NULL),
(53, 12, 17, 0, '2017-05-09', 'Aza manonofy e !', 'taratasy-ho-ani-jean/Aza-manonofy-e--09052017-53', 'Lasa ny saiko ry Jean mandinika izato fihetsika ataon’ny maro amintsika. Varimbarian’ny lavitra tokoa ka tsy mahita ny ambany maso e ! Aiza ve, ry mena sofina no nahazo filoha vaovao ka isika no manetsetra etsy sy eroa fa tanora mahafinaritra io, hitondra rivo-baovao io … ', 'Lasa ny saiko ry Jean mandinika izato fihetsika ataon’ny maro amintsika. Varimbarian’ny lavitra tokoa ka tsy mahita ny ambany maso e ! Aiza ve, ry mena sofina no nahazo filoha vaovao ka isika no manetsetra etsy sy eroa fa tanora mahafinaritra io, hitondra rivo-baovao io … ', '<p>&nbsp; Sao lahy ka efa lasa ambiroa isika ka mihevitra fa tsy eto Gasikara intsony ? Mba misaina na dia iray minitra akory ny momba antsika ve ry Jean iny olona iny ataontsika resaka sy dokadokafantsika iny ? Mba mihevitra na ny kely ny momba ny hoavin&rsquo;ity Gasikara efa potika sy rotika ity ve izy ? Aza manonofy fa ny hanabe voho ny azy ihany no tanjony ary aza manantena fahagagana fa tsy olona iray akory no hanova ny politikan-dry mena hoditra efa an-jatony taona no nanjakazaka teto amin&rsquo;ny tanintsika a ! Tsara ny mahara-baovao sy miresaka ny momba an&rsquo;iny olom-baovao, izay malaza eto ambonin&rsquo;ny tany iny. Aoka mba hahay hanatsoaka&nbsp; lesona fa tsy ho jamban&rsquo;ny dokadoka sy ny ambara ho revolisionina, ka hanao toy ilay nataon&rsquo;i Jean Kely taona maro lasa izay e! Soa ihany aloha fa iny olona iny no tonga teo fa na ny akamantsika mpila ravinahitra any aza mety efa samy niomana hitsena azy avy ny valala fiandry fasana a ! Marco &nbsp;</p>', 0, 1, 0, NULL),
(55, 13, 5, 0, '2017-05-10', 'Hery Rajaonarimampianina   Tsy ho kandida intsony ?', 'politika/Hery-Rajaonarimampianina---Tsy-ho-kandida-intsony--10052017-55', ' \r\n\r\nMaro ny zavatra tsy hampoizina mety hiseho mandra-pahatongan’ny tena fotoana hanaovana ny fifidianana filoham-pirenena amin’ny 2018, ka efa manomboka miseho tsikelikely amin’izao fotoana. Ao ny resaka mandeha ankehitriny fa tsy ho kandida ny filoha am-perinasa Hery Rajaonarimampianina.', ' \r\n\r\nMaro ny zavatra tsy hampoizina mety hiseho mandra-pahatongan’ny tena fotoana hanaovana ny fifidianana filoham-pirenena amin’ny 2018, ka efa manomboka miseho tsikelikely amin’izao fotoana. Ao ny resaka mandeha ankehitriny fa tsy ho kandida ny filoha am-perinasa Hery Rajaonarimampianina.', '<p>&nbsp; &nbsp; &nbsp; &nbsp;Na dia miezaka mandamin-dresaka aza ny HVM, dia tsikaritra ho miady an-trano sy mifanipa-kevitra. Misy ireo mandrisika fatratra ny hilatsahany ary ao kosa ireo maniry ny hanajany tena, ka olon-kafa no tokony hatolotry ny HVM. Samy miady ho lohany ny ankamaroany. Iza no hatolotra raha tena tsy hirotsaka tokoa ny tenany ? Ny olana anatin&rsquo;ny HVM tsy mivaha kanefa ny aty ivelany misosoka ihany. Na milaza ho antoko matanjaka aza izy ireo, anisan&rsquo;ny antoko maro fahavalo indrindra. Tsy fantatra akory teo amin&rsquo;ny tontolo politika izany HVM izany satria na ny nahalany azy tamin&rsquo;ny fifidianana filoham-pirenena aza, dia mbola dian-tanan&rsquo;i Andry Rajoelina sy ny MAPAR. Fahavalony voalohany anefa ireo amin&rsquo;izao fotoana ary tsy hay ny valifaty kononkononin&rsquo;izy ireo rehefa raikitra tokoa ny fifidianana. Mbola vesatra sy olana mitatao ao an-damosin&rsquo;i Hery Rajaonarimampianina ihany koa anefa ny resaka kolikoly mahasaringotra ireo manodidina azy, eny fa na ny tenany aza indraindray voatonona, toy ny raharaha Claudine Razaimamonjy, izay tsy hita izay heviny sy zavatra ambarany fa ny miala bala no ataony. Tsy tena namana ireo manodidina azy, fa ny afera no mahamaika ny ankamaroany, ka tsy misy tena azo hianteherana, izay mety ho antony lehibe handrisika azy tsy hirotsaka intsony. Manginy fotsiny ny fampanantenana nataony izay tsy tanteraka ny ankamaroany, ka vao mainka nahatonga ny vahoaka hankahala azy, toy ilay resaka hoe telo volana dia mivaha ny delestazy. &nbsp; Hanome ohatra tsara ho an&rsquo;ny mpanao politika? &nbsp; Noho ny fankafizan&rsquo;ny vahoaka azy izay tena ambany be noho ny zavatra nafitsoky ny fitondrana HVM tarihiny no mety tsy hirotsahany intsony. Araka ny loharanom-baovao iray anefa, dia mety hanao sorona ny tenany amin&rsquo;ny tsy firotsahana izy mba hisakanana ny hafa. Hatao izay hevitra rehetra tsy hahafahan&rsquo;ireo kandida atahorana mba tsy hirotsaka tahaka azy, ka hambara fa hanome lesona tsara ho an&rsquo;ny mpanao politika, mba hahay hanaja tena amin&rsquo;izay izy satria efa samy teo daholo ihany, ka aleo samy mandefitra sy tsy mirotsaka intsony. Hiezaka ny handamina ny raharahan-tokantranony kosa ny HVM amin&rsquo;izay ka minisitra iray ao anatin&rsquo;ny governemanta, izay kandida hatolotr&rsquo;izy ireo fa tsy Hery Rajaonarimampianina. &nbsp; SARY:BD Rivo &nbsp; Toky R &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>', 0, 1, 0, 'upload/17-05-10-1494423546.jpg');
