alse" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="text-align: justify; text-justify: inter-ideograph; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: 35.4pt;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ao anatin&rsquo;ny fanamarihana ny faha-60 taona nijoroany ny vondrona Eoropeanina amin&rsquo;izao fotoana izao, ka nisy ny lahateny mikasika izany nataon&rsquo;ny masoivoivohony eto Madagasikara, </span><span lang="IT" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IT; mso-bidi-font-style: italic;">Antonio S&aacute;nchez-Benedito </span><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">teny amin&rsquo;ny <span style="mso-bidi-font-style: italic;">Villa Iranja Tsarasaotra omaly. Nivoitra tamin&rsquo;ny lahateniny ny filazana fa hafa ity taona izay nitsingerenan&rsquo;ny faha-60 taonan&rsquo;ny Fifanarahan&rsquo;i Rome na &ldquo;Trait&eacute;s de Rome&rdquo;, izay loharano niaingan&rsquo;ny vondrona Eoropeanina ity. Kihon-dalana lehibe teo amin&rsquo;ny tantaran&rsquo;ny mahaolona izy io satria teo no nanombohan&rsquo;ny fiombonana ara-toekarena, politika tany Eoropa raha toa ka ady sy fifamonoana no najaka talohan&rsquo;izay, hoy ny Masoivohon&rsquo;ny Vondrona Eoropeanina. Mikasika ny fifandraisan&rsquo;ny vondrona Eoropeanina manokana amin&rsquo;i Madagasikara kosa dia nilaza ho eo foana ny vondrona Eoropeanina, ka nanampy sy mankasitraka ary manohana an&rsquo;i Madagasikara. Noderainy manokana ny nahatanterahana ny fihaonan&rsquo;ny COMESA sy ny Fiahaonana tampon&rsquo;ny Frankofonia. Nanamarika ihany koa </span></span><span lang="IT" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IT; mso-bidi-font-style: italic;">Antonio S&aacute;nchez-Benedito fa lohalaharana tamin&rsquo;ny fanampiana an&rsquo;i Madagasikara ny Vondrona Eoropeanina tamin&rsquo;ny fanampiana an&rsquo;i Madagasikara taorian&rsquo;ny rivodoza Enawo. Milaza ho nanampy tosika an&rsquo;i Madagasikara ihany koa izy ireo tamin&rsquo;ny fikaonan-doha tamin&rsquo;ny mpamatsy vola tany Paris Frantsa. Mankahery ny Governemanta tsy ho kivy kosa anefa fa manentana hatrany amin&rsquo;ny ezaka hisian&rsquo;ny mangarahara, izay antoka hisokafan&rsquo;ny famatsiam-bola sy fivoahan&rsquo;ny vola nampanantenain&rsquo;ny sehatra iraisam-pirenena. Midika izany fa tsy mahatoky ny mpitondra ny vondrona iraisam-pirenena matoa tsy mipotsaka mandrak&rsquo;ankehitriny ny vola be nampanantenaina. Mbola ady goavana ny resaka ady amin&rsquo;ny kolikoly izay sakana ho an&rsquo;ny fanampiana an&rsquo;i Madagasikara, saingy tsy hita aloha izay tena finiavan&rsquo;ny mpitondra hatreto.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: 35.4pt;"><strong style="mso-bidi-font-weight: normal;"><span lang="IT" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: IT; mso-bidi-font-style: italic;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em><span lang="IT" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IT;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-10-1494423494.jpg'),
(57, 13, 3, 0, '2017-05-10', 'Fandraharahana ara-bola  Ny 18%-n’ny sehatra ara-dalàna no misitraka azy', 'toe-karena/Fandraharahana-ara-bola--Ny-18-nny-sehatra-ara-dalna-no-misitraka-azy-10052017-57', ' \r\n\r\nNotontosaina tetsy amin’ny Le pavé Antaninarenina omaly ny atrikasa mikasika ny fanapariahana ny fandraharahana ara-bola eto amintsika.', ' \r\n\r\nNotontosaina tetsy amin’ny Le pavé Antaninarenina omaly ny atrikasa mikasika ny fanapariahana ny fandraharahana ara-bola eto amintsika.', '<p>Araka ny fanazavan&rsquo;ny mpandrindra ny tetikasa, Tiana Ramparany, dia ny taona 2012 no efa natao ny fanadihadiana sy fitadiavana paikady ahafahan&rsquo;ny eny ambanivohitra misitraka izay fandraharahana ara-bola tsy manavaka izany ary rehefa hita fa niroborobo teto amintsika ny fanapariahana izany tamin&rsquo;ny alalan&rsquo;ireo tambajotram-pifandraisan-davitra dia nitsiry ny hevitra ny amin&rsquo;ny hampivondronana rafi-pitantanam-bola misy eto amintsika sy ireto tambazotra ireto ary ireo mpahairaha vaovao (nouvelle technologie). 41% ny Malagasy maherin&rsquo;ny 18 taona hatreto no mbola tsy afaka misitraka fandraharahana ara-bola ary ho an&rsquo;ireo sehatra ara-dal&agrave;na any ambanivohitra dia 6% fotsiny no afaka manao izany amin&rsquo;ireo banky ary 12% eo ho eo no afaka manao azy io amina rafitra mpampindram-bola. Mirija L&eacute;gende: Ny mpandrindra nasionalin&rsquo;ny fandraharahana ara-bola tsy manavaka</p>', 1, 1, 0, 'upload/17-05-10-1494423648.JPG'),
