rity="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="IT" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: IT;">. Miteraka fifanoheran-kevitra maro izy io, indrindra fa ny resaka lal&agrave;na, ary anisan&rsquo;ny nanamarika izany i Ihanta Randriamandranto, Sekretera Jeneralin&rsquo;ny Antoko TEZA. Raha ny lal&agrave;m-pifidianana dia tsy tokony ho ao anatin&rsquo;ny fotoam-pahafavaratra ny fifidianana, kanefa mifarana ny 25 janoary 2019 ny fotoam-piasan&rsquo;ny filoham-pirenena am-perinasa. 30 ka hatramin&rsquo;ny 60 andro mialoha io ny fifidianana izy io no tokony hametra-pialana raha mbola mihevitra ny hirotsaka, izay midika fa eo anelanelan&rsquo;ny 25 novambra ka hatramin&rsquo;ny 25 desambra 2018 ny fifidianana, ary tafiditra ao anatin&rsquo;ny vanim-potoanan&rsquo;ny orana. Mbola olana goavana ihany koa anefa ny resaka valim-pifidianana eto amintsika, izay mitarazoka, ka miteraka ahiahy ho an&rsquo;ny olom-pirenena. Raha raisina ho ohatra ny tany Frantsa, dia ora iray monja taorian&rsquo;ny fifidianana dia efa hita ny fironan&rsquo;ny mpifidy, izay tsy nisy fiovana firy tamin&rsquo;ny vokatra ofisialy. Na mety tsy ho tratrantsika aza izany ora vitsy aorian&rsquo;ny fifidianana izany, dia tokony ho hita andro iray eo ho eo ny ny fironana, fa tsy hisy ny kajikajy hisian&rsquo;ny fitsimbadihana hampandresena ny kandida iray, izay matetika miseho eto amin&rsquo;ny firenena, ka herinandro maromaro aty aorian&rsquo;ny fifidianana no hisian&rsquo;izany. Mandeha ny hevi-petsy hanatsimbadihana ny vokatra, toy ny fanafoanana voka-pifidianana amina faritra maro. Ao anatin&rsquo;ny fandinihana ny resaka zotram-pifidianana ny<span style="mso-spacerun: yes;">&nbsp; </span>firaisamonim-pirenena sy ny Vaomiera Mahaleotena momba ny fifidianana (CENI), ka anio mihitsy no hisian&rsquo;ny dinika sy fanambarana eny Alarobia, izay inoana fa hisian&rsquo;ny fepetra sy hanomezana toky ny Malagasy amin&rsquo;ny hizoran&rsquo;ny fifidianana an-tsakany sy an-davany ao anatin&rsquo;ny mangarahara.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="IT" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: IT;">Toky R </span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-10-1494423735.jpg');
