(59, 13, 2, 0, '2017-05-10', 'Fiondranana an-tsokosoko mankany Koweit  9 vavy indray no nampidirina am-ponja ', 'fiaraha-monina/Fiondranana-an-tsokosoko-mankany-Koweit--9-vavy-indray-no-nampidirina-am-ponja--10052017-59', ' \r\n\r\nMihamahazo vahana hatrany ny fandefasana vehivavy hiasa an-tsokosoko any ivelany tato ho ato. Lohalaharana amin’ireny ny any Koweit, firenena arabo iray izay mbola tena tsy azon’ny Malagasy hitadiavana ravin’ahitra tokoa. Vehivavy miisa sivy indray no nampidirina am-ponja vonjimaika omaly. ', ' \r\n\r\nMihamahazo vahana hatrany ny fandefasana vehivavy hiasa an-tsokosoko any ivelany tato ho ato. Lohalaharana amin’ireny ny any Koweit, firenena arabo iray izay mbola tena tsy azon’ny Malagasy hitadiavana ravin’ahitra tokoa. Vehivavy miisa sivy indray no nampidirina am-ponja vonjimaika omaly. ', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r