lass="5yl5"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Vokatry ny ezaky <span style="mso-spacerun: yes;">&nbsp;</span>ny polisin&rsquo;ny &laquo;&nbsp;Service Central des Enqu&ecirc;tes Sp&eacute;cialis&eacute;es et de la lutte contre les fraudes documentaires&nbsp;&raquo; no angady nananana sy vy nahitana izany ny alatsinainy teo. Raha tsiahivina, <span style="mso-spacerun: yes;">&nbsp;</span>teny akaikin&rsquo;ny birao fanaovana pasipaoro no tratra ny vehivavy iray antsoina hoe&nbsp;: Elia niaraka tamina tovovavy miisa telo hanaovana pasipaoro saika alefa any Koweit. Rehefa nohadihadiana izy ireo dia tratra teny amin&rsquo;ny 67 ha ny vehivavy iray <span style="mso-spacerun: yes;">&nbsp;</span>mpiara-miombon&rsquo;antoka <span style="mso-spacerun: yes;">&nbsp;</span>an-dRamatoa Elia izay monina eny Alakamisy Fenoarivo. Tratra tamin&rsquo;izany ny tovovavy miisa telo saika haondrana any Koweit ihany koa, <span style="mso-spacerun: yes;">&nbsp;</span>niaraka tamin&rsquo;ny pasipaoro miisa enina an&rsquo;ireto vehivavy ireto izay iandrasana <span style="mso-spacerun: yes;">&nbsp;</span>visa <span style="mso-spacerun: yes;">&nbsp;</span>sy tapakila sisa. Nahitana pasipaoro miisa 120 efa lany daty avy nampiasain&rsquo;ny ankizy efa avy niasa tany Koweit ihany koa tao niampy antontan-taratasy maro toy ny contrat de travail fampianarana teny Anglisy an&rsquo;ireo ankizy alefa handeha hiasa any Koweit, quittance Western Union miisa telo, flash disque iray nahitana billet sy Visa-n&rsquo;ny ankizy efa lasa any Koweit <span style="mso-spacerun: yes;">&nbsp;</span>miisa enina tamin&rsquo;ny datin&rsquo;ny 27 lasa teo&hellip; Izy telo vavy ireto no mpandefa ireo ankizy miasa any Koweit <span style="mso-spacerun: yes;">&nbsp;</span>ka araka ny filazan&rsquo;io vehivavy io hatrany <span style="mso-spacerun: yes;">&nbsp;</span>dia efa tsy voaisany intsony ny ankizy efa nalefany tany Koweit <span style="mso-spacerun: yes;">&nbsp;</span>hatramin&rsquo;ny nanaovany ity asa ity ary efa nahavitany trano roa ny vola efa azony tamin&rsquo;izany. </span></span></p>\r\n<p class="MsoNormal"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></span></p>\r\n<p class="MsoNormal"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">SARY : BD Rivo</span></span></p>', 0, 1, 0, 'upload/17-05-10-1494423827.jpg'),
(60, 13, 5, 0, '2017-05-10', 'KMF/Cnoe  Afaka mamaritra tsara ny alimanakam-pifidianana ny CENI', 'politika/KMFCnoe--Afaka-mamaritra-tsara-ny-alimanakam-pifidianana-ny-CENI-10052017-60', 'Andrasana ankehitriny ny ketrika fanatsarana ny lalàm-pifidianana avy amin’ny Ceni (Commission Electorale Nationale Indépendante) taorian’ireo atrikasa fakan-kevitra miaraka amin’ny soso-kevitra samihafa niarahan’ity Vaomieram-pirenena mahaleotena mikirakira ny fifidianana ity tamin’ireo mpisehatra isan-tsokajiny amin’ny fifidianana.', 'Andrasana ankehitriny ny ketrika fanatsarana ny lalàm-pifidianana avy amin’ny Ceni (Commission Electorale Nationale Indépendante) taorian’ireo atrikasa fakan-kevitra miaraka amin’ny soso-kevitra samihafa niarahan’ity Vaomieram-pirenena mahaleotena mikirakira ny fifidianana ity tamin’ireo mpisehatra isan-tsokajiny amin’ny fifidianana.', '<p>&nbsp; &nbsp;Hevi-dehibe nisongadina hatreto ny fanajana izay voalazan&rsquo;ny lal&agrave;mpanorenana mikasika ny fe-potoam-piasan&rsquo;ireo olom-boafidy ankehitriny ho 5 taona. Tapitra ny 25 janoary 2019 ohatra izany ho an&rsquo;ny filohan&rsquo;ny Repoblika, izany hoe mila manana filoha voafidim-bahoaka vaovao i Madagasikara amin&rsquo;io daty fahataperan&rsquo;ny fe-potoana io, hoy ny filoha nasionalin&rsquo;ny Kmf/Cnoe Rabekijana F&eacute;lix. Teboka iray goavana tokony hita ao anatin&rsquo;ny fanavaozana ny lal&agrave;m-pifidianana moa ny fahafahan&rsquo;ny Ceni mandroso an-kalalahana ny tetiandrom-pifidianana. Ilaina voarakitra mazava tsara ao anatin&rsquo;ny lal&agrave;m-pifidianana nasiam-panavaozana rahateo ny fahafahan&rsquo;ny rafitra mahaleotena mikirakira ny fifidianana Malagasy mamaritra io alimanakam-pifidianana io, araka ny fanampim-panazavany. Nangonin-dRamano F. Sary fampihaingoana&nbsp;: Rabekijana F&eacute;lix, filoha nasionalin&rsquo;ny Kmf/Cnoe (Tahirin-tsary) &nbsp; &nbsp;</p>', 0, 1, 0, 'upload/17-05-10-1494423948.JPG'),
(61, 13, 3, 0, '2017-05-10', '“Robot” 300 hasolo ny mpiasa  Mihorohoro ny mpiasan’ny Ultramaille', 'toe-karena/Robot-300-hasolo-ny-mpiasa--Mihorohoro-ny-mpiasanny-Ultramaille-10052017-61', 'Efa misy ny mampiasa ny “Robot” ho solon’ny olona miasa amin’ireny orinasa afaka haba ireny amin’izao fotoana izao fa tsy honohono intsony.', 'Efa misy ny mampiasa ny “Robot” ho solon’ny olona miasa amin’ireny orinasa afaka haba ireny amin’izao fotoana izao fa tsy honohono intsony.', '<p>&nbsp;Anisany ny Accord Knits eny Andraharo, izay efa nandroaka mpiasa 150, roa taona lasa izay, raha ny fanazavan&rsquo;ny mpitarika Sendikan&rsquo;ny Kristianina Malagasy (SeKriMa) tamin&rsquo;ny alalan&rsquo;ny Sekretera jeneraly nasionaliny, Botodia Rhemi Henri omaly. Amin&rsquo;izao fotoana, ny orinasa afaka haba Ultramaille indray no voalaza fa nanafatra "Robot" 300 ary efa any anaty sambo izany. Maro indray ny mpiasa mitebiteby satria manahy ny horoahina, ka ireo fitaovana avo lenta ireo no hasolo azy. Ambara ho tsy vitan&rsquo;ny olona ny asa toy ny&nbsp; ny &ldquo;tricotage&rdquo;, ka izay no hanafarana fitaovana hanao azy. Manoloana izany, tsy rariny ny fanesorana mpiasa amin\'ny asany amin\'ny alalan\'ny fampiasana "Robot" hasolo azy ireo, hoy ny SeKriMa. Anisan&rsquo;ny lal&agrave;na nampidirana ny orinasa afakaba teto amintsika tamin&rsquo;ny taona 1989 ny hampihenana ny tahan&rsquo;ny tsy an&rsquo;asa teto amintsika. Ny fampiasana tanana no antony nisian&rsquo;ny&nbsp; orinasa fa tsy ny fampidirana &ldquo;Robot&rdquo;. Izany no antony nanaovantsika politika mitodika tamin&rsquo;ny fampiasana ny orinasa afaka haba tamin&rsquo;ny fotoan&rsquo;androny. Marina fa misy ny asa mety tsy ho vitan&rsquo;ny tanana fa ilana masinina saingy mila lanjalanjaina sy tsinjovina ireo very asa, ary mila manokatra asa vaovao ny mpampiasa raha toa ka hampiditra &ldquo;robot&rdquo;, hoy Botodia Rhemi Henri. Tsy mitsinjo ny maha olona ny fisian&rsquo;izy io, hoy ny sekretera jeneralin&rsquo;ny SeKriMa. Toky R &nbsp;</p>', 0, 1, 0, NULL),
(62, 13, 3, 0, '2017-05-10', '«Taux directeur» 9%  Hampihisatra ny fampiasambola ', 'toe-karena/Taux-directeur-9--Hampihisatra-ny-fampiasambola--10052017-62', 'Tsy resy lahatra amin’ny fampisondrotan’ny komity mpikirakira vola eo anivon’ny Banky Foiben’i Madagasikara ny «taux directeur» ho 9% manomboka rahampitso 11 mey 2017 ny fianakaviamben’ny mpahay toekarena Malagasy. ', 'Tsy resy lahatra amin’ny fampisondrotan’ny komity mpikirakira vola eo anivon’ny Banky Foiben’i Madagasikara ny «taux directeur» ho 9% manomboka rahampitso 11 mey 2017 ny fianakaviamben’ny mpahay toekarena Malagasy. ', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:va