deWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Antony fototra ny fialana amin&rsquo;ny fidangan&rsquo;ny vidim-piainana mety hitohy lavareny, hoy ny governora Rasolofondraibe Alain Herv&eacute;. </span><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Manahy noho ity fanapahan-kevitra tsy voahevitra ity rahateo ny ekonomista Malagasy. Miseho ivelan&rsquo;ny banky avokoa mantsy ny ampahany betsaka amin&rsquo;ireo vola mivezivezy eto Madagasikara, araka ny fanamarihan&rsquo;ireo manampahaizana momba ny toekarena. Fampikatsoana ny fampiasambola io fepetra noraisina io ary hampihisatra tanteraka ny lafiny famokarana eto amin&rsquo;ny firenena, hoy ny mpampianatra mpikaroka Ratobisaona Rado. Hiantraika mivantana amin&rsquo;ireo tokantrano sy orinasa efa vitsy mampiasa vola eny amin&rsquo;ny banky ny fitomboana 0,7%, araka ny fanampim-panazavany. Ny mpitondra fanjakana izay mivoy ihany koa ny politikan&rsquo;ny fisarihana ireo mpampiasa vola hampiakarana ny harikarena Malagasy. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Nangonin-dRamano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: EN-US; mso-fareast-language: FR;">Sary fampihaingoana&nbsp;: Ratobisaona Rado, mpampianatra mpikaroka toekarena eny amin&rsquo;ny anjerimanontolo</span></em></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-10-1494424050.JPG');
INSERT INTO `article` (`idarticle`, `idjournal`, `idcategorie`, `idadministrateur`, `dateparution`, `titre`, `url_tag`, `extrait`, `resume`, `contenue`, `laune`, `etatpublication`, `niveau`, `lien_image_une`) VALUES
(63, 13, 21, 0, '2017-05-10', 'Ambohitromby-Ambodirano, Ambatondrazaka  Jiolahy iray no lavon’ny balan’ny zandary', 'fandriampahalemana/Ambohitromby-Ambodirano-Ambatondrazaka--Jiolahy-iray-no-lavonny-balanny-zandary-10052017-63', '. Ravan’ny zandary miasa ao Vohidiala any Ambatondrazaka ny talata heriny teo ny andian-jiolahy nifanenjehana hatrany Ambohitromby-Ambodirano ao amin’ny distrikan’Ambatondrazaka.', '. Ravan’ny zandary miasa ao Vohidiala any Ambatondrazaka ny talata heriny teo ny andian-jiolahy nifanenjehana hatrany Ambohitromby-Ambodirano ao amin’ny distrikan’Ambatondrazaka.', '<p>&nbsp; Jilolahy iray izay efa anisan&rsquo;ireo nokarohina am-bolana maro no matin&rsquo;ny balan&rsquo;ny zandary tao anatin&rsquo;ny fanafihana tan&agrave;na iray nataon&rsquo;izy ireo, iray hafa azo sambo-belona ary ny fahatelo kosa afa-nandositra. Azo ambara fa nahita vokatra tsara&nbsp; tao anatin&rsquo;ny iray volana, ny fari-piadidian&rsquo;ny zandarimaria nasionaly ao Alaotra Mangoro, hatramin&rsquo;izay nanampiana zandary 71 tao aminy izay. Nahasarona fitaovam-piadiana maro izy ireo tao amin&rsquo;ny kaominin&rsquo;Ambohijanahary raha vao nandray ny asany, nahatafaverina omby halatra maro ihany koa tao Amboivory sy Manakambahiny Est ary teratany Sri-Lankais 6 tsy nanara-dal&agrave;na no voasambotra tao Tanambe. Ntsoavina Evariste Ilay jiolahy nanafika tan&agrave;na maty tany Ambohitromby-Ambodirano &nbsp;</p>', 0, 1, 0, 'upload/17-05-10-1494424161.jpg'),
