y Jean fa tonga dia tretrika tsy misy toy izany ny fonareo mandre izay fanapahakevitray izay e! Hiverina tsikelikely any amin&rsquo;ny politika tranain&rsquo;ny voalohandohan&rsquo;ny repoblikantsika ihany ve tsy aleo tonga dia mivarina ohatr&rsquo;izay lazaiko izay mihitsy? Mba manao fampanantenana paokaty ohatranareo koa nefa aho ry Jean fa tsy hanatanteraka ny revinareo akory a! Lalao mbola ho ela e!</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="mso-ansi-language: EN-US;">Marco </span></strong><span lang="EN-US" style="mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp;</span></span></p>', 0, 1, 0, NULL),
(65, 15, 5, 0, '2017-05-12', '   Fananganana ny fitsarana ambony  Matahotra mafy i Rajaonarimampianina', 'politika/---Fananganana-ny-fitsarana-ambony--Matahotra-mafy-i-Rajaonarimampianina-12052017-65', '\r\n12 volana taorian’ny nandraisan’ny filohan’ny Repoblika fahefana no tokony ho nananganana ny Fitsarana ambony na ny fitsarana ambony na HCJ (Haute Cour de Justice). Io no fahefana mahefa tokony hitsara ny filoham-pirenena, praiminisitra, minisitra sy ireo lehiben’ny andrim-panjakana.', '\r\n12 volana taorian’ny nandraisan’ny filohan’ny Repoblika fahefana no tokony ho nananganana ny Fitsarana ambony na ny fitsarana ambony na HCJ (Haute Cour de Justice). Io no fahefana mahefa tokony hitsara ny filoham-pirenena, praiminisitra, minisitra sy ireo lehiben’ny andrim-panjakana.', '<p>&nbsp; Efa voafaritry ny lal&agrave;mpanorenana ny tokony hananganana azy io fa tsy mbola mipetraka mandrak&rsquo;ankehitriny. Ny filoham-pirenena mihitsy no tsy taitra sy tsy te hanangana azy io, raha dinihina amin&rsquo;ny fanehoan-keviny teny amin&rsquo;ny CCI Ivato omaly. Matoa tsy mipetraka izy io dia misy fepetra tsy feno fa tsy hoe finiavana tsy hanangana azy, ary mbola eo am-pandaminana. Misy ihany koa ny antanantohatra maro samihafa amin\'ny fametrahana azy, hoy i Hery Rajaonarimampianina. Ny mahavoa antsika dia rehefa tiantsika hapetraka ilay izy, dia milaza isika hoe hapetraka na dia tsy feno aza ary rehefa tsy tiantsika hapetraka dia hafa indray no handraisana azy hoe misy mahamaika indray ao. Ny zava-misy sy ny lojika anefa dia matahotra mafy ny toerany i Hery Rajaonarimampianina noho ny fanitsakitsahana lal&agrave;mpanorenana sy ny afera maizina maro mahavoatonona ny anarany, ka toa mitady izay fomba tsy hahatafatsanganan&rsquo;io rafi-pitsarana io mandra-pialany eo amin&rsquo;ny toerana. Tsy atao mahagaga raha mahita hevitra hialana bala foana ny filoha rehefa misy ny famohazana ny resaka fananganana azy io. Ny HCJ no afaka hanamarina sy hanenjika ny filoham-pirenena ary afaka hankato ny fanenjehana azy, toy ny resaka fanonganan&rsquo;ny antenimiera ny filoha na ny &ldquo;motion de dech&eacute;ance&rdquo;. Raha tsiahivina, ny volana mey 2015 i Hery Rajaonarimampianina no naongan&rsquo;ny depiote, ary efa tokony ho niongana mihitsy satria ny 221 tamin&rsquo;ireo mpikamban&rsquo;ny antenimiera izay miisa 251 no nankato ny fampiatoana sy fanonganana azy. Toy ny angady tsy nahatapak&rsquo;ahitra anefa ny Fitsarana avo momba ny lal&agrave;mpanorenana, ary iaraha-mahita ny fironan-keviny, izay nampanao ilay fifanarahan&rsquo;andraikitra na &ldquo;pacte des responsabilit&eacute;s&rdquo; teo amin&rsquo;ny filoha sy ireo depiote, izay tsy hita ny niafarany fa nentina namonoana afo fotsiny. SARY BD Toky R &nbsp;</p>', 1, 1, 0, 'upload/17-05-12-1494572444.jpg'),
(68, 15, 5, 0, '2017-05-12', 'Mpisolovava an’i Fernand Cello  “Tsy resaka taratasim-bola hosoka io”', 'politika/Mpisolovava-ani-Fernand-Cello--Tsy-resaka-taratasim-bola-hosoka-io-12052017-68', 'Resaka halatra taratasim-bola hosoka mitentina 4 tapitrisa ariary efa tamin’ny taona 2015 nitorian’i Niry Maherilahy mpandraharaha, mpitantana orinasa mpamokatra jiro any Ilakaka no nampidoboka am-ponja vonjimaika an’i Fernand Cello vonjimaika. ', 'Resaka halatra taratasim-bola hosoka mitentina 4 tapitrisa ariary efa tamin’ny taona 2015 nitorian’i Niry Maherilahy mpandraharaha, mpitantana orinasa mpamokatra jiro any Ilakaka no nampidoboka am-ponja vonjimaika an’i Fernand Cello vonjimaika. ', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n