 Locked="false" Priority="73" SemiHidden="false"\r\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">Nitondra ny heviny ny mpisolovava Rasoanandrasana Marie Claudia, mpiaro an&rsquo;i Fernand Cello. Tsy ara-dal&agrave;na ny fahitako azy. I Niry Maherilahy no voalaza fa nanome ny taratasim-bola ho azy, hoy izy. Raha ny fanazavany, nirahin&rsquo;i N&ocirc;n&ocirc; haka vola tany amin&rsquo;io mpandraharaha io, hampiasaina amina propagandy i Fernand Cello, saingy tsy nisy vola mivantana fa taratasim-bola no nomen&rsquo;i Niry Maherilahy. Izay no nahatonga ilay taratasim-bola ho tany amin&rsquo;i Cello, izay midika fa tsy ho azy akory ilay vola, hoy ny mpiaro azy. Tsy tonga dia hanome 4 tapitrisa ariary amin&rsquo;ny alalan&rsquo;ny taratasim-bola ny banky raha ny lal&agrave;na fa tsy maintsy maka alalana avy amin&rsquo;ny tompon&rsquo;ilay taratasim-bola. Voaloa ny vola ary tsy nisy olana nandritra ny 2015 ka hatramin&rsquo;ny aogositra 2016. Ny raharahan&rsquo;Ilakaka momba ny fitrandrahana harena ankibon&rsquo;ny tany sy ny fanehoan-kevitra nataon&rsquo;i Fennad Cello no tsy nifankahazoana fa tsy resaka taratasim-bola raha ny fanambaran&rsquo;ny mpisolovava. Notapahin&rsquo;i Niry Maherilahy ny jiron&rsquo;ny Radio Jupiter taorian&rsquo;izay, ka nitory i Fernand Cello, ary teo no nivoahan&rsquo;ny fandrahonana tamin&rsquo;ny alalan&rsquo;ny finday nataon&rsquo;io mpandraharaha io hoe : Tsoahy ny fitoriana raha tsy izany lazaiko fa nangalarin&rsquo;ialahy tao anaty fiara ilay taratasim-bola, araka ny fanazavan&rsquo;ny mpisolovava hatrany. Mitaky ny hamerenana ny findain&rsquo;io mpanao gazety io ny mpisolovava azy satria ao ny porofo, ary mangataka ny fanamarinana ilay taratasim-bola, izay misy ny sonian&rsquo;ilay mpandraharaha nitory. Manohintohina ny asa fanaovan-gazety ny fanagadrana azy, hoy ny mpisolovava Rasoanandrasana Marie Claudia. Taorian&rsquo;ny fisehoana tamina fahitalavitra iray ny 3 mey teo no nanenjehana sy nanagadrana azy, ary manamafy izany ny nisamborana azy andro vitsy taorian&rsquo;izay, raha ny fanambaran&rsquo;io mpisolovava io, ka angatahin&rsquo;izy ireo ny hanafahana vonjimaika azy satria tsy voahaja ny zon&rsquo;ny fiarovana. Nilaza kosa ny tonian&rsquo;ny fampanoavana any Ihosy, Rabenirainy Tinah fa efa hatramin&rsquo;ny faran&rsquo;ny desambra 2016 ny raharaha Fernand Cello, izay mikasika taratasim-bola sy fampiasana hosoka, ka nakana azy taty an-drenivohitra, izay toa mandiso fa tsy ny resaka fisehoana tamin&rsquo;ny fahitalavitra teto an-drenivohitra no antony. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-12-1494582497.JPG');
