justify: inter-ideograph; line-height: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">&nbsp;Toa mijanona ho resabe kosa ny fitsipaham-pitokisana, izay noheverina fa hafana sy hisian&rsquo;ny adihevitra lehibe eny amin&rsquo;ny antenimieram-pirenena. Miombon-kevitra sy mankasitraka ny asan&rsquo;ny governemanta ve izany na ny mpanohitra aza ? Efa nahazo fampanantenana sy tambiny ve ireo solombavambahoaka, ka na ireo nilaza ho vonona sy mandrisika aza efa niova hevitra ? Mandeha ny feo fa fiara tsy mataho-d&agrave;lana no setrin&rsquo;ny tsy fanaovana fitsipaham-pitokisana. Samy miandry izay hiseho ny vahoaka tsy mandady harona.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="IT" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: IT;">&nbsp;</span></p>', 0, 1, 0, NULL),
(70, 15, 5, 0, '2017-05-12', 'Fifidianana 2018  Efa nahangom-bola be Rajoelina ?', 'politika/Fifidianana-2018--Efa-nahangom-bola-be-Rajoelina--12052017-70', 'Na mangina sy tsy re tsaika firy aza i Andry Rajoelina, dia voalaza fa miketrika mafy amin’ny fanomanana ny fifidianana filoham-pirenena 2018', 'Na mangina sy tsy re tsaika firy aza i Andry Rajoelina, dia voalaza fa miketrika mafy amin’ny fanomanana ny fifidianana filoham-pirenena 2018', '<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormalCxSpMiddle" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">. Ny resaka ara-bola no tena niomanany sy hiomanany fatratra, raha ny loharanom-baovao iray. Fony teo amin&rsquo;ny fitondrana izy no efa nahangona volabe izay niomanany hanaovana propagandy, saingy niaraha-nahita ny tsy nahafahany nirotsaka tamin&rsquo;ny alalan&rsquo;ny &ldquo;ni...ni...&rdquo;, ka dia i Hery Rajaonarimampianina no natosiny. Nivadihan&rsquo;ity farany i Andry Rajoelina sy ny ekipany tato aoriana kely noho ny resaka lonilony sy valifaty. Ny filoha ankehitriny no voalaza fa nataon&rsquo;izy ireo saribakoly tamin&rsquo;ny resaka fitantanam-bola, ka samy naka izay azony sy nanjakazaka izy ireo. Na niezaka nanangam-bovona aza tsy afa-nanoatra firy taorian&rsquo;ny tsipaka am-bavafo, ka dia nanozongozona sy saika handrodana fitondrana toy ny tamin&rsquo;ny 2009 indray saingy tsy nahomby. Voalaza mantsy fa saika hanantanteraka izany izy ireo ny taona 2015 nisian&rsquo;ilay volabe 200 tapitrisa ariary nentin&rsquo;ny solombavambahoaka Lanto Rakotomanga, izay sarona teny Soanierana ny 8 jona 2015. Nandeha ny resaka fa ampahany tamin&rsquo;ny vola hanomanana fanonganam-panjakana iny, ka ny fahasaronana azy no antony iray tsy nampahomby ny tetika. Toa tonga saina sy niezaka nanova famindra i Andry Rajoelina taty aoriana ary te hikosoka ny tantara ratsy napetrany teto amin&rsquo;ny firenena, ka nisafidy ny nangina satria mbola manana fanantenana ny hitondra fanjakana. Vao mainka hitombo indray mantsy ny laza ratsy raha mbola hanongana indray sady ny hery sy fahefana tsy ampy intsony. Tsy dia noraharahainy firy ny fanehoan-kevitra politika fa nitsapa ny halalin&rsquo;ny rano fotsiny izy tamin&rsquo;ny fanehoan-kevitra nataony, toy ny tamin&rsquo;ny </span><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IT;">12 febroary, ka nilazany fa tsy misy hahasakana azy tsy ho kandida. A</span><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">leony tsy misehoseho sy mipetrapetraka aloha mba hialana amin&rsquo;ny setrasetran&rsquo;ny HVM, izay fahavalo voalohan&rsquo;i Andry Rajoelina sy ny MAPAR eo amin&rsquo;ny tontolo politika. Mbola baraingo anefa hatreto ny hahafahany mirotsaka na tsia. Mbola mitatao ao an-damosiny ihany koa ny sazy tsy hahafahany mirotsaka ho filoha noho ny resaka fanonganam-panjakana satria raha ny fitsipika iraisam-pirenena, izay voafaritry ny Fifanarahan&rsquo;i Cotounou dia tsy azon&rsquo;ny olona nanongam-panjakana toa azy atao ny mirotsaka amin&rsquo;ny fifidianana ara-demokratika.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="IT" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IT;">Toky R</span></em></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\r\n  DefSem