Efa voazanaka ara-tsaina sy ara-panahy tokoa angamba ny Malagasy, ary mety voahozona hanana mpitondra tia tena sy mpandroba firenena, ka miaka-peo am-boalohany fotsiny fa manaiky ny tsy maty manota sy ny fanitsakitsahana hatrany an-tampondoha ihany rehefa mandeha ny ora sy ny fotoana.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="mso-ansi-language: EN-US;">Toky R</span></em></strong></p>', 0, 1, 0, NULL),
