iresa-dry zareo tamin&rsquo;ny maraina izay anie ka ohatry ny hoe hatao mifapipeka fotsiny ny ankihibe sy ny fanondro adala dia tonga dia eo am-pelatanany ny fahefana e ! ha! Ha! Ha ! Izahay koa mba hitondra ohatra an-dry zareo ka ! Tena marina e! Hitanareo amin&rsquo;izany anie izao fa efa tena mampivaralila mihitsy ilay fomba fitantananareo e ! Tena aleo marina ry Jean izahay no hiaraka handimby anareo eo ka ! Sao farafaharatsiny izahay mba mahavita tsaratsara kokoa noho ianareo na dia kely aza.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco </span></strong></p>', 0, 1, 0, NULL),
(74, 17, 21, 0, '2017-05-16', 'Asan-jiolahy,tsy filaminana Manampahefana maro hoesorina', 'fandriampahalemana/Asan-jiolahytsy-filaminana-Manampahefana-maro-hoesorina-16052017-74', '\r\n\r\nNampiantso an’ireo tompon’andraikitra  rehetra misahana ny fandriampahalemana eto amintsika  toy ny  minisitry ny fambolena sy ny fiompiana, ny ministry ny fiarovam-pirenena, ny minisitry ny fitsarana, ny minisitry ny filaminana Anatiny, ny komandin’ny zandarimariam-pirenena (COMGN), ny sekretara jeneralin’ny minisiteran’ny Atitany sy ny fitsijaram-pahefana, ny sekretera jeneralin’ny governemanta, \r\n\r\n\r\n', '\r\n\r\nNampiantso an’ireo tompon’andraikitra  rehetra misahana ny fandriampahalemana eto amintsika  toy ny  minisitry ny fambolena sy ny fiompiana, ny ministry ny fiarovam-pirenena, ny minisitry ny fitsarana, ny minisitry ny filaminana Anatiny, ny komandin’ny zandarimariam-pirenena (COMGN), ny sekretara jeneralin’ny minisiteran’ny Atitany sy ny fitsijaram-pahefana, ny sekretera jeneralin’ny governemanta, \r\n\r\n\r\n', '<p>&nbsp;ny sekreteram-panjakana miadidy ny Zandarimariam-pirenena (SEG),&nbsp; ny talen&rsquo;ny kabinetra miaramila eo anivon&rsquo;ny primatiora,&nbsp; ny Talen&rsquo;ny kabinetra sivily eo anivon&rsquo;ny Primatiora ary solon-tena avy amin&rsquo;ny ministeran&rsquo;ny Varotra sy Fanjif&agrave;na, omaly alatsinainy 15 mey teny amin&rsquo;ny lapam-panjakana teny Mahazoarivo ny praiminisitra, lehiben&rsquo;ny Governemanta Mahafaly Solonandrasana Olivier ary nitarika fivoriana manokana tsy ara-potoana mahakasika ny&nbsp; fomba hanatsarana ny tsy fandriampahalemana amina sehatra maromaro eto amin&rsquo;ny firenena.&nbsp; &ldquo;Tsapa fa be ny fanakianana ataon&rsquo;ny olompirenena sy ny mpanao politika manoloana io toe-javatra io, hoy izy, ary mety misy ahiahy ka ny famaliana izany no anton&rsquo;ny fivoriana omaly.&nbsp; Efa betsaka ireo tompon&rsquo;andraikitra voasazy ary efa be ireo nandalo &ldquo;conseil de discipline&rdquo; fa mety mbola maro koa ireo hoesorina amin&rsquo;ny toerany. Anjarako amin&rsquo;ny maha lehiben&rsquo;ny governemanta ahy ny mampitandrina sahady ireny olona ireny. Aoka izay ny gaboraraka ka raiso ny andraikitra fa izay tsy mandray andraikitra dia ny fitondram-panjakana no hanafay azy, fa tsy mendrika an&rsquo;izany intsony ity firenena ity satria betsaka ny olona no miteny fa tsy misy fanjakana intsony, Ka izay tratra sy voaporofo amin&rsquo;ny firaisana tsikombakomba, sy tafiditra amin&rsquo;ny herisetra sy vono olona dia tsy maintsy handraisana fepetra&nbsp; hentitra sy homena sazy enjana&rdquo;. Ho jerena akaiky sy harahi-maso koa ny resaka halatra lavanila any Avaratry ny nosy iny, hoy izy, ary dia hosaziana tsy misy antra na indrafo izay tratra. Hoan&rsquo;ny resaka fitsaram-bahoaka indray dia manao ny ezaka ny fitondram-panjakana hiadiana amin&rsquo;izany, fa raha misy firenena na mpiara-miombon&rsquo;antoka maniry hanampy ara-pitaovana na ara- bola amin&rsquo;ny ady atao dia tsy mand&agrave; ny fitondram-panjakana. Farany mikasika ny resaka fak&agrave;na an-keriny niseho tato ho ato dia nambaran&rsquo;ny PM Solonandrasana fa teny misy izy io ka andraikitry ny fitondram-panjakana aminy dia ny miady ary misoroka an&rsquo;izany fak&agrave;na an-keriny izany, ary mitady ny fomba&nbsp; rehetra hahatrarana ireo tambajotra mahatonga azy. Ho hita tsy ho ela ny vokatry ny fak&agrave;na an-keriny ny zanaky ny tompon&rsquo;ny orinasa Socolait, hoy izy.Ntsoavina Evariste Fivoriana maika teny Mahazoarivo omaly alatsinainy</p>', 1, 1, 0, 'upload/17-05-16-1494941570.jpg'),
(75, 17, 21, 0, '2017-05-16', 'Trafikana fitaovam-piadiana  Basy sy bala 446 saron’ny zandary ', 'fandriampahalemana/Trafikana-fitaovam-piadiana--Basy-sy-bala-446-saronny-zandary--16052017-75', 'Misy miketrika fanakorontanana ve fa tena mirongatra ny trafikana basy sy bala ? Olona 3 indray no saron’ny zandarimariam-pirenena ao amin’ny sampana fikarohana heloka- bevava etsy Fiadanana (SRC).', 'Misy miketrika fanakorontanana ve fa tena mirongatra ny trafikana basy sy bala ? Olona 3 indray no saron’ny zandarimariam-pirenena ao amin’ny sampana fikarohana heloka- bevava etsy Fiadanana (SRC).', '<p>&nbsp; Teny Namontana no nanaovana velapan-drika ny lehilahy roa taorian&rsquo;ny fampitam-baovao voarain&rsquo;ny zandary ka voasambotra ny iray izay nahatrarana basy PA iray 22 long rifle tsy misy taratasy. Tafaporitsaka kosa ny namany iray ny 11 mey. Rehefa natao ny fanadihadiana azy dia nanoro ny namany roa hafa ka natao indray ny vela-pandrika ary dia tratra teny akaikin&rsquo;ny Centre d&rsquo;accueil Fiadanana izy ireo. Hita niaraka tamin&rsquo;izy ireo ny bala marobe miisa 446 (Calibre 12) fampiasa amin&rsquo;ny basyfitondra mihaza (FC) izay tsy misy taratasy mazava koa.Efa natolotra ny fampanoavana ny 15 mey 2017 ilay lehihy iray voalohany ka tafiditra am-ponja vonjimaika eny Antanimora. Anio talata kosa no hatolotra ny fampanoavana izy roalahy tratra niaraka tamin&rsquo;ny bala. Manamarika ny zandarimariam-pirenena fa zava-dehibe ny fanomezam-baovao azy ireo vantany vao misy olona manao fihetsika hafahafa. Tombontsoa lehibe ho an&rsquo;ny rehetra ny fahafahana misambotra avy hatrany ireo mpanao trafikana fitaovam-piadiana izay mamatsy ireo jiolahy na eto an-drenivohitra na any ambanivohitra. Efa tena mazava izany aloha izao fa misy mampiditra basy sy bala eto ary misy mpivarotra sy mpividy. RTT &nbsp; &nbsp;</p>', 0, 1, 0, 'upload/17-05-16-1494942704.JPG'),
