nguage: EN-US;">homanin-dry zareo avy eo anivon&rsquo;ny minisitera tompon&rsquo;andraikitra hampivelarana kokoa ny sehatra ahafahana mikirakira itony teknolojia vaovao itony. Anisan&rsquo;izany ny fampitetezana amina toerana vitsivitsy ny antsoina hoe Cyberbus manerana ireo vakim-paritra vitsivitsy eto Antananarivo. Zava-dehibe heverina fa mila velarina amin&rsquo;ny fampandrosoana ny fifandraisan-davitra koa ary hampidirina tsimoramora eo amin&rsquo;ny asam-panjakana ny fikirakirana ny Big data, zotra aterineto ahafahana manafaingana asa sy mampitombo vokatra eo amin&rsquo;ity sehatra ity.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mirija</span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-16-1494940725.JPG');
