; Anisan&rsquo;ny hanamarika azy ity ny fampahafantarana ny rehetra mikasika ny antony sy ny karazam-panampiana azon&rsquo;ny vondrona omena antsika, raha ny fanazavan&rsquo;ny minisitra Athalah Beatrice. Mbola ho baraingo kosa ny mety ho tohin&rsquo;ny fiaraha-miasantsika sy ny vondrona Eoropeanina, raha ny filazany hatrany. Araka ny fantatra dia ny taona 2020 no tapitra ny fifanarahan&rsquo;i Cotonou. Tany anatin&rsquo;ireo fihaonana ara-politika nataony niaraka tamin&rsquo;ny governemanta dia nanindry mafy ny hanamafisana ny ady amin&rsquo;ny kolikoly, ny fametrahana ny mangarahara amin&rsquo;ny fitantanana ny raharaham-panjakana, ny fanamafisana ny ady atao amin&rsquo;ny fanondranana ny harem-pirenena ary ny fanajana ny zon&rsquo;olombelona hatrany ny Eoropeanina. Sombintsombiny avy amin&rsquo;ny ilay 518 tapitrisa euros famatsiambola amin&rsquo;ny alalan&rsquo;ny FED 11 no nampanantenaina fa ho azon&rsquo;i Madagasikara. Hita ho miahiahy ny amin&rsquo;ny fifandraisana amin&rsquo;ny mpitondra HVM ny vondrona Eoropeanina. Ny filoha Hery Rajaonarimampiniana ihany koa etsy an-kilany tao anatin&rsquo;ilay fandaharana &ldquo;fotoam-bita&rdquo; dia nanatsidika fa ela ny fivoahan&rsquo;ny famatsiam-bola avy amin&rsquo;ny tandrefana ka ilaina ny fifampiraharahana sy fiaraha-miasa amin&rsquo;ny tatsinanana, tahaka ny Sinoa ohatra. Samy nilaza ho afa-po tamin&rsquo;ny fiaraha-miasa tao anatin&rsquo;ny 60 taona anefa ny roa tonta.</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">SARY : BD Hugues</span></em></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mirija</span></p>', 0, 1, 0, 'upload/17-05-16-1494940893.JPG'),
