me="Colorful List Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="73" SemiHidden="false"\r\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="ES-MX" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: ES-MX;"><span style="mso-spacerun: yes;">&nbsp; </span>Notanterahina tao amin&rsquo;ny <em style="mso-bidi-font-style: normal;">Le Cam&eacute;lia</em>, Village touristique, Mahajanga ny zoma 12 mey 2017 ny atrikasa hankatoavana ny fenitra Malagasy sy ny fanarahan-dal&agrave;na ara-teknika amin&rsquo;ny resaka lojy mainty maso na &ldquo;A<em style="mso-bidi-font-style: normal;">telier de validation de la norme Malagasy et du r&egrave;glement technique sur le black eyes</em>&rdquo;, izay teo ambany fiahian&rsquo;ny ny minisiteran&rsquo;ny varotra sy ny fanjifana.<span style="mso-spacerun: yes;">&nbsp; </span>Ny vondrona Eoropeanina tamin&rsquo;ny alalan&rsquo;ny ny<em style="mso-bidi-font-style: normal;"> FED (Fonds Europ&eacute;en pour le d&eacute;veloppement) </em>no misahana ny famatsiam-bola ny tetikasa. Hatrizay, hoy ny fanazavan&rsquo;ny talem-paritry ny DRCC Boeny, Belalahy Jean Berchmans, dia tsy mbola nisy lal&agrave;na nifehy ny vokatra black eyes teto Madagasikara nefa be mpanafatra izy io any ivelany.<span style="mso-spacerun: yes;">&nbsp; </span>An-kilan&rsquo;izay, ny mpisehatra azy tsy mahafehy ny fenitra sy kalitao takian&rsquo;ny tsena iraisam-pirenena, hany ka niteraka fatiantoka tamin&rsquo;ireo mpandraharaha mpanondrana ary nampitotongana ny vidiny teny amin&rsquo;ny mpamokatra. Manomboka izao dia horaiketina anatin&rsquo;ny bokin&rsquo;ny lal&agrave;nam-barotra manan-kery eto Madagasikara ny seha-pihariana black eyes ary hamoraina ny haba amin&rsquo;ny fanondranana, ka samy hahazo tombony na ny mpamboly na ny mpanondrana na ny faritra ivoahany. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="ES-MX" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: ES-MX;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="ES-MX" style="mso-ansi-language: ES-MX;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-16-1494941097.JPG'),
