"true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span lang="EN-US">&ldquo;Ny firenena tsy manana tantara dia firenena tsy misy fanahy&rdquo;, hoy ny vahiny. Miha valalanina hatrany ianao rehefa mahita fanadihadiana atao amin&rsquo;ny zaza sy ankizy, eny hatramin&rsquo;ny tanora rehefa mihazohazo tsy mahita havaly raha vao hametrahana fanontaniana mikasika ny tantaram-pirenena na amin&rsquo;ny haino aman-jery na amina fihaonana isan-karazany miompana amin&rsquo;izany. Inona no mahazo antsika amin&rsquo;izao fotoana ? Hararaotin&rsquo;ny mpiavy noho ny tsy firaharahiana sy tsy fahalalana firy ny tantaram-pirenena. Hahagaga ve raha lasa mpitandro ny filaminana hatrany no tena rakotra rehefa tonga ny fotoam-pahatsiarovana toy ireny tamin&rsquo;ny 13 mey ireny. Saika vahiny avokoa no nanoratra ny tantaram-pirenena, hany ka manao telimoka fotsiny sisa ireo zanatsika sy taranaka fa tsy miasa saina ny hamadika ny tantaram-pirenena intsony. Hionona ve izany moa sa hianona ?</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mirija</span></strong></p>', 0, 1, 0, NULL);
