Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Eo aloha ny fanitsiana ireo andininy faha-38 sy faha-39 amin&rsquo;ny lal&agrave;na 2015/020 tamin&rsquo;ny 18 oktobra 2015 momba ny rafitra maha mahaleotena ny Ceni (Commission Electorale Nationale Ind&eacute;pendante). </span><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Fanavaozana takiany moa ny fahafahan&rsquo;ny Vaomiera mahaleotena mikirakira ny fifidianana mamaritra mazava ny alimanakan&rsquo;ny fifidianana amin&rsquo;ny alalan&rsquo;ny didim-panjakana. Fanatsarana tian&rsquo;ity depioten&rsquo;Analalava ity hoentina ihany koa ny mikasika ny lal&agrave;na 2014-020 ny 20 aogositra 2014 momba ny Vondrom-bahoaka Itsinjaram-Pahefana. Anisan&rsquo;izany ny fiantsoana ireo tompon&rsquo;andraikitra voalohany dia ny ben&rsquo;ny tan&agrave;na ho an&rsquo;ny kaominina, governora ho an&rsquo;ny faritra ary mpandrindra ho an&rsquo;ireo faritany. Tokony ho olom-boafidin&rsquo;ny olom-pirenena mivantana izy ireo. Ilaina foanana ny andininy faha-313 milaza ny fanendrena ny PDS (Pr&eacute;sident de D&eacute;l&eacute;gation Sp&eacute;ciale) raha tiana ny tsy fiankinan-doha ara-bolan&rsquo;ireo rafitra fitsinjaram-pahefana ireo, araka ny fanamarihan&rsquo;ity olom-boafidy ity. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Nangonin-dRamano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-fareast-language: FR;">Sary fampihaingoana&nbsp;: Djaosera Iren&eacute;e, solombavambahoakan&rsquo;i Madagasikara ao Analalava</span></em></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-16-1494941339.jpg'),
