INSERT INTO `article` (`idarticle`, `idjournal`, `idcategorie`, `idadministrateur`, `dateparution`, `titre`, `url_tag`, `extrait`, `resume`, `contenue`, `laune`, `etatpublication`, `niveau`, `lien_image_une`) VALUES
(83, 18, 5, 0, '2017-05-17', 'Andry Rajoelina  Ireo antony mampangina azy…', 'politika/Andry-Rajoelina--Ireo-antony-mampangina-azy-17052017-83', 'Mampametra-panontaniana ny maro ny fahanginan’i Andry Rajoelina amin’izao satria tsy hita ao anaty tabilao mihitsy ny tenany eo amin’ny tontolo politika. Tsy tongatonga ho azy izy io fa misy antony maro. ', 'Mampametra-panontaniana ny maro ny fahanginan’i Andry Rajoelina amin’izao satria tsy hita ao anaty tabilao mihitsy ny tenany eo amin’ny tontolo politika. Tsy tongatonga ho azy izy io fa misy antony maro. ', '<p>Anisany ny tsindry politika, ny olana eo aminy sy ny fanjakana HVM, ny olana anatiny sy ivelany eo amin&rsquo;ny vondrona MAPAR, ny resa-pianakaviana,&nbsp; ny dosie malotony izay zary lasa fatorana sy managadra ny fahalalahany ka mahatonga azy hangina tsy fidiny. Tratry ny tsindry ara-politika ny tenany, ka tsy matoky tena intsony ary tsy mahatoky ireo manodidina azy. Efa tsy mahara-maso sy tsy ampy serasera amin&rsquo;ireo olony intsony i Andry Rajoelina,&nbsp; ka tsy mahagaga raha maro ireo manodidina azy, eny fa na hatrany amin&rsquo;ny fototra aza no namadika sy novidian&rsquo;ny HVM, ka nampalemy ny vondrona MAPAR.&nbsp; Tsy nahatombina firy teto amin&rsquo;ny firenena koa izy, ary tsy niraharaha ireo olony izay nataon&rsquo;ny HVM fahirano, ka maro ireo namany no tezitra sy namadika. Tsy nisoka-bava na kely monja i Andry Rajoelina tamin&rsquo;ny raharaha Lylison, ny nisamborana sy nanagadrana an&rsquo;i Augustin Andriamananoro, ny raharahan&rsquo;i Alain Ramaroson ... Adinon&rsquo;ny olona ihany koa ny fisiany noho fahanginany. Na te hihetsika sy hiteny aza ankehitriny, dia vao mainka ho tratry ny kiana mivaivay hoe akaiky ny fifidianana. Miezaka ny haka ny fon&rsquo;ny maro kanefa tsy hita tabilao ary tsy mba nifampitakosina sy niara-niaina tamin&rsquo;ny vahoaka Malagasy fa nanava-tena tany ivelany hatramin&rsquo;izay. Manampy trotraka izany ny resa-pianakaviana satria efa hatramin&rsquo;ny andron&rsquo;ny tetezamita i Mialy Rajoelina no tsy narisika firy intsony amin&rsquo;ny hanaovan&rsquo;ny vadiny politika, izay mbola olana tsy maintsy vahany raha mbola te hanao politika indray Rajoelina. Dosie maloto Voalaza aza fa efa nahangom-bola be i Andry Rajoelina amin&rsquo;izao fotoana izao hiatrehana ny fifidianana. Tsy ho afa-bela amin&rsquo;ny resaka heloka ara-ketra, izay efa noketrehin&rsquo;ny fanjakana HVM ny fananganana fitsarana manokana momba izany anefa izy. Tsy misy miafina amin&rsquo;ny mpitondra ankehitriny ny aferany rehetra satria ny filoha Hery Rajaonarimampianana no minisitry ny vola sy ny tetibola nandritra ny tetezamita, izay mahalala amin&rsquo;ny antsipiriany ireo dosie maloto rehetra mikasika ny olon&rsquo;ny tetezamita. Ary farany dia laza ratsy ho an&rsquo;i Andry Rajoelina ny fanonganam-panjakana notarihany tamin&rsquo;ny 2009 ka tsy ahitany mangirana eo amin&rsquo;ny fifandraisana iraisam-pirenena ary na ny haha kandida azy aza dia mety ho zava-tsarotra ihany. &nbsp; &nbsp; Toky R &nbsp;</p>', 1, 1, 1, 'upload/17-05-17-1495026213.jpg'),
(84, 18, 5, 0, '2017-05-17', 'Antenimieram-pirenena Tsimbazaza  Ny fitoniana no ilaina, hoy ireo depiote', 'politika/Antenimieram-pirenena-Tsimbazaza--Ny-fitoniana-no-ilaina-hoy-ireo-depiote-17052017-84', '\r\n\r\n \r\n\r\nNilaza ho tsy mbola nisy nahita “motion de censure” misy miketriketrika izany ireo solombavambahoaka izay nanontaniana teny amin’ny Lapan’i Tsimbazaza, omaly talata 16 mey 2017.', '\r\n\r\n \r\n\r\nNilaza ho tsy mbola nisy nahita “motion de censure” misy miketriketrika izany ireo solombavambahoaka izay nanontaniana teny amin’ny Lapan’i Tsimbazaza, omaly talata 16 mey 2017.', '<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p>&nbsp;</p>\r\n<p><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Toa niara-niombo-peo koa izy ireo tamin&rsquo;ny filazana ny hoe : tsy ny fitoniana ve no ilaina ankehitriny eto amin&rsquo;ny firenena ka inona indray no hitadiavana fanakorontanana amin&rsquo;ny &ldquo;motion de censure&rdquo; ? Rehefa tena halalinina ny valin-teny azo teny Tsimbazaza dia azo antoka fa tsy hahatratra ny fetrisa ilaina hankatoavana azy mihitsy ny &ldquo;motion de censure&rdquo; na dia hitranga eo<span style="mso-spacerun: yes;">&nbsp; </span>aza. Toa manamarina ny tenin&rsquo;ny filohan&rsquo;ity andrimpanjakana ity vao tsy ela akory izay tamin&rsquo;ny filazana fa tsy mbola misy<span style="mso-spacerun: yes;">&nbsp; </span>resaka mikasika azy io tonga eny amin&rsquo;ny birao maharitra. </span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\r\n  DefSemiHidden="true" DefQFormat="false" DefPriority="99"\r\n  LatentStyleCount="267">\r\n  <w:LsdException Locked="false" Priority="0" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Normal"/>\r\n  <w:LsdException Locked="false" Priority="9" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="heading 1"/>\r\n  <w:LsdException Locked="false" Priority="9