so-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">&nbsp;. Hita eny an-toerana hatreto ny voly katsaka mahatratra 6 taonina isaky ny hektara sy ny voanemba 1 taonina isaky ny hektara aorian&rsquo;ny 3 na 6 volana, araka ny fanazavan&rsquo;ireo teknisianina avy amin&rsquo;ity ivontoerana ity. Efa nahitam-bokatra ihany koa volana vitsy lasa izay ny fambolem-bary safiotra na &laquo;riz hybride&raquo; niarahana tamin-dry zareo japoney teny an-toerana. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Tetikasan-dRavalomanana</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Tsy nanampo ireo vokatra hitan&rsquo;ny masony ihany ny filoham-pirenena raha nilaza fa fitaovana tsara azo iadiana amin&rsquo;ny tsy fanjarian-tsakafo mamely mafy ny zaza amam-behivavy eto Madagasikara ny fanapariahana ireo teknika ireo any amin&rsquo;ny faritra. Tsy zava-baovao anefa ny fisian&rsquo;ny &laquo;vitrine de Madagascar&raquo; na fitaratr&rsquo;i Madagasikara tao amin&rsquo;ny Lapam-panjakana Iavoloha izay tetikasa goavana nampiavaka ny filoha teo aloha Ravalomanana Marc. Efa hita tao an-toerana tokoa mantsy 10 taona lasa izay io fampiroboroboana ny lafiny fambolena sy fiompiana io. </span><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Nisongadina indrindra tamin&rsquo;izany ny fiompiana ireo omby vavy be ronono &laquo;holstein&raquo;. Efa niainga mihitsy moa ny fanapariahana azy ity isaky ny faritra saingy nosomparan&rsquo;ny fanonganam-panjakana izany ny taona 2009. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-17-1495026593.jpg');
