&nbsp; Efa afak&rsquo;omaly 15 mey no nahazoany ny fahazoan-dalana mitondra ny laharana 354AJ/17, avy amin&rsquo;ny Tonian&rsquo;ny fampanoavana ambony hanao ny iraka, saingy noraran&rsquo;ny teo anivon&rsquo;ny hopitaly ny fidirany teny an-toerana ka omaly tamin&rsquo;ny 11ora sy 20 mn vao tanteraka. Tsy navela niditra nanamarina ny zava-nisy kosa ny mpanao gazety fa ny avy amin&rsquo;ny mpitsara ihany no nijery an&rsquo;i Claudine Razaimamonjy. Rehefa nivoaka avy tao amin&rsquo;ny efitrano 126 ny filohan&rsquo;ny SMM, dia nilaza fa ao tokoa i Claudine Razaimamonjy. Nosaronana ny tarehiny saingy nitaky ny hanokafana azy ny avy amin&rsquo;ny fampanoavana, araka ny fanambaran&rsquo;i Fanirisoa Ernaivo hatrany. Nanamafy ny filohan&rsquo;ny SMM taorian&rsquo;ny fananamarinana fa mitohy ny asan&rsquo;ny fitsarana. Raha ny hita tamin&rsquo;ny kahie firaiketana ireo mpamangy dia tonga tao an-toerana namangy ny loholona Riana Andriamandavy VII sy ny Ben&rsquo;ny tan&agrave;nan&rsquo;Ambohimahamasina afak&rsquo;omaly hariva. Marihina fa mpandraharaha ny fonja miisa 2 no miambina ny varavarana 126 misy an&rsquo;ity mpandraharaha sady mpanolotsain&rsquo;ny filoha voarohirohy tamin&rsquo;ny kolikoly ity. Mahagaga ihany ny antony tsy namelana ny avy amin&rsquo;ny SMM nitsidika tao, nefa ny hafa navela. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Tsy hahazo fahafahana vonjimaika</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Nametraka fangatahana ny hanomezana fahafahana vonjimaika an&rsquo;i Claudine Razaimamonjy ny mpisolovava azy afak&rsquo;omaly. Nitondra ny heviny ny mpisolovava Willy Razafinjatovo. Nambarany fa eo imason&rsquo;ny lal&agrave;na dia afaka mangataka fahafahana vonjimaika ny olon-drehetra voatazona am-ponja saingy tsy azo homena raha tsy vita ny fakana am-bavany sy fanadihadiana lalina na ny &ldquo;Enqu&ecirc;te au fond&rdquo;, izay tsy mbola nisy. Raha ny lal&agrave;na dia miditra am-ponja 2 na 3 volana vao miditra amin&rsquo;ny fakana am-bavany sy fanadihadiana lalina. Tsy mahazo fahafahana vonjimaika ny olona tsy nanaovana fanadihadiana lalina. Tsy fantatra anefa izay hataon&rsquo;ny fitsarana. Hisy fepetra na fitsarana manokana ve amin&rsquo;ity raharaha ity ? Izaho dia milaza fa ny SMM dia tsy manaiky intsony ny fitanilana amin&rsquo;ny fitsarana, indrindra ny fanaovana tsinontsinona ny sasany fa ny hafa hasoavina, hoy ity mpisolovava ity.<span style="mso-spacerun: yes;">&nbsp; </span>Mahatoky sy midera ary mankasitraka ny ataon&rsquo;ny SMM ny tenako, hoy izy.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">SARY BD Rivo</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-17-1495026731.JPG'),
