'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR; mso-bidi-font-weight: bold;">. Tsy ampy amin&rsquo;ny fanatontosana araka ny tokony ho izy ny rafitra LMD intsony, raha ny fiheveran&rsquo;ireto mpianatra ireto azy ny fampitaovana 66 000 ariary izay efa niainana hatramin&rsquo;ny rafitra teo aloha. Nitaky ny hampiakarana 100% izany sy ny hahazoana maimaimpoana ny teknolojia ankehitriny (connexion gratuit), araka izany, ireto mpianatra ireto. Nandeha ny horakoraka sy ny tora-bato ary tsy nirava ny hetsika raha tsy efa tany amin&rsquo;ny 1 ora sasany tolakandro tany ho any rehefa naparitaky ny etona mandatsa-dranomaso indray. Nisy moa io omaly io ny fifampiresahan&rsquo;ireo solontenan&rsquo;ny mpianatra sy ny minisitry ny fampianarana ambony, Monique Rasoazananera, ary miankina amin&rsquo;izay ny ho mety ho tohin&rsquo;ny hetsik&rsquo;ireto mpianatra ireto, raha ny fanazavana.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-outline-level: 2;"><strong><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Mirija</span></strong></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal; mso-outline-level: 2;"><strong><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Sary: Rakotobe Michel</span></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>', 0, 1, 0, 'upload/17-05-17-1495026810.JPG');
