font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">. Raha tsiahivina, nisy halatra omby tao amin\'ny fokontany ambatomainty-Tsaravavaka, kaominina Andranomanelatra ny taona 2015. Nanao ny fanarahan-dia ny fokonolona ka tratra tao Ambano ny dian\'ny omby sy ny hodiny ary ny lohan\'ny omby. Voarohirohy<span style="mso-spacerun: yes;">&nbsp; </span>ny mpivarokena sy mpanao hotely ary olona hafa maromaro ka nosamborin\'ny mpitandro ny filaminana teo anivon\'ny zandary tamin\'izany fotoana. Notanana am-ponja vonjimaika ny olona 6 raha toa ka nafahana noho ny fisalasalana ny olona roa hafa. Tsy araky ny tompon\'omby intsony ny tohin\'ny raharaha taorian\'izay. Ny faran\'ny herinandro teo dia nampanatsoin\'ny zandary ny tompon\'omby very ka nomeny taratasy kely sy toy ny adiresy kely ka nasaina nanatona ny fitsarana Antsirabe ny datin\'ny 16 mey. Akory ny hagagan\'ilay tompon\'omby rehefa nanontany ny tompon\'andraiktra tao amin\'ny fitsarana fa hay fitsarana ity niantsoana azy. Tsy afa-nihemotra intsony ny tenany fa niatrika izay zava-nitranga teo. Loza fa nafahan\'ny fitsarana madiodio avokoa ireo olona rehetra tratra tamin\'ilay halatra omby. Tampina tanteraka ny daominy ka niantso ny fianakaviany avy hatrany nandinika izay hatao. Nitady fanazavana tamin\'ny mpitsara moa izy ireo saingy ny valin-teny azony dia hoe: "manana 3 andro hanaovana fanohanana ianareo raha tsy afa-po amin\'ny didy nivoaka". Very hevitra tanteraka ny mponina any ambanivohitra ka mety izay ny mampirongatra ilay fitsaram-bahoaka.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Caius R&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-17-1495026915.jpg'),
