dden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mankalaza ny faha-25 taona niakarany an-tsehatra i Njakatiana. Fampisehoana goavam-be hotanterahina eny amin&rsquo;ny Coliseum Antsonjombe <span style="mso-spacerun: yes;">&nbsp;</span>no hanamarihany izany ny alahady 21 mey ho avy izao manomboka amin&rsquo;ny 10 ora maraina hanasany ireo olon-drehetra efa nampiara-peo taminy hatramin&rsquo;izay. Hampiavaka ny fampisehoana raha araka ny fanazavan&rsquo;i Njakatiana tamin&rsquo;ny mpanao gazety omaly ny hivetsoany ireo hira rehetra nanamarika azy tao anatin&rsquo;izay 25 taona izay entina hanomezana fahafaham-po ny mpanjifa. Toraka izany koa <span style="mso-spacerun: yes;">&nbsp;</span>ireo hira navoakany faramparany hotronin&rsquo;ny fizarana maimaim-poana rakikira ara-pilazantsara <span style="mso-spacerun: yes;">&nbsp;</span>sangan&rsquo;asany navoakany hanampiana ny mpiara-belona sy hanomezam-boninahitra an&rsquo;Andriamanitra. Mpanohana ofisialy ny hetsika ny Airtel Madagascar. Anisan&rsquo;ny tanjon&rsquo;izy ireo mantsy ny hampiakatra ny mpanakanto Malagasy fanta-daza toa an&rsquo;i Njakatiana, indrindra ny fanomezany vahana ny hira Malagasy, ravahan&rsquo;ireo karazana gadona maro samihafa. Ho avy hanotrona an&rsquo;i Njakatiana mandritra izany Mr Sayda, Christian kely, Sarobidy, Meizah ary Ariane.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Legende : Nandritra ny famerenana notanterahin&rsquo;i Njakatiana omaly tetsy Andavamamba </span></em></p>', 0, 1, 0, 'upload/17-05-17-1495028248.jpg'),
