nUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Saika tonga nidodododo nitondra ny anjara birikiny avokoa mantsy ny ankamaroan&rsquo;ireo mpanao gazety rehetra,<span style="mso-spacerun: yes;">&nbsp; </span>notronin-dramatoa Lalatiana Ravololomanana mpanolotsaina eo anivon&rsquo;ny kaominina Antananarivo Renivohitra,<span style="mso-spacerun: yes;">&nbsp; </span>Fano Rakotondrazaka avy eo anivon&rsquo;ny vaomieram-pirenena misahana ny fifidianana, ny solontenan&rsquo;ireo sendika, ny minisitry ny fanabeazam-pirenena <span style="mso-spacerun: yes;">&nbsp;</span>Paul Rabary ary i <span style="mso-spacerun: yes;">&nbsp;</span>Harry Laurent Rahajason minisitry ny serasera izay namarana ny fitsidihan&rsquo;ireo olobe omaly hariva. Nankasitraka feno ireo tonga namaly ny antson&rsquo;izy ireo Rtoa <span style="mso-spacerun: yes;">&nbsp;</span>Ratovonjanahary Fanja, vady andefimandrin&rsquo;ny namana mpanao gazety Andry Ratovo. Ny tanjon&rsquo;izy ireo moa, raha araka ny fanazavany, dia handefa ity farany ho any Inde mba hanaovana ilay &ldquo;transplantation&rdquo; saingy miankina amin&rsquo;ny vola eo am-pelatanana ihany no hahafahana manatanteraka izany. Hatreto dia efa nitentina 100 tapitrisa Ar ny vola lanin&rsquo;ireo vady aman-janany sy ny fianakaviany nitsaboana ny namana mpanao gazety Andry Ratovo. Tsy manan-koraisina hitsaboana azy intsony izy ireo ankehitriny, antony nanaovana ilay tolo-tanana sy hanomanana io dia ho any Inde io. Ao an-trano kosa <span style="mso-spacerun: yes;">&nbsp;</span>i Andry Ratovo ankehitriny no tsaboina. Dokotera ao anatin&rsquo;ny fianakaviana ihany koa no mitsabo azy ka ny resaka torimaso no mbola tena olany hatreto miampy ny aretim-bavony&hellip; Aretin&rsquo;ny voa any amin&rsquo;ny dingana farany raha tsiahivina no mahazo azy. Ho an&rsquo;ireo tsy nahatratra ny fotoana omaly dia azo atao ny mandefa vola<span style="mso-spacerun: yes;">&nbsp; </span>amin&rsquo;ireto laharan-tariby manaraka ireto dia ny<span style="mso-spacerun: yes;">&nbsp; </span>033 85&nbsp;368 78 sy ny 034 31&nbsp;005 63.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati </span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">L&eacute;gende : Ny solotenan&rsquo;ireo sendika nanolo-tanana nanohina ny antso teny amin&rsquo;ny Tahala Rarihasina (Sary Rakotobe Michel)</span></em></p>', 0, 1, 0, 'upload/17-05-17-1495028381.jpg');
