ion d&rsquo;emp&ecirc;chement&rdquo; dia nipotsaka tampoka ravola e ! Nomena 4 x 4 raitra, ohatra, ireo depiote mpisolelaka sy mpanohana ny fitondrana vitsivitsy ary nitondra izany niditra tao amin&rsquo;ny parking ao Tsimbazaza. Ny loharanom-baovao avy eny amin&rsquo;ny lapan&rsquo;ny amin&rsquo;ny lapan&rsquo;ny antenimieram-pirenena no nahafantarana fa miisa 16 ireo depiote nahazo fiara 4X4 ireo ka anisan&rsquo;izany ohatra ny depiote iray avy ao amin&rsquo;ny Boriborintany faha-6 Antananarivo renivohitra, ny depiote iray avy any Manakara, ny depiote avy any Betroka, ny depiote avy any Beroroha, ny depiote avy ny Miarinarivo sy ny depiote iray avy eny Avaradrano. <span style="mso-spacerun: yes;">&nbsp;</span>Mody nolazaina fa alaina ary atao &ldquo;traite&rdquo;, izany hoe aloa tsikelikely ireo fiara ireo nefa azo antoka fa fanambatambazana fotsiny tsotra izao. Asa indray moa izay fialana bala na farovan-tena hataon&rsquo;ireto depiote mpisolelaka ireto fa efa manomboka mazava aloha ny resaka izao. Mandeha tsimoramora ny fanambatambazana sy ny tolotolotra, avy eo misosa fotsiny ny volavolan-dal&agrave;na atolotry ny governemanta holaniana eny amin&rsquo;ny antenimiera. Tsy antenimiera intsony kosa izany fa an-teni-midina e !</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Rabri</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 1, 1, 0, 'upload/17-05-18-1495111030.jpg'),
