riority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Anisan&rsquo;ny fitakiana ihany koa ny tambajotra &ldquo;internet&rdquo;. Nafana fa tsy toy ny 2 andro teo alohany ny fitokonana omaly. Toy ny fanaon&rsquo;ireo mpianatra dia misy foana ny fitorahana sy fihantsiana mpitandro ny filaminana. Namaly tamin&rsquo;ny tifitra baomba mandatsa-dranomaso ny an-kilany rehefa tena nafana ny raharaha. Vokany, mpitandro ny filaminana iray no voa teo amin&rsquo;ny fihirifany, ka naratra ary voatery nentina namonjy toeram-pitsaboana haingana. Nitohy hatrany ny fifandonana. Raikitra ny tifitra baomba mandatsa-dranomaso. </span></span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Nisy ireo mpianatra am-polony tsy maintsy nosavaina kanefa tsy nisy ny fisamborana na fihazonana vonjimaika hoy ny avy any amin&rsquo;ny mpitandro filaminana.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Vahaolana fohy ezaka</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Tetsy an-kilany, nisy ihany koa ny fivoriana nataon&rsquo;ny solontenan&rsquo;ny mpianatra sy ny avy eo anivon&rsquo;ny Oniversite ary ny minisiteran&rsquo;ny fampianarana ambony natao teny fiadanana omaly maraina. Nivoitra nandritra ny fifampidinihana fa vahaolana fohy ezaka aloha no tratra, ka ny resaka &ldquo;connexion internet&rdquo; no hovahana haingana. Noresahina ihany koa ny momba saram-pisoratana anarana izay somary lafo, ka antony mahatonga izany ny tsy fahampian&rsquo;ny tetibola ho fampihodinana ny oniversite. Raha ny fanambaran&rsquo;ny mpitarika fikambanana pedagojika tamin&rsquo;ny alalan&rsquo;I Vahatriniaina Andriamanantena, mpianatry ny Haisoratra taorian&rsquo;ny fivoriana dia mitsahatra hatreo ny gravy. Maro anefa ireo mpianatra no miahiahy azy ireo ho mamono afo sy efa nahazo vola matoa tsy tanteraka akory ny fitakiana dia terena hajanona. Misy amin&rsquo;ireo mpitarika fikambanana no tsy miady akory ho an&rsquo;ny tombotsoan&rsquo;ny mpianatra, hoy hatrany ireo nanaovana fanadihadiana. Maro no milaza tsy faly manoloana izany, ka ho hita eo hanaiky hanatsahatra ny fitokonana ny maro an&rsquo;isa na hanara-dia ireo filohana fikambanana.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">L&eacute;gende:Niditra ny faritry ny oniversite ny Emmoreg (Rakotobe)</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-18-1495111125.JPG');
