quo;izay tsindry avy amin&rsquo;ny mpitsara izay noho ny antony tsy fantatra. Miely kosa ny resaka sy ny vaovao fa misy amin&rsquo;ireo mpitsara no tratry ny vela-pandrik&rsquo;io mpandraharaha io sy ny manodidina azy tamin&rsquo;ny alalan&rsquo;ny fandraviravizana volabe ka roboka ary izay no mampitarazoka ny raharaha. Efa niaraha-naheno ny fanambaran&rsquo;ny minisitry ny fitsarana, izay nitaky ny hamoahana an&rsquo;i Claudine Razaimamonjy ny 5 aprily, fony mbola notazonina teny amin&rsquo;ny Bianco izy, izay niharihary ny endrika fitongilanana sy fiarovana azy. Mbola misy olobe hafa ao amin&rsquo;ny fitsarana ihany koa voalaza fa efa nifanaraka amin&rsquo;ny hampanginana ny raharaha fa sinema fotsiny sisa no atao. Na ireo mpitarika sendika marobe niseho tampoka tamin&rsquo;ity raharaha ity aza dia voalaza fa efa novidiana vola ny ankamaroany ka nangina.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Lalaovina ny raharaha</span></em></strong></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Hery lehibe eto amin&rsquo;ny firenena ny fitsarana ary atahoran&rsquo;ny fanjakana ny tanjany. Raha tena mihenjana ity rafitra ity ary manaporofo ny maha mahaleotena marina azy dia efa ela no teny Antanimora Razaimamonjy Claudine, hoy ny mpanara-baovao. Matoa manjavozavo ny resaka ary tsy misy fanapahan-kevitra hentitra hampiharana ilay didy fampidirana am-ponja vonjimaika (MD), dia misy zavatra tsy mazava ao, ary mety efa misy vondron-kery matanjaka ao anatin&rsquo;ny fitsarana manao tsindry amin&rsquo;ny hampanginana ny raharaha.<span style="mso-spacerun: yes;">&nbsp; </span>Azo atao tsara ny manao &ldquo;contre visite&rdquo; momba ny resaka toe-pahasalaman&rsquo;ity ramatoa ity ary ny dokoteran&rsquo;ny fonjan&rsquo; Antanimora no manao azy io amin&rsquo;ny maha olona tokony hotanana am-ponja azy, saingy tsy izay no miseho. Ny teo anivon&rsquo;ny mpandraharahan&rsquo;ny fonja tamin&rsquo;ny alalan&rsquo;ny filohan&rsquo;ny sendikan&rsquo;izy ireo, </span></span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">C&eacute;sar Diderot Realy, dia efa nilaza ny 14 aprily fa ireo olona ampidirina am-ponja vonjimaika na marary na salama tsara dia tsy maintsy mandalo amin\'ny tompon&rsquo;andraikitra voalohan\'ny fonja mialoha ny hamoahana azy. Ny dokoteran\'ny fonja ihany no afaka manamarina ny toe-pahasalaman\'ny olona tazonina. Tsy nisy anefa izany fa nodinganina, izay endrika fandikan-dal&agrave;na hafa mihitsy saingy toa tsy afa-manoatra amin&rsquo;ny fampiharana lal&agrave;na.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-18-1495111264.jpg'),
