zon&rsquo;olombelona eto Madagasikara io. Voatanisa ao ny fahalemena na tsy fandraisana andraikitry ny governemanta amin&rsquo;ny fampanjakana ny tany tan-dal&agrave;na manoloana ireo fanaparam-pahefana miseho amin&rsquo;ny endrika samihafa. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Kolikoly sy tsimatimanota</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Mijanona ho olana hatreto ny fomba fiasan&rsquo;ny mpitondra fanjakana mahefa momba ireo tranga mampalahelo manohintohina ny zon&rsquo;olombelona eto Madagasikara, hoy ny departemantam-panjakana amerikanina. Tsy mandray andraikitra feno amin&rsquo;ny fanenjehana na fanasaziana ireo tompon&rsquo;andraikitra manao fanamparam-pahefana mantsy ny governemanta, hoy ny tatitra. Sary efa fahita hatrizay ny fahasahiranana mianjady amin&rsquo;ireo mpifonja, ny fitsarana tsy mahaleotena, ny fanavakavahana eo anivon&rsquo;ny fiarahamonina, ny herisetra amin&rsquo;ny vehivavy na koa ny fanolanan-jaza. Zava-baovao nanamarika ny enim-bolana faran&rsquo;ny taona 2016 kosa ny firongatry ny fitsaram-bahoaka noho ny tsy fahatokisan&rsquo;ny mponina ireo mpitandro ny filaminana sy ny fitsarana intsony, araka ny fanamarihana ao anatin&rsquo;ny antontan-kevitra. Tsy mitsitsy fitenenana ary tena masiaka mihitsy moa ny departemantam-panjakana amerikanina milaza fa mahazo vahana ny kolikoly sy ny tsimatimanota ao anatin&rsquo;izao fitondrana Rajaonarimampianina izao. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: EN-US; mso-fareast-language: FR;">SARY BD Rivo</span></em></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Nangonin-dRamano F. </span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-18-1495111373.jpg');
