mandatsa-dranomaso isak&rsquo;izay mihetsika. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Ny taona 2009 no nanomboka lasa 66 000 ariary ny fampitaovana noraisin&rsquo;ireo mpianatry ny oniversite isam-bolana. Efa nitaraina ireo mpianatra hoe tsy ampy io fa voatery midi-trosa foana ny ankamaroan&rsquo;izy ireo, indrindra ny avy any amin&rsquo;ny faritra. Amin&rsquo;izao fotoana izao, nidirana ilay rafitra LMD izay mitaky fampitaovana teknolojika maromaro kanefa dia ny teo ihany no teo hatreto. Toy ny teren-ko masaka tahaka ny raharaha rehetra nanomboka tany amin&rsquo;ny sata mifehy ny fifandraisana sy fanerena any an-tsain&rsquo;ny olona fa ara-dal&agrave;na ny fandehan&rsquo;ny raharaha Razaimamonjy koa amin&rsquo;izao fotoana ny fiainan&rsquo;ireo mpianatry ny oniversite izay tsy hay intsony na mbola heverina ho avin&rsquo;ny firenena na tsia.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp;</span></span></p>', 0, 1, 0, 'upload/17-05-18-1495111441.jpg'),
