a eeee ! Fa ny any ambony sa ny any ambany ny anareo no misaina e ? Raha vorodamba ny vavako efa tataka ary averiko foana satria tsy avelan&rsquo;ny feon&rsquo;ny fieritreretana tsy hampita hafatra sy hitarika anareo ho tonga saina aho. Tsy mitovy marina angamba ny antsika ny toerana misy ny fo sy ny saina. Milamina izany izao ry Jean ny sainareo nanagadra mpampianatra sy artista tamin&rsquo;ny heloka tsy mankaiza, fa mamela malalaka ny maintimolalin&rsquo;ny afera hiaina finaritra ?</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-18-1495111588.jpg');
