erif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;tompon&rsquo;andraikitra voalohany eo anivon&rsquo;ny Katraka hikarakara fampisehoana goavana hanehoany ilay teknika Katraka vaovao. Ny 24 mey ho avy izao no hanatanterahany io fampisehoana io etsy amin&rsquo;ny kianjan&rsquo;ny Kanto Mahamasina<span style="mso-spacerun: yes;">&nbsp; </span>manomboka amin&rsquo;ny 2 ora folakandro. Ankizy manodidina ny 60 isa no hiaka-tsehatra hiaraka amin&rsquo;ny mpanakanto hikalo ireo karazan-desona navadika ho hira manintona sy manaitra ka tafiditra ao avokoa ireo taranja miisa fito hianarana any an-tsekoly. Tanjona ny hahafahana manafaingana ny fandraisan&rsquo;ny mpianatra ny lesona, hoy Rafalimanana Haja, izay tsy voatery hifantohana be eo ambony kahie intsony. Hoelanelanina fanazarana izany. Nomarihiny<span style="mso-spacerun: yes;">&nbsp; </span>manokana fa ankoatra ny mpianatra dia tokony hanatrika koa ny ray aman-dreny hahafahana mamaly haingana ireo fanontaniana manitikitika ny ankizy any<span style="mso-spacerun: yes;">&nbsp; </span>am-pianarana.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-18-1495112120.JPG'),
