rity="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">. Mitentina 19 miliara Ariary isan-kariva izy io. Tsy ny mpitatitra vola mahazatra no mitondra azy fa fiara hafa mihitsy. Mpamosavy mandeha amin&rsquo;ny alina aza, hono, misy mahita mainka fa vola matevim-be tahaka izany mivoaka an-tan&agrave;n-dehibe. Tsy fantatra kosa na efa firy andro no nisian&rsquo;io famoahana vola hafahafa io. Ny somary manaitra dia hoe alefa any Sambava (faritra SAVA) amin&rsquo;ny alalana fiaramanidina manokana mihitsy io vola be mivoaka avy etsy Antaninarenina io. Efa misy ny fiara manokana mpitatitra ny volan&rsquo;ny Banky foiben&rsquo;i Madagasikara ary efa fantatry ny maro eto Antananarivo satria fiara lehibe hita hoe mifono vy ary arahana minibus 3 na 4 misy polisy sy zandary misaron-tava ary mirongo fitaovam-piadiana. Tazana matetika izy io avy any Ivato, mandeha ny route Digue, mandalo ny Fasan&rsquo;ny Karana, Ankadimbahoaka, Soanierana, Anosy, Antsahamanitra ary tonga eo amin&rsquo;ny Banky Foibe Antaninarenina avy eo. Fa mampanontany tena kosa hoe inona ity resaka 19 miliara ariary avoaka isan-kariva entina fiara hafa ity ? Baiko ofisialy ve ny namoahana azy ? Raha eny, atao inona ary nahoana ny hoe alefa any Sambava ? Betsaka moa ny zavatra hafahafa tahaka izao mitranga eto amintsika ka mahatonga ny mpiara-miombon&rsquo;antoka sy ny mpamatsy vola mitaky ny hoe mangarahara amin&rsquo;ny fitantanana ny raharaham-panjakana sy ny fanamafisana ny ady amin&rsquo;ny kolikoly. Tena malaina manome vola be ireo mpiara-miasa toy ny vondrona eoropeanina satria mety efa mahafantatra zavatra maro izy ireo. Ankoatra izay, tao anatin&rsquo;ny dia ataon&rsquo;ny filoham-pirenena tany Sambava omaly no nivoaka io vaovao io. Fifanandrifian-javatra fotsiny ihany ve sa inona marina ? Toerana malaza amin&rsquo;ny famokarana lavanila moa ny faritra SAVA, indrindra fa i Sambava sy Antalaha ka asa na mety misy ifandraisany amin&rsquo;izay ny andefasana vola be any an-toerana. Ho hita eo ny mety ho tohin&rsquo;ity resaka famoaham-bola hafahafa ao amin&rsquo;ny Banky foiben&rsquo;i Madagasikara ity.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Rabri</span></p>', 1, 1, 0, 'upload/17-05-19-1495197636.JPG');
