language: EN-US;">&nbsp;Tsy mbola misy hatramin&rsquo;izao mpibaiko ambony voasambotra fa toa ny mpandraharaha Claudine Razaimamonjy izay toy ny mpanatanteraka ihany no fihinina ao amin&rsquo;ny hopitaly ao. Tsy manaiky koa izahay, hoy ny mpandrindra nasionalin&rsquo;ity vovonana ity, Tolojanahary Maharavo (Doudou) raha tsy farafaharatsiny atao mialokaloka ao amin&rsquo;ny hopitaly Andravoahangy Andrianavalona koa ny minisitry ny atitany. Ny minisiteran&rsquo;ny atitany no mitahiry ireo tena atidoha amin&rsquo;ny kolikoly avo lenta eto satria ao daholo ireo atidoha mikotrika izany sy ireo mpanampy azy, ny mpitantana ny hetsika rehetra (GAC) ary ireo tomponandraikitry ny tsenam-panjakana (PRMP), hoy izy.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Legend: Ry zareo ao anaty DFP</span></strong></p>', 0, 1, 0, 'upload/17-05-19-1495197705.jpg'),
