in-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US;">&nbsp;Ny hita aloha dia fatra-piaro ny tsy ara-dal&agrave;na sy ny tsimatimanota ny fanjakana, ary mitongilana any amin&rsquo;ny olony, kanefa miezaka ny tsy te haloto ihany koa. Efa hitam-poko hitam-pirenena ny hevi-dravina sy ny kajy maloto, hany ka mivadibadi-dela isak&rsquo;izay miteny, ary dia voafatotry ny teny nambara matetika. Nilaza tamin&rsquo;ny alalan&rsquo;ny minisiteran&rsquo;ny serasera sy ny fifandraisana amin&rsquo;ny andrim-panjakana ny mpitondra fa tsy raharaham-panjakana io fa toy ny raharaham-pitsarana rehetra. Inona no mampiaka-pofona ny praiminisitra Mahafaly Olivier, ka hitsabatsabahana amin&rsquo;ny raharaha sy hanaovany fanambarana ofisialy ary hampihorohoroana ny mpitsara manao ny asany amin&rsquo;ny maha raharaham-pitsarana azy io ? Inona no hanaovana ramatahora sy<span style="mso-spacerun: yes;">&nbsp; </span>hanasoketana olona ho manao asa fanakorontanana, ka ambara fa hohenjehina amin&rsquo;ny fitsarana ? Tsy mipitika any akory ny afo dia efa mikorapaka. Raha mahatsapa tena ho olo-marina ny praiminisitra sy ny namany ary i Claudine Razaimamonjy dia mamela ny fitsarana hanao ny asany, fa tsy hitsabaka sy manao tsindry isan-karazany tahaka izao.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-19-1495197987.jpg');
