aina manoloana ny zava-misy sy ireo habibiana toy ny tany Antsakabary sy Antsirabe ary Antsohihy ireny, hoy ireo Eveka, fa fiovam-penitra mahery vaika mihitsy. Difotry ny lainga sy fitaka ny fiainam-bahoaka ka tsy re intsony ny feon&rsquo;ny olo-marina. Zary manompo vola koa hatrany amin&rsquo;ny faratampony. Nanome hafatra ho an&rsquo;ireo mpitondra fivavahana namany ity filankevitra ity, mba hibebaka ho an&rsquo;ny firenena. Manahy kosa ny amin&rsquo;ny fisian&rsquo;ny famonoana an-kolaka (genocide silencieux) eny anivon&rsquo;ireo tobim-pitsaboana isan-karazany ny Malagasy izy ireo ka mangataka ireo mpitsabo mba hiaina ny fianianany.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong></p>', 0, 1, 0, 'upload/17-05-19-1495198077.jpg'),
