zavana firy hiarovan-tena mihitsy fa toa vao mainka aza hadalana foana no saika asehonareo isan&rsquo;andro ? Sao dia mba ireto havanay be dia be tena marary ato amin&rsquo;ny hopitaly ireto ary no ho lasibatra tsy fidiny amin&rsquo;ity kilalaon&rsquo;olon-dehibe ataonareo ity !</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco </span></strong></p>', 0, 1, 0, 'upload/17-05-19-1495198124.jpg');
