 New Roman\',\'serif\'; mso-ansi-language: EN-US;">. Anisan&rsquo;ireny i Volana, renim-pianakaviana manan-janaka roa. Efa tamin&rsquo;ny taona 2011 izy, raha araka ny fanazavany tamin&rsquo;ny mpanao gazety, omaly, no lasibatr&rsquo;ity aretina iray ity. Ny taona 2013 izy no nanomboka nanao dialyse ka 500.000 Ar isa-kerinandro no laniny. Ankehitriny efa tena mihareraka izy, antony tsy maintsy hirosoan&rsquo;ny fianakaviana <span style="mso-spacerun: yes;">&nbsp;</span>amin&rsquo;ilay fanaovana transplantation azy any Inde. Efa misy ny fianakaviana nanolo-tena ny hanome voa iray ho azy hanoloana ilay simba saingy ny vola sisa no andrasana. 175 tapitrisa Ar no vola ilaina amin&rsquo;izany, antony hikarakaran&rsquo;izy ireo sy ny Association de Soladarit&eacute; Volana (AVS) <span style="mso-spacerun: yes;">&nbsp;</span>ilay fampisehoana goavana iarahana amin&rsquo;ny Singers of Jesus ny alahady 21 mey ho avy izao etsy amin&rsquo;ny Dome RTA. Hanomboka amin&rsquo;ny 3 ora folakandro ny lanonana. 10.000 Ar ny fidirana tsotra ary 15.000 Ar kosa ny famandrihan-toerana. Miankina betsaka amin&rsquo;ny vola azo avy amin&rsquo;io fampisehoana io ny hahafahan&rsquo;ity renim-pianakaviana ity hihazo an&rsquo;i Inde na tsia. Azo hatao ihany koa ny mandefa fanampiana amin&rsquo;ireto laharan-tariby ireto ho an&rsquo;ireo tsy tratra antso monina any amin&rsquo;ny faritra dia ny 033 11389 26, ny 034 11&nbsp;389 26 ary ny 032 52&nbsp;155 46.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-19-1495198300.JPG'),
