henUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mpanohana ofisialy izany ny banky BNI Madagasikara izay manana tanjona hampandroso hatrany ny lafiny ara-toekarena eto amintsika. Ao amin&rsquo;ny tranoheva laharana 90 B no misy azy. Ankoatra ny fampahafantaran&rsquo;izy ireo ny vokatra misy ao aminy <span style="mso-spacerun: yes;">&nbsp;</span>dia miezaka manome fahafaham-po ny mpanjifa amin&rsquo;ny alalan&rsquo;ny &ldquo;tombola&rdquo; <span style="mso-spacerun: yes;">&nbsp;</span>ihany koa izy ireo izay mety hahazoana solosaina, tablette ary smartphone ho an&rsquo;ireo tonga mitsidika ny tranohevany. Ny alahady hariva ho avy izao <span style="mso-spacerun: yes;">&nbsp;</span>no hatao ny fisarihana. Marihina moa fa miavaka amin&rsquo;ireo tolotra omen&rsquo;ity banky ity mandritra ny foara ny tolotra Credit Vina, tetikasan&rsquo;olon-tsotra izay hahazoana ilay tolotra hahafahana mijery ny kaontim-bola maimaimpoana ao anatin&rsquo;ny tranonkalan&rsquo;ny banky. Nitombo hatrany amin&rsquo;ny 22 % moa raha tsiahivina ny tahan&rsquo;ireo olona nindram-bola tamin&rsquo;ny banky BNI tamin&rsquo;ny taona 2016 lasa teo.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Legende : Nandritra ny fanokafana ny<span style="mso-spacerun: yes;">&nbsp; </span>foara iraisam-pirenena omaly teny Tanjombato </span></em></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-19-1495198396.png');
