misy hevitra intsony ny amin&rsquo;ny fanjakana HVM, ka mitady izay hametrahana ny tongony ireo olona akaiky ny filoha ankehitriny noho ny fahatsapana fa tsy hantenaina amin&rsquo;ny fifidianana filoham-pirenena ho avy intsony i Hery Rajaonarimampianina sy ny HVM manontolo. Betsaka loatra ireo zavatra tsy voafehin&rsquo;ny filoha ankehitriny satria na ireo olona manodidina azy aza tsy voafehiny ary misy mihitsy no manipy hoditr&rsquo;akondro ka tsy mahita izay horaisina ny tenany.Mifanesisesy ny fandroahana ireo mpanolotsain&rsquo;ny filoha ao an-dapa ao, ny resaka fifaminganana amin&rsquo;izany efa lasa fanampin-tsakafo isan&rsquo;andro araka ny feo re avy ao anaty lapa ao.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Efa mitady lalana</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Anisan&rsquo;ny resaka efa mahoraka any anaty etamazaoro politika maro ny tato ho ato izay ny hoe&nbsp;:efa samy manana ny kajiny ireo lohandohan&rsquo;ny mpisorona ao anatin&rsquo;ny fitondrana HVM satria mahatsapa fa tsy tafavoaka intsony ny kandida Hery Rajaonarimampianina amin&rsquo;ny 2018.Misy ireo hiara-dalana amina kandida hafa, misy mihitsy ireo ho kandida, fa ao koa anefa ireo tsy mieritreritra afa-tsy ny hangoron-karena sy hametraka ireo olony any anaty rafitra ka na iza na iza mitondra eo dia efa milamina foana ny resaka.Mampatsiahy ny zava-nisy tamin&rsquo;ny repoblika faha-3 tapany voalohany ny mitranga ankehitriny ka maro no manahy fa hiongam-potsiny noho ny sangodim-panina politika nyfiloha Rajaonarimampianina, tahaka ny nanjo ny Pr Zafy Albert tratran&rsquo;ny &laquo;&nbsp;emp&ecirc;chement&nbsp;&raquo; teny amin&rsquo;ny antenimirampirenena rehefa niady tamin&rsquo;ny praiminisitra Francisque Ravony tamin&rsquo;izany andro izany.Efa tena misy amin&rsquo;izao fotoana ireo olona sokajiana ho akaikin&rsquo;ny Hery Rajaonarimampianina ary goavana ao anatin&rsquo;ny HVM no vonona hanohana kandida hafa raha toa ka vaky ny sambo HVM ka anisan&rsquo;ireo mety isisihan&rsquo;izy ireo ny TIM sy ny MAPAR sy ny kandida iray heverina fa olom-baovao..re misy koa ny olon&rsquo;ny HVM efa mifandray tendro amin&rsquo;ny MMM an&rsquo;i Hajo Andrianainarivelo.Ho hita miandalana eo moa ny ho tohiny fa ny azo antoka amin&rsquo;izao fotoana aloha dia mihena ny lanja politikan&rsquo;i Hery Rajaonarimampianina satria manomboka miala tsimoramora aminy ny ekipa niaraka taminy nanomboka tamin&rsquo;ny 2013.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>', 1, 1, 0, 'upload/17-05-22-1495443090.jpg'),
(109, 21, 5, 0, '2017-05-20', 'Adin’ny SMM sy ny governemanta  Nandamin-dresaka ny praiminisitra', 'politika/Adinny-SMM-sy-ny-governemanta--Nandamin-dresaka-ny-praiminisitra-20052017-109', 'Niteraka tsy fifankahazoana lalina teo amin’ny fitsarana sy ny governemanta ny fanambarana nataon’ny praiminisitra, izay voalaza fa mihantsy sy mamaky ady tamin’ny mpitsara tamin’ny resaka hoe hanenjehana ara-pitsarana ny filohan’ny', 'Niteraka tsy fifankahazoana lalina teo amin’ny fitsarana sy ny governemanta ny fanambarana nataon’ny praiminisitra, izay voalaza fa mihantsy sy mamaky ady tamin’ny mpitsara tamin’ny resaka hoe hanenjehana ara-pitsarana ny filohan’ny', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/