nsi-language: EN-US;">&nbsp;Sendikan&rsquo;ny Mpitsara eto Madagasikara (SMM) Faniry Ernaivo noho ny resaka fanararaotam-pahefana nandritra ny fitsidihana tampoka nataon&rsquo;ity tompon&rsquo;andraikitra ity. Tsiahivina fa namaly bontana izany ny SMM ary nandefa fanambarana manameloka ny fitsabatsahan&rsquo;ny Governemanta amin&rsquo;ny fitsarana ary mitaky ny hamelana azy ireo halalaka amin&rsquo;ny asany. Tsy<span style="mso-spacerun: yes;">&nbsp; </span>niresaka ny fitsarana manokana ny tenako fa ny resaka lavanila no tena nohamafisina fa tsy handefitra ny fanjakana amin&rsquo;ireo tompon&rsquo;andraiki-panjakana tafiditra ao anatin&rsquo;ny raharaha halatra lavanila, izay miteraka korontana sy fitsaram-bahoaka, hoy ny praiminisitra omaly. Tsy misy hifandraisany amin&rsquo;ny raharaha Claudine ihany koa ny zavatra noteneniko ary haveriko foana fa havela hanao ny asany ny fitsarana, hoy izy. Nilaza anefa izy fa tokony hanaja ny lal&agrave;na fa tsy hampihatra ny lal&agrave;na amin&rsquo;izay maha mety ny tsirairay. Nambarany fa tsy midika ho famakiana ady amin&rsquo;ny Sendikan&rsquo;ny Mpitsara (SMM) ny fanambarana nataony nandritra ny filankevitry ny governemanta. Nohamafisina tamin&rsquo;ny alalan&rsquo;ny fampitam-baovao ofisialy, izay nosoniavin&rsquo;ny minisitry ny serasera sy ny fifandraisana amin&rsquo;ny andrim-panjakana mihitsy izao.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R </span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%