-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;Tena ilain&rsquo;ny parlemantera ny fahaiza-manao amin&rsquo;ny famolavolana lal&agrave;na. Tompon&rsquo;antoka lehibe indrindra eo anivon&rsquo;ny Antenimiera kosa ireo mpikambana ao amin&rsquo;ny vaomiera momba ny lal&agrave;na. Anjaran&rsquo;ity farany amin&rsquo;ny ankapobeny ny mikirakira ny volavolan-kevitra havadika ho volavolan-dal&agrave;na haroso hankatoavin&rsquo;ny fivoriamben&rsquo;ireo olom-boafidy mpanao lal&agrave;na eny Tsimbazaza na Anosikely. Tsapa ho matoky io asa goavana fikirakirana volavolan-dal&agrave;na iandraiketan&rsquo;ny kaomisionin&rsquo;ny lal&agrave;na io ireo solombavambahoakan&rsquo;i Madagasikara tao anatin&rsquo;izay 3 taona mahery izay, hoy ny filoha lefitry ny Antenimieram-pirenena. Zava-misy mpiseho matetika kosa hatramin&rsquo;ny nijoroan&rsquo;ity andrimpanjakana ity anefa ny baiko midina manova tanteraka ny firafitry ny volavolan-dal&agrave;na tsy maintsy laniana, araka ny fanamarihany. Ohatra azo raisina amin&rsquo;izany ny fomba nandaniana ny lal&agrave;na momba ny fampihavanam-pirenena. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-fareast-language: FR;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495443384.jpg');
