 UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:Calibri;\r\n	mso-fareast-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;Sarimihetsika sa inona indray ny antony fa raha ny re aloha dia voalaza fa niray tsikombakomba tamin&rsquo;i Claudine Razaimamonjy sy namporisika ny resaka fitsipaham-pitokisana ny governemanta no antony nandakana azy ireo. Inona ihany no tian&rsquo;ny mpitondra fanjakana hatao&nbsp;fa toa mamoaka mampiditra lava eto&nbsp;? </span><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Sady miaro ve izany no mandetika ity mpanolotsaina iray efa rem-poko rem-pirenena tamin&rsquo;ny kolikoly avo lenta ity. Te hampiseho fa olo-marina kanefa miady amin&rsquo;ny fampanjakana ny tsy maty manota, ka tonga amin&rsquo;ilay teny vahiny izay nohagasiana hoe kiboribory vetaveta ny zavamisy. Ny azo heverina aloha izao dia mipatitaka ny fanjakana Rajaonarimampianina ary efa tena miseho masoandro ny ady an-trano ao an-dapa ao. Eny fa na ny etsy Ambohitsorohitra sy ny eny Mahazoarivo aza dia efa re mifanipaka sy mifandako saingy mbola tsy tena miseho masoandro moa izany na dia efa manomboka mivoaka tsikelikely aza ny tandindonin&rsquo;ny zavatra hiseho atsy ho atsy. Rivotra hafa mihitsy no re fa hitsoaka amin&rsquo;io herinandro higadona io, izay heverina rivotra hamaky sy mety handrendrika ny sambon&rsquo;ny fanjakana Rajaonarimampianina, izay ambaran&rsquo;ny rehetra ho manda tehezan&rsquo;ny fampanjakana ny kolikoly sy ny tsimatimanota eto Madagasikara.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>', 0, 1, 0, 'upload/17-05-22-1495443461.jpg'),
