="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;Voka-dehibe no entiny hanamarihana izany rahampitso alahady 21 mey. Hisy ny fotoam-pivavahana lehibe hotanterahina eny amin&rsquo;ny &laquo;&nbsp;Institution Marthe Herv&eacute;e&nbsp;&raquo; ny tapak&rsquo;andron&rsquo;ny maraina, arahin&rsquo;ny fandraisana ny fanasan&rsquo;ny Tompo. Eny amin&rsquo;ny Sainte Famille Mahamasina kosa no fotoana ny<span style="mso-spacerun: yes;">&nbsp; </span>hariva ka hisy ny fampisehoana goavam-be hiarahana amin&rsquo;ny TGC hotronin&rsquo;ireo mpanakanto tsy hampoizina maro. Hisy ihany koa ny dihy mirindra hotanterahin&rsquo;ity antoko mpihira ity mandritra izany izay nambaran&rsquo;Andriamatoa Hary, filohan&rsquo;izy ireo fa tsy mbola fahita hatramin&rsquo;izay. Tsiahivina moa fa efa in-telo namoaka rakikira sy raki-tsary ny antoko mpihira Taratry ny mazava tao anatin&rsquo;izay 45 taona izay ka ny raki-tsary sisa no tsy vita ho an&rsquo;ny laharana fahatelo. Miantso ny zanaka am-pielezana rehetra ho avy hanotrona azy ireo ity antoko mpihira ity, araka izany.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-22-1495443588.JPG');
