haino ? Efa difotry ny lainga, hoy ny Raiamandreny ara-panahy fa mitovy amin&rsquo;ny rano atondraka an-damosin&rsquo;ny gana e ! Fitsaram-bahoaka atsy, kolikoly aroa, fa iza re no hihaino an&rsquo;izany eo a ? Tena miaiky aho ry Jean fa be marenina ianareo a ! Henoko mihitsy ianareo ilay nanontany iny hoe hay ve nisy an&rsquo;izany e !</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco </span></strong></p>', 0, 1, 0, 'upload/17-05-22-1495443641.jpg'),
