rsquo;ny fanjakana tamin&rsquo;ny taona 2016. Tafakatra 1 miliara Ar isan-taona kosa ny vola lanian&rsquo;izy ireo amin&rsquo;ny asa sosialy entina hanampiana ny mpiara-belona. Marihina moa fa misy ny fampahafantaran&rsquo;izy ireo ireo akora ampiasainy hamokarana ireo karazana zava-pisotro vokariny manerana ny Nosy. <span style="mso-spacerun: yes;">&nbsp;</span><span style="mso-spacerun: yes;">&nbsp;</span>Tsy latsa-danja amin&rsquo;izany ny fanomezam-baovao ny olona mikasika ny fenitra sy ny politika entina manetsiketsika ny orinasa amin&rsquo;ny ankapobeny. <span style="mso-spacerun: yes;">&nbsp;</span></span></span></p>\r\n<p class="MsoNormal"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Pati</span></span></p>', 0, 1, 0, 'upload/17-05-22-1495443777.jpg');
