etsika ny fisian&rsquo;ny fihenam-bidy amin&rsquo;ny entana rehetra ka 15 % no ambany indrindra, hoy Ramanantsoa Harilala. Manodidina ny 300 ireo tranoheva handray anjara ao. Hisy ihany koa ny kojakoja natokana ho an&rsquo;ny lehilahy sy ny ankizy miampy ny kojakojan-tokantrano maro samihafa. Nomarihin&rsquo;ity tompon&rsquo;andraikitra ity <span style="mso-spacerun: yes;">&nbsp;</span>manokana moa fa ho hentitra ny fitandroana ny fandriampahalemana izay hahafahan&rsquo;ny mpanjifa miantsena araka ny tokony ho izy. Misy ny toerana hahafahana misakafo antoandro sy ny toerana hahafahan&rsquo;ny ankizy milalao sy miala voly.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495444411.jpg'),
