e"\r\n   UnhideWhenUsed="false" Name="Colorful List Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="73" SemiHidden="false"\r\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Tsy adinony ny nihaona tamin&rsquo;ireo vahoaka tany an-toerana, ka tao amin&rsquo;ny Magro Mahajangabe no nanaovana izany, fotoana nanafarany ny mpomba azy amin\'ny tokony hanambarana ny hery amin\'ny fampandrosoana ny firenena. Nizotra araka ny tokony ho izy ny lanonana ary feno hipoka teny amin\'ny kianja Magro, tsiahivina ihany fa Mahajanga ny faritany faharoa nahazoan&rsquo;i Marc Ravalomanana isam-bato betsaka indrindra tamin&rsquo;ny fifidianana rehetra natrehany teto Madagasikara taorian&rsquo;Antananarivo.Andao hanambatra hery amin&rsquo;ny fampandrosoana ny firenena &ldquo;Faly aho!&rdquo; izay hatrany no ambeti-tenin&rsquo; ity filoha teo aloha ity rehefa nandray ny fitenena voalohany izy nitafa nivantana tamin&rsquo;ny vahoaka izay nanotrona azy. Nankasitraka ireo mpanara-dia azy izy ary nilaza fa hanambatra ny hery hampandresena ny marina eto amin&rsquo;ny firenena mba hampadroso an&rsquo;i Madagasikara. Raha ny kabariny hatrany dia &ldquo;tsy matahotra ny hifaninana amin&rsquo;ny hafa izy amin&rsquo;ny fifidianana izay mety atao eto amin&rsquo;ny firenena indrindra amin&rsquo;ny 2018&rdquo;. Mitaky olona kinga sy miasa ny fampandrosoana mba tsy hitarazoka ny fampandehan-draharah&shy;a ary tsy ilaina koa ny olona mihebohebo, hoy hatrany ny fanazavany. Vao ny herinanro teo i Marc Ravalomanana no nilaza fa ilaina aloha ny fampihavanana ka ho an&rsquo;ny antoko TIM manokana dia nilaza izy fa &ldquo;Misokatra ho an&rsquo;ny rehetra ny antoko ary tsy misafidy antoko politika fa rehefa mitovy ny fomba fijery dia afaka miara-miasa&rdquo;. Nilaza hatrany izy fa nandritra ny fandalovany tany Alemaina dia vonona hiara hiasa amin&rsquo;ny Malagasy izy ireo fa mitaky ny filaminana eo amin&rsquo;ny sehatra ara-politika ka ity farany no milaza fa afaka mamerina indray ny filaminam-bahoaka. Isan&rsquo;ny antony iray lehibe takian&rsquo;ny mpiara-miombon&rsquo;antoka avy any ivelany ny fitoniana politika sy sosialy, fa raha tsy misy io dia ho nofy hatrany aloha no hisintonana mpamatsy vola sy mpampiasa vola eto Madagasikara. Ho an&rsquo;ny eto an-toerana kosa dia mitohy hatrany ny fitetezam-paritra ataon&rsquo;ny ny filoham-pirenena teo aloha ka anio izy dia hitodi-doha any Marovay ary ao anaty fandaharam-potoana koa amin&rsquo;ity herinandro ity ny fitsidihana ny<span style="mso-spacerun: yes;">&nbsp; </span>faritra atsimon&rsquo;ny nosy izay mbola lazoin&rsquo;ny tsy fanjarian-tsakafo mitarazoka</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>', 1, 1, 0, 'upload/17-05-22-1495451836.jpg');
