me="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;"><span style="mso-spacerun: yes;">&nbsp;</span>Ny mpitandrina Tiana Alisoa Ranaivoniarivo no vahinin&rsquo;ny fandaharana &ldquo;Vahaolana&rdquo; tao amin&rsquo;ny onjampeo Top Radio (F.m 102.8) omaly tamin&rsquo;ny 1 ora tolakandro. Nahafantarana ity mpitandrina ity moa ny fanadihadiana manokana nataony mikasika ireny fikambanana miafina (soci&eacute;t&eacute; secr&egrave;te) ireny. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Noresahany omaly ny mikasika ny fahitany ny Franc ma&ccedil;on sy ny manodidina azy. Nohazavainy fa fikambanana miafina izy ity ary manana tanjona ny hifehy izao tontolo izao amin&rsquo;ny lafiny rehetra. Tia firahalahiana ny mpikambana ao anatiny saingy firahalahiana miitatra amin&rsquo;ny antsoina hoe &ldquo;complot&rdquo; (firaisana tsikombakomba) ary miafara amin&rsquo;ny atao hoe &ldquo;conspiration&rdquo; (firaisana tsikombakomba avo lenta). Misy idiran&rsquo;izany, hoy izy, ny fisitrahan&rsquo;olom-bitsy ireny aferana andramena sy ny tariny eto amintsika ireny. Azo antoka fa mpikambana ao ny mpitondra eto amintsika matoa ao amin&rsquo;ny hotely Carlton no horaisina ny fihaonamben-dry zareo ny 24 ka hatramin&rsquo;ny 27 mey izao. Maro, raha ny fanazavany, ireo rafitra iraisam-pirenena baikon&rsquo;io fikambanana io. Mampametra-panontaniana <span style="mso-spacerun: yes;">&nbsp;</span>ny maro tokoa aloha hoe fa : nahoana ary <span style="mso-spacerun: yes;">&nbsp;</span>ireo firenena vatsian&rsquo;ny banky iraisam-pirenena sy ny tahirim-bola iraisam-pirenena (FMI) no tsy misy mandroso mihitsy ankehitriny ?</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija</span></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp; </span></span></p>', 0, 1, 0, 'upload/17-05-22-1495451928.jpg'),
