"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; mso-ansi-language: EN-US;">Noho ny toe-javatra mitranga eto amin&rsquo;ny firenena dia miainga eny ifotony manentana ny mpikambana ao aminy indray ny antoko Maitso tarihako, hoy Atoa Georget Alexandre, ka ireo<span style="mso-spacerun: yes;">&nbsp; </span>Boriborintany 6 eto Antananarivo Renivohitra no hanombohana izany, hotohizana any Voh&eacute;mar, Antsiranana ary Androy tsy ho ela dia manerana ny nosy koa avy eo. Antoko tsy manam-pahavalo n&rsquo;iza n&rsquo;iza ny Maitso, hoy ity filohany ity. Mpikambana feno sy manana solontena mpitarika ao ami&rsquo;ny FEVA Afrique sy ny Global Green&rsquo;s ary ao amin&rsquo;ny Armada ny antoko Maitso. Miray feo amin&rsquo;ity fivondronan&rsquo;antoko farany ity ny antoko Maitso ka hanolotra kandid&agrave; iraisany amin&rsquo;ny fifidianana ho filoham-pirenena Malagasy amin&rsquo;ny 2018 nefa hatreto aloha tsy mbola voafaritra mazava tsara io kandid&agrave; iombonana io, hoy ihany Atoa Georget A lexandre.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">Georget Alexandre filohan&rsquo;ny antoko Maitso teny Ampefiloha </span></em></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">(sary Rakotobe Michel)</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 2, 'upload/17-05-22-1495451995.JPG');
