alse"\r\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="text-align: justify; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp; </span>Na izany aza dia efa manana ny kajiny manokana ihany koa ity praiminisitra ity, izay heverina fa tsy hanaiky mora foana, ary efa niaraha-naheno ny resaka fiarovan-tenany amin&rsquo;ny fitsipaham-pitokisana, ka nivoahan&rsquo;ny vaovao ny herinandro lasa teo fa hoe efa nanome fiara tsy mataho-dalana ho an&rsquo;ny depiote miisa 16 izy. Ny lohandohany ao anatin&rsquo;ny HVM no voalaza fa leo sy tofoka ary maniry ny hialan&rsquo;ity praiminisitra ity. Miha mitombo rahateo ny tsindry isan-karazany amin&rsquo;ny tokony hanesorana sy hanaovana fanadihadiana ara-pitsarana azy noho ny resaka afera maloto. Anisan&rsquo;ny nametraka fitoriana, ohatra, ny vondrona politika Dinika Fanavotam-Pirenena (DFP), izay tsy nisalasala fa nilaza fa izy no tompon&rsquo;antoka voalohany tamin&rsquo;ny fanomezana tsenam-panjakana an&rsquo;i Claudine Razaimamonjy. Na ny ety ivelany na ny ao anatin&rsquo;ny fanjakana dia samy efa samy tsy faly sy mikendry ny handakana ny praiminisitra, saingy any amin&rsquo;ny filoham-pirenena sy ny antenimieram-pirenena ny baolina.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Hamoaka dosie lehibe</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Handroso maty raibe ary hihemotra maty renibe ny filoham-pirenena Hery Rajaonarimampianina amin&rsquo;izao fotoana izao. Efa mandeha ny tsindry isan-karazany amin&rsquo;ny tokony hanalana ny praiminisitra saingy tsy mbola sahy manao izany ny tenany mandrak&rsquo;ankehitriny. Mahalala ny dosien&rsquo;ny fitondrana ny praiminisitra, ka izay no mety hananan&rsquo;ny filoham-pirenena tahotra aminy.<span style="mso-spacerun: yes;">&nbsp; </span>Na izany aza anefa dia re fa efa mandeha ny hevitra hampirisihana mety hanatanterahana ny fitsipaham-pitokisana na ny &ldquo;motion de censure&rdquo;, ka ny herinandro teo dia efa nandeha ny resaka fa nisy depiote maromaro nantsoin&rsquo;ny tany an-dapa nanontaniana ny heviny momba ny hanonganana ny praiminisitra. Mikasika ny fahazoana fiara tsy mataho-dalana dia voalaza fa efa ela no tokony ho azon&rsquo;ny depiote, saingy ny HVM mihitsy no nitsipaka satria ny praiminisitra vaovao hotendrena no tiany hanolotra azy mba hananan&rsquo;izy ireo fanohanana bebe kokoa avy amin&rsquo;ny depiote satria ny praiminisitra ankehitriny, dia<span style="mso-spacerun: yes;">&nbsp; </span>efa maro tsy mpankasitraka.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495452045.jpg'),
