fampanantenana natao tamin&rsquo;izany dia ho maro ny karazan-tolom-pitsaboana ho azon&rsquo;ireto hopitaly ireto omena. Anisany ny fitarafana, ny radiolojia nomerika, ny fijerena vohoka, ny fitiliana nify, hatramin&rsquo;ny efitrano fandidiana sy vonjy taitra. Ho an&rsquo;ny etsy Andohatapenaka manokana, misy fandriana miisa 120 ireo efitra 30 ao anatiny, izany hoe fandriana 4 ho an&rsquo;ny efitra iray ary misy toeram-pidiovana 2 (WC+douche). Mahagaga ny mpanara-baovao ihany koa ny tsy nandefasana an&rsquo;ilay mpandraharaha Claudine Razaimamonjy. </span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495452151.jpg');
