reo fanontaniana tsara hapetraka ireo mikasika ny fak&agrave;na tany ataona manampahefana sy mihevitra azy ireo. Iza no mpitondra teto sahy nihaino vahoaka ka nampiato ny fotodrafitrasa nofinofisiny tao anatin&rsquo;ny efa-taona ? Nisy andian&rsquo;olona nidina an-dalambe nilaza ho tsy nankasitraka ny zava-misy. Heverina ho lesona azo tsoahina amin&rsquo;izay efa nisy tany aloha kosa anefa ny nataon&rsquo;ny fiadidian&rsquo;ny kaominin&rsquo;Antananarivo Renivohitra ny sabotsy teo izay nandrava ireo fefy nampimenomenona ny olona tetsy Mahamasina sy Amparibe fa nanao laharam-pahamehana ny fifampidinihina ho amin&rsquo;ny anio. Soa fianatra, hoy ny fitenenana !</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong></p>', 0, 1, 0, 'upload/17-05-22-1495452203.jpg'),
