="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Ny sabotsy teo tokony ho tamin&rsquo;ny 10 ora atoandro, dia nidonaka mainty be ny trano iray an&rsquo;olon-tsotra tery Imerinafovoany, kaominina Talatamaty. Raha ny fanazavan&rsquo;ny ben&rsquo;ny tan&agrave;na eny an-toerana dia teo ny tenany vao nahalala fa mamokatra tsilotr&rsquo;afo (Briqu&eacute;) ity trano may. Orinasa tsotra anefa, no tao anaty filazana. Tsy fitandremana teo amin&rsquo;ny fanandramana nataona mpiasa iray no niteraka firehetana sy nandratra ny tenany. Na ireo mpamonjy voina sy ny mponina aza moa samy gaga satria samy nihevitra fa toy ny trano tsotra may rehetra izy ity. Tonga ara-potoana rahateo koa ny mpamonjy voina, raha ny vaovao voaray hatrany. Nisy moa ireo mpanao gazety nilaza ho naharay fandrahonana avy tao amin&rsquo;ilay orinasa mba tsy hiditra lalina amin&rsquo;ny fanadihadiana. Voalaza fa norahonana tsy hiteny koa ireo mpiasan&rsquo;ny orinasa. Tsy nisy ny aina nafoy.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong></p>', 0, 1, 0, 'upload/17-05-22-1495452288.jpg');
