>&nbsp;kanefa anie dia ramamany ihany no nipingapinga nampiditra an&rsquo;iny tao e! Izao toa mivaloharika ianareo mianakavy fa toa izy indray no raola amin&rsquo;ity tantara ity. Aiza ve ry Jean ka efa tsy misy tsy hahenoana ny lazany ny resaka afera maloto kanefa dia tsy sahinareo ny mikitika n any singam-bolony aza! Fa aiza ramamany sady henonany anie fa efa tena litika amin&rsquo;I Solobe hono izy e! Io ilay noteneniko anareo hoe aoka hoe aoka izay io volongita mifandray tendro amin&rsquo;ny bizina sy ny afera io, fa manjary lasa fitaovam-piadiana rehefa raikitra ny tsy fifankahazoana, saingy ninia bemarenina ianareo. I Solobe indray izany izao no maitira fa ianareo ry Jean dia mpitazana sy mijery izay hataony satria handroso maty raibe, hihemotra maty renibe? Raha izaho ianareo dia miara-miala dieny tsy mbola misy maratra!</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Marco</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495452331.jpg'),
