</p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Ny fanazavana avy any an-toerana no nahalalana fa mbola nahavita tsara ny taranja roa voalohany izy izay tsy hita soritra mihitsy ny olana teny aminy. Noheverin&rsquo;ny mpitsabo tamin&rsquo;ny fizahana azy fa mety nihinana na nisotro zavatra manome hery tampoka ireny ny tenany teo am-piatrehana ilay taranja 1.000m, ka izao niteraka fijanonan&rsquo;ny fony tampoka izao. Raha ny vaovao hatrany dia vitany tao anatin&rsquo;ny 3mn 21s ity taranja 1.000m ity izay ao anatin&rsquo;ny naoty tsara tahaka ireo taranja hafa nataony. Taorian&rsquo;izay dia nampitandrina ireo mpanao fanadinana bakalorea ara-panatanjahantena ny tompon&rsquo;andraikitry ny sekoly amin&rsquo;ny fampiasana sakafo na zava-pisotro na fanafody mety mampatanjaka tampoka amin&rsquo;ny fihatrehana izany.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Rakoutou</span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-22-1495452922.jpg');
