e" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; mso-ansi-language: EN-US;">Nanolotra vary, menaka, siramamy ary tsaramaso ho an&rsquo;ny fianakaviana sahirana miisa 8.000 avy amin&rsquo;ny boriborintany 6, notontosaina tao amin&rsquo;ny lapan&rsquo;ny kolontsaina sy fanatanjahantena Mahamasina omaly, ny filoha mivady ary tamin&rsquo;ny anaran&rsquo;izy ireo. Niara-dalana taminy kosa ny mpikamban&rsquo;ny governemanta vitsivitsy sy ny solontena avy amin&rsquo;ny antenimiera roa tonta. Raha ny resaka nandeha omaly dia ny tanora HVM no voalaza fa saika hanatanteraka ny fizarana sakafo, saingy navadika tamin&rsquo;ny anaran&rsquo;ny filoham-pirenena mivady tamin&rsquo;ny ora farany. Niseho indray omaly ny endrika fihantsiana fanaon&rsquo;ny filoha rehefa mba manao zavatra kely. &ldquo;Anontanio aloha ny tenanareo hoe inona no vitanareo teto amin&rsquo;ny firenena, indrindra fa tamin&rsquo;ireny vahoaka sahirana ireny fa tsy faly manenjika fitondrana&rdquo;, hoy izy. Teny izay miantefa amin&rsquo;ireo mpanao politika, indrindra fa ireo filoha teo aloha. Tsy nisalasala ny tenany nilaza fa raha ampitahaina ny tamin&rsquo;ny 2 taona lasa dia nihena ny tahan&rsquo;ny fahantrana teto Madagasikara. Nahomby izany ny fanjakana HVM ? Tsy fizarana sakafo kely tsy mahavita taona no hireharehana fa mitsinjo ny vahoaka sy hanaovana vava be tahaka izany fa fitadiavana vahaolana maharitra hananany fari-piainana tsara sy mendrika kokoa. Tsy ampahafirin&rsquo;ny harena angonin&rsquo;ny mpitondra amin&rsquo;ny alalan&rsquo;ny afera maloto eto amin&rsquo;ny firenena ny vola kely sy fanomezana hakana ny fon&rsquo;ny vahoakan&rsquo;Antananarivo, izay tsy nisy hatramin&rsquo;izay fa ny mpitantana an&rsquo;Antananarivo tamin&rsquo;ny alalan&rsquo;ny Ben&rsquo;ny tan&agrave;na Lalao Ravalomanana sy ny filoha teo aloha Marc Ravalomanana aza no nofinganiny. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R </span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 14.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-23-1495543583.jpg'),
