Format="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;Olona marary i Claudine Razaimamonjy matoa tazonin&rsquo;ny hopitaly. Efa tapitra anefa ny fe-potoana 45 andro voafaritry ny lal&agrave;na 4673/60 tamin&rsquo;ny 10 novambra 1960 fa hahafahan&rsquo;ny olona iray voatazona am-ponja mitsabo tena. Raha misy ny taratasy mazava avy amin&rsquo;ny hopitaly dia raharaha hafa indray, ary misy ny dingana tsy maintsy arahina, far aha ny tokony ho izy dia haverina any am-ponja aloha izy rehefa tapitra ny fe-potoana 45 andro, araka ny fanazavan&rsquo;io tompon&rsquo;andraikitra io. Raha mila mijanona ao amin&rsquo;ny hopitaly HJRA na hafindra hopitaly hafa dia tokony hatsangana ny Kaominisionina manokana, ahitana ny talen&rsquo;ny hopitaly, solontena avy amin&rsquo;ny minisiteran&rsquo;ny fitsarana handinika ny mbola hahafahany mijanona ao na tsia araka ny hevitry ny Sendikan&rsquo;ny Mpitsara (SMM), ary nohamafisin&rsquo;ny Mpisolovava Willy Razafinjatovo. Raha tsy izay dia alefa eny am-ponja izy. Manomboka izao dia mila manova fomba famindra sy fomba fiasa, ka ampitoviana daholo ny vahoaka na iza na iza fa tsy hasiana tombo sy hala. &ldquo;Maro ny olona tratry ny toe-javatra tahaka izao saingy nahoana no izy irery no iangarana ?&rdquo;, hoy ny Me Willy Razafinjatovo. Raha dinihina amin&rsquo;ny fihetsiky ny mpitondra alohadia tsy ho tanteraka mihitsy ny fampidirana am-ponja ity ramatoa ity. Tsy afaka mandray andraikitra hentitra mihitsy ve ny fitsarana sy ny mpandraharaha ny fonja amin&rsquo;ny fanatanterahana didy famonjana vonjimaika ? Rehefa iza no hampiharina avy hatrany ny didy ary rehefa iza no azo leferina ?</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>', 0, 1, 0, 'upload/17-05-23-1495543648.jpg');
