anana ny taona 2018 ny AKFM (Antokon&rsquo;ny Kongresin&rsquo;ny Fahaleovantenan&rsquo;i Madagasikara). </span><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Misavorovoro be mantsy ny fiainam-pirenena ankehitriny, hoy ny filohany Rakotomanga Eric. Maro ihany koa ny fanatsarana na fanitsiana ilaina hapetraka handaminana ny zava-misy eto Madagasikara. Mbola miteraka adihevitra be, ohatra, ny lal&agrave;m-pifidianana volavolain&rsquo;ny kaomisionina mahaleotena mikirakira ny fifidianana. Vaomiera nasionaly tsy hita taratra rahateo hatreto ny maha mahaleotena azy, hoy ity mpitarika antoko politika ity. Tsy laharam-pahamehana ny fomba fijerin&rsquo;ny fianakaviambe iraisampirenena hirosoana amin&rsquo;ny fampihavanam-pirenena na fampifanatonana ireo mpanao politika satria tsy nisy ady goavana niseho ohatra ny tany amin&rsquo;ireo firenen-kafa tahaka an&rsquo;i Lybia, Syria na Liban teto amintsika, araka ny fanazavany. Raharaham-bahoaka mila vahana haingana izao ny fahantran&rsquo;ny Malagasy maro an&rsquo;isa sy ny politikam-panjakana tsy mifanaraka intsony amin&rsquo;ny hetahetan&rsquo;ny mponina eto Madagasikara. Hipetraka ho azy moa ny fifandimbiasam-pahefana demokratika raha manaja sy manatanteraka ny fandaharanasa nampanantenainy ny vahoaka ny mpitondra eto amintsika, hoy ny filohan&rsquo;ny AKFM. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-23-1495543733.jpg'),
