ataon\'ity vahiny ity tsindry hazo lena sy nanamparany ny maha olona tsy refesi-mandidy azy tao anatin\'ny taona vitsivitsy izay ka nanome fisaorana an&rsquo;ireo tompon\'andraikitry ny mpitandro ny filaminana isan-tokony. Nahatsapa ny maha zava-dehibe ny soatoavina Malagasy izay nataon&rsquo;ity vahiny ity tsinontsinona<span style="mso-spacerun: yes;">&nbsp; </span>hatramin\'izay ireo mpitandro ny filaminana nanao ny fisamborana, hoy izy ireo. Mbola andrasan\'ny mponin\'i Toamasina ny hiakaran&rsquo;ny raharaha tsy ho ela <span style="mso-spacerun: yes;">&nbsp;</span>eny anivon\'ny fitsarana, ka irariana ny hahazoany sazy henjana manoloana ny fandrobana fananan\'olona, fikasihan-tanana, fanindriana ho mahitahita ary fanaovana tsinontsinona ny mpitandro ny filaminana. Marihana fa ny hetsika mamoafady farany vitan&rsquo;ity teratany vahiny ity izao dia ny <span style="mso-spacerun: yes;">&nbsp;</span>fandratrana olona mpanao asa sosialy ny zoma lasa teo izay noheveriny fa tokony ho izy no hitarika ny fikambanan\'ny mpanao asa soa kanefa hiarahan\'ireo mpiray fikambanana, fa tsy sahaza azy io toerana io noho ny laza ratsy ataony. Dia ho sanatria hisy be lamosina sahy hiaro an&rsquo;ity olona ity indray ve <span style="mso-spacerun: yes;">&nbsp;</span>eo anatrehan\'izany ? Fantatra hatreto fa <span style="mso-spacerun: yes;">&nbsp;</span>efa miditra manohy ny asa ratsin-drainy koa ireo zanany mirahalahy ankehitriny.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></em></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-23-1495543818.jpg');
