en="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;ka rehefa tonga ny fotoana tokony hizogan&rsquo;ny olona efa voaporofo izao fa nanao fandikan-dal&agrave;na mihoapampana ny saziny, toy ny fanodinkodinana volam-panjakana dia raikitra ny hoe raha maty aho matesa rahavana fa tsy hisy hanaiky hanefa sazy samirery eto, hany ka tsy maintsy mifampiaro mba tsy hipoahan&rsquo;ny raharaha. Tapitra indray io ny fe-potoana hahafahana mitsabo ilay ramatoa malaza amin&rsquo;ny kolikoly eny amin&rsquo;ny hopitaly, ka tokony halefa eny Antanimora ary eny indray tohizana ny fitsaboana raha ilaina, saingy tsy mbola tanteraka ny fampidirana am-ponja. Mihevitra ve ny mpitondra ankehitriny fa ho vita mora sy handeha ho azy foana ny raharaha ary ho afa-maina fotsiny amin&rsquo;izao ny mpanao ratsy ? Raha mitohy ny hazo lanin&rsquo;ny voalavo ny lanitra, hoy ny fitenenana, ka na ho ela na haingana dia tsy maintsy hizaka ny nataony ny tsirairay. Efa mangady fasana hilevenana amin&rsquo;ny alalan&rsquo;ny fampanjakana ny tsimatimanota ny fitondrana Rajaonarimampianina ary efa an-dalam-pahafatesana, ka ny afera maloto tsy tambo isaina no hanototra azy atsy ho atsy. Mihevi-tena tsy ho tratry ny aloka saingy ny 99 andro ihany no an&rsquo;ny mpangalatra, ka samy miandry ny rehetra, izay efa efa vonona ny handevona sy handevina ny fanjakan-jiolahy.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R </span></em></strong></p>\r\n<p class="MsoNormal">&nbsp;</p>', 0, 1, 0, 'upload/17-05-23-1495543865.jpg'),
