uage: EN-US;">&nbsp;</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: 35.4pt;"><span class="5yl5"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Saika mersenera politika sy mpibizina avokoa ny manodidina ny filoha am-perinasa, ary ny resaka tombontsoa no tena nidiran&rsquo;ny ankamaroany ho ao anatin&rsquo;ny HVM mba hahazoana toerana, ka tsy olana ny mody mikiravaty manga rehefa mahazo seza sy vola aman-karena. Efa manomboka mikopa-kelatra kosa anefa ny sasany ary mitady izay hamaharana satria lany ny mamin&rsquo;ny HVM. Na ny olona mety hanohana azy ireo aza dia ny vola ihany no mikaonty, ary niaraha-nahita ireny fomba fanao mamohehatra amin&rsquo;ny fividianana olona, toy ny fanatrehana ny matso etsy Mahamasina isaky ny fanamarihana ny fetim-pirenena rehefa 26 jona ireny, izay tsy mbola nisy hatramin&rsquo;izay, izany hoe tsy ny foto-kevitry ny filoha mihitsy no hanohanan&rsquo;ny olona azy fa ny vola atosany, ka tsy manana mpanohana tena mahatoky ny HVM. An-kilany, sokajiana ho mbola matanjaka<span style="mso-spacerun: yes;">&nbsp; </span>sy manana olona i Marc Ravalomanana sy Andry Rajoelina amin&rsquo;izao fotoana. Hatreto, tsy mbola misy olona tena mahazaka vahoaka ankoatra azy roalahy, ary ny tena mampiavaka azy ireo dia manohana amin&rsquo;ny alalan&rsquo;ny foto-kevitra ny mpomba azy ireo, izany hoe olon&rsquo;ny foto-kevitra, ka havitsiana no mety hivadika. Toa efa voasivan&rsquo;izy ireo ihany koa ny olona akaiky azy ireo ao amin&rsquo;ny antokony avy dia ny TIM sy ny MAPAR, izay efa hitany fa nifikitra hatramin&rsquo;ny farany ary namadika palitao. Tombanana fa izy ireo no hanao ny fihodinana faharoa amin&rsquo;ny fifidianana filoham-pirenena, raha havela hilatsaka an-kalalahana.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Kapa ranjo</span></em></strong></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mbola mikendry ny hitondra fanindroany an&rsquo;i Madagasikara ny HVM, saingy tsy ho tanteraka raha mbola eo i Marc Ravalomanana sy Andry Rajoelina. Mbola baraingo anefa hatreto ny famelana azy ireo hirotsaka an-kalalahana, ary mandeha ny kapa ranjo isan-karazany hoenti-misakana, toy ny resaka fanenjehana ara-pitsarana. Kajy anankiray ihany koa ny hoe tsy hirotsahan&rsquo;i Hery Rajaonarimampianina, ka hoterena hanaraka azy ihany koa izy roalahy ireto raha toa ka tsy hahomby ny fanenjehana ara-pitsarana kotrehina mafy hoenti-misakana azy ireo. Ho an&rsquo;i Marc Ravalomanana manokana dia efa antsojay hatao azy amin&rsquo;ny fifidianana 2018 ny tsy famelana ny fisokafan&rsquo;ny orinasan-tserasera MBS mandrak&rsquo;androany.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 1, 1, 0, 'upload/17-05-23-1495544059.jpg');
