btle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormalCxSpMiddle" style="line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Hanamarika ny iray volan&rsquo;ny teny Malagasy ny Fikambanan&rsquo;ny <span style="mso-spacerun: yes;">&nbsp;</span>Mpikabary Malagasy (FIMPIMA) <span style="mso-spacerun: yes;">&nbsp;</span>tarihin&rsquo;i Andriamboavonjy Hanitra <span style="mso-spacerun: yes;">&nbsp;</span>ny 3 jona ho avy izao. Alin&rsquo;ny mpikabary izay hotanterahina etsy amin&rsquo;ny Carlton Anosy no hisantarana izany amin&rsquo;io andro io manomboka amin&rsquo;ny 8 ora alina. Hizara roa miavaka tsara ny fandaharam-potoana<span style="mso-spacerun: yes;">&nbsp; </span>raha ny fanazavan&rsquo;ny filohany Andriamboavonjy Hanitra. <span style="mso-spacerun: yes;">&nbsp;</span>Sora-kanto no hanokafana ny lanonana izay horavahan&rsquo;ny dihy sy <span style="mso-spacerun: yes;">&nbsp;</span>fampisehoana ireo karazana fitafiana Malagasy. Hanomboka amin&rsquo;ny 10 ora alina kosa ny korana mandrapaharainan&rsquo;ny andro, izay horavahin&rsquo;ny filatroana&hellip; Fanokafana ihany ireo rehetra ireo ho an&rsquo;ny foibe fa hanao hetsika avokoa ny any amin&rsquo;ny Faritany raha ny fanazavan&rsquo;izy ireo tamin&rsquo;ny mpanao gazety omaly. Anisan&rsquo;izany ny eto Antananarivo izay horavahin&rsquo;ny fifaninanana kabary manomboka ny 7 jona ka hatramin&rsquo;ny 24 jona ho avy izao. Hitohy any Toamasina izany ny 24 jona, hampiseho ny maha izy azy ihany koa ny any Antsirabe, hetsika hipaka hatrany Fianarantsoa, Mahajanga ary Toliara izay efa misy FIMPIMA avokoa. Nomarihiny fa efa 54 taona nijoroana ny <span style="mso-spacerun: yes;">&nbsp;</span>FIMPIMA ankehitriny ary efa mahatratra 174 isa ny toerana fampianarana eto amintsika misy sampana 75 isa sy Faritany fito. Ankoatra izay ny any ivelany izay tsy mitsaha-mitombo.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 0, 1, 0, 'upload/17-05-23-1495544230.JPG');
