<span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Nabaribariny kosa ny fitavozavozan&rsquo;ny fanjakana ankehitriny, ka nilazany fa ireo solontenan-dry zareo avy amin&rsquo;ny fitondrana dia olona afaka mamaly sy miteny mazava ny zava-misy hisian&rsquo;ny demokrasia. Resaka be fotsiny ny hoe fipetrahan&rsquo;ny demokrasia, ka izay no ilana ny dinika politika, hoy ny filoha teo aloha. Tsy nisalasala izy naneho ny heviny mikasika ny fihetsiky ny mpitondra ankehitriny izay tsikaritra fa tsy vonon-kihavana. Nambarany fa misakana ny fifampiresahana tsy hisy ny fitondrana satria tsy mety miresaka fa mandany andro amin&rsquo;ny fotoana tokony hiasana. Ny zavatra hitako dia tahotra sy tsy fahasahiana miseho sy miteny rehefa hiresaka sy hifanatrika no antony mahatonga ny fitondrana hanao izany. Naneho an-kolaka momba ny tsy fahaizan&rsquo;ny mpitondra ankehitriny, izay tsy mahalala ny tokony hataony amin&rsquo;ny fitantanana ny firenena, ka mbola mitsapatsapa sy tsy mahavaha ny olan&rsquo;ny vahoaka mandrak&rsquo;ankehitriny kanefa efa 3 taona nitondrana i Marc Ravalomanana. Raha halalinina ny fanehoan-keviny dia tsy ampy traikefa ny fanjakana Rajaonarimampianina, ka tsara kokoa ho azy aloha ny miverina mianatra fa tsy milingilingy mitondra fanjakana, kanefa izao no nafitsony. Tsy hoe tsy manana fahavononana ny mpitondra fa ny politika dia tsy tongatonga ho azy fa mila ianarana satria izay ny maha siansa azy, hoy izy. Ilaina fantarina miainga any ifotony, any amin&rsquo;ny kaominina sy ny vahoaka, ary mila mahalala tsara ny zava-misy. Mahay ny famahana olana ary mahavita sy manana fomba sy ny hoenti-manana manatontosa izany, hoy hatrany i Marc Ravalomanana. </span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-24-1495629055.jpg'),
