at="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Ny hosoka sy fampiasana hosoka ka nahafahana nanondrana an-tsokosoko ireo bolabolana andramena 30 000 isa sarona tany amin&rsquo;ity firenena Aziatiaka ity, izay nohafaran&rsquo;ny orinasa Kong Hoo no antony. Tanjona ny hanenjehana ara-pitsarana ireo mpiray tsikombakomba avy eto Madagasikara tamin&rsquo;ity afera maloto ity, saingy tsy fantatra mazava kosa izay olona toriana fa sokajiana ao anatin&rsquo;ny &laquo;&nbsp;Plainte contre X&nbsp;&raquo; no natao. Efa nohelohin&rsquo;ny fitsarana any Singapour higadra 18 volana an-tranomaizina sy handoa onitra 50 tapitrisa dolara i Wong Wee Keong tompon&rsquo;io orinasa io ny volana aprily teo. Ny minisitry ny tontolo iainana tamin&rsquo;ny andro nisian&rsquo;ny fanondranana io baoderozy io, dia i Anth&egrave;lme Ramparany anefa dia efa nanamarina sy nilaza fa ara-dal&agrave;na ny fanondranana ary nisy mihitsy ny fitarihany delegasinona nankany Singapour. Azo adika fa nahalala ny antsipiriany momba ity raharaha ity izy matoa sahy nilaza sy nanamarina fa ara-dal&agrave;na ny fanondranana. Maro aza no nilaza fa niray tsikombakomba tamin&rsquo;io raharaha io ny tenany. Mahagaga fa tsy mba voakitika sy voaresaka tao anatin&rsquo;ny afera mihitsy izy kanefa dia misy tompon&rsquo;andraiki-panjakana tokony hohadihadiana sy hosamborina mihitsy noho izy nanamarina ny maha ara-dal&agrave;na ny fanondranana an-tsokosoko harem-pirenena. Tsiahivina fa ny finiavana hamoaka ny marina momba io raharaha io no voalaza fa nandakana ny praiminisitra Jean Ravelonarivo sy ny minisitra Beboarimisa Ralava. Nivadika ve ny rasa, ka hiroso amin&rsquo;ny fanenjehana amin&rsquo;izay ny fanjakana rehefa nibaby fahafaham-baraka noho ny tsy firarahiana ny raharaha, ka ny fanjakana tany Singapour indray no sarotiny voalohany noho ny tompony tamin&rsquo;ity raharaha andramena Malagasy efa tamin&rsquo;ny 3 taona lasa ity ?<span style="mso-spacerun: yes;">&nbsp; </span>Ho raikitra amin&rsquo;izay ve ny fanadihadiana sy ny fisamborana ireo tompon&rsquo;andraiki-panjakana voatonona ho niray tsikombakomba ? Miandry ny tohin&rsquo;ny tantara ny rehetra.</span></p>\r\n<p class="MsoNormal" style="text-align: justify;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-24-1495629151.jpg');
