Ny depiote iray avy any Miarinarivo sy ny avy eny Avaradrano dia nanitrikitrika fa fandotoana an-kitsirano azy ireo izany ka tokony hampiseho porofo ireo nilaza. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toa variana amin&rsquo;ny fifanaratsiana tsy mahasoa isika, hoy izy ireo. Tsy aleo ve ny fampandrosoana ny firenena no banjinina&nbsp;? Nanamafy koa ny depiote avy any Betroka, Randrianasolo Jean Nicolas, ary nahasahy nilaza fa raha nisy tokoa ny fizarana fiara tsy mataho-dalana dia izy no tokony hisitraka voalohany nefa tsy mbola nisy io hatreto. Dia manontany tena ihany ny mpanara-baovao hoe : ka inona tokoa ary no tombontsoa be azon&rsquo;ity solombavambahoaka ity no tsy sasatra mampiaka-peo mafy amin&rsquo;ny fanohanana ny fitondrana ny tenany hatreto ? Nambarany fa vao tafaverina avy any Afrika Atsimo nanatrika ny fivoriana parlemantera afrikanina ny izy ary nitondra voandalana 20.000 dolara azony avy amin&rsquo;ny mpiara-miombon&rsquo;antoka. Hanohy ny asa sosialy fanaony any Betroka indray izy ato ho ato ka hizara omby 6 isaky ny kaominina tsy mbola nisitraka tany an-toerana ary hanolotra koa fitaovana toy ny fanamafisam-peo &hellip; ho an&rsquo;ireo fiangonana samihafa any an-toerana ho fiaraha-miasa amin&rsquo;izy ireo. </span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-24-1495629226.jpg'),
