Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->Mba handefaso saina fa aza mba malaina mamaky ny haingam-pon&rsquo;ny gasy efa mangasihasy. Dia mba henoy ihany ny feon&rsquo;ny fieritreretana raha mbola mbola mihevi-tena ho olom-belona manan-tsaina sy manam-panahy. Indro ny tononkalo fa sao holazainareo ho be safary eto aho. Ny eto, raha ny marina, tsy misy fanjakana ! Misy fanavahana ny akama sy tsy akama. Iaraha-mahalala izao ny momba ilay madama lazaina ho tsy salama. Hita izao fa meloka kanefa tsy ampiharana lal&agrave;na. Sao dia mba tsy rariny, ry fitondrana hajaina &ocirc; !<span style="mso-spacerun: yes;">&nbsp; </span>Vao aninkeo maraina, tovolahy marefo tsy dia salama saina, no tratran-tondro molotra, lazaina ho "nanamaina". Dia nentina hotsaraina ! Tonga dia voapanga ho meloka avy hatrany, kanefa tsy voamarina izay fisian\'izany. Nidoboka, dia any... Aza mba madinika tsy manam-bola ihany e!</p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt;"> Matimaty foana sy migadra fahatany. Ny eto, raha ny marina, tsy misy fanjakana ! Misy ihany angamba fa fanjakan&rsquo;adala, ka tsy mahatamana!!!</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco<br style="mso-special-character: line-break;" /> <br style="mso-special-character: line-break;" /> </span></em></strong></p>', 0, 1, 0, 'upload/17-05-24-1495629332.jpg'),
(145, 24, 21, 0, '2017-05-24', 'Herisetra sy fakana an-keriny  Mampiaka-peo ireo mpandraharaha', 'fandriampahalemana/Herisetra-sy-fakana-an-keriny--Mampiaka-peo-ireo-mpandraharaha-2017-05-24-145', ' \r\n\r\nEfa tsy rariny intsony ny herisetra, fakana an-keriny, fandrobana atao amin’ireo mpandraharaha, hoy ny fanambarana ofisialy navoakan’ny fianakaviamben’ny mpandraharaha eto Madagasikara omaly izay ahitana ireo fikambanana goavana toy ny CFOIM, SIM, GEM, FIVMPAMA, GEFP, FIOVA, GEPAM …', ' \r\n\r\nEfa tsy rariny intsony ny herisetra, fakana an-keriny, fandrobana atao amin’ireo mpandraharaha, hoy ny fanambarana ofisialy navoakan’ny fianakaviamben’ny mpandraharaha eto Madagasikara omaly izay ahitana ireo fikambanana goavana toy ny CFOIM, SIM, GEM, FIVMPAMA, GEFP, FIOVA, GEPAM …', '<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="--"/>\r\n   <m:small