ew Roman\',\'serif\';">Lasibatr&rsquo;ireo tambajotran-jiolahy tato anatin&rsquo;ny taona vitsy izay ireo mpandraharaha manerana an&rsquo;i Madagasikara, hany ka tena misy akony amin&rsquo;ny asa sy ny fitadiavana. Miantso ny fitondram-panjakana sy ireo tompon&rsquo;andraikitra isan-tsokajiny eto amin&rsquo;ny firenena ireo mpandraharaha ireo handray andraikitra sy hanolotra vahaolana mahomby amin&rsquo;ity herisetra mitranga etsy sy eroa ity ka mba samy hilamin-tsaina ny rehetra tsy an-kanavaka. Nanindry mafy ny SIM na ny sendikan&rsquo;ny indostria eto Madagasikara fa misy akony amin&rsquo;ny fahazotoan&rsquo;ireo mpamatsy vola ho tonga eto Madagasikara izao herisetra izao ka hampandringa ny sehatry ny fandraharahana amin&rsquo;ny ankapobeny. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Tena ilaina maika ny fametrahana paikady sy fepetra hentitra sady mahomby hiadiana amin&rsquo;ny herisetra, ka ahafahana manana tontolon&rsquo;ny fandraharahana milamina. Ny 14 mey lasa teo moa no nisy naka an-keriny ary tsy mbola hita popoka hatramin&rsquo;izao i Yanish Ismael, 26 taona mpandraharaha ary zanaky ny tompon&rsquo;ny SMTP. Io tranga io no tena nahafeno ny kapoaka ka nahatonga ireo mpandraharaha nitabataba amin&rsquo;izay satria tahaka ny tany tsy misy fanjakana eto Madagasikara.</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">RTT</span></p>', 0, 1, 0, 'upload/17-05-24-1495631298.jpg');
