; mso-ansi-language: EN-US;">Ho an&rsquo;ny teny amin&rsquo;ny manodidina dia marobe ireo olona nanatona ity toerana ity. Ireo mpitondra fiara nandalo teo an-toerana moa dia samy nihorohoro sy natahotra avokoa, ary nisy mihitsy ny tsy nety nandalo teny, ka niteraka fitohanana lavareny teny Ambohijatovo sy Analakely. Raikitra ny antso an-tariby isan-karazany. Maro no nitaintaina sao mba misy fianakaviana na namana aman-tsakaiza sendra ilay loza ka maty na naratra. Niely hatrany amin&rsquo;ny faritany mihitsy ity tsaho ity. Hatramin&rsquo;ny minisitry ny asa vaventy Eric Razafimandimby aza dia tonga teny an-toerana nanamarina ny zava-misy sy nijery ifotony ny fotondrafitrasa. Nambaran&rsquo;io tompon&rsquo;andraikitra io fa horohorontany na rano be mikoriana any anatiny na ny vesatry ny fotodrafitrasa eo amboniny no mety hampirodana azy. Tsy misy atahorana fa azo antoka tsara ny fotodrafitrasa amin&rsquo;izao fotoana izao.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Hatao hazalambo</span></em></strong></span></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; mso-ansi-language: EN-US;">Omaly ihany dia namoaka fanambarana nandiso iny tsaho niteraka resa-be iny ny zandarimariam-pirenena ka niantso ny vahoaka ho tony ka hanohy am-pilaminana ny fiainany andavanandro toy ny mahazatra. <span class="5yl5">Sokajiana ho heloka sy fandikan-dal&agrave;na any anaty tranokalam-pifandraisana na &ldquo;Cybercriminalit&eacute;&rdquo; ny fanelezana vaovao tsy marina tahaka izao. Azo heverina ho asa fampihorohoroana sy fanakorontanana ny filaminam-bahoaka ihany koa, ka inoana fa tsy hoe ela dia voasambotra ny tompon&rsquo;antoka. Raha ny resaka an-tariby nifanaovana tamin&rsquo;ny mpitandro ny filaminana dia efa eo am-panaovana fanadihadiana mikasika ity fanelezana tsaho ity izy ireo amin&rsquo;izao fotoana. Ho avy ny hazalambo. Maro amin&rsquo;ireo mpikirakira ny &ldquo;internet&rdquo; sy ny &ldquo;facebook&rdquo; no mihevitra fa tsy ho tratra saingy tsy sarotra intsony ny mamantatra ny olona niaingan&rsquo;ny hafatra mitory fandikan-dal&agrave;na toy izao noho ny fandrosoan&rsquo;ny teknolojia.</span></span></p>\r\n<p style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>', 1, 1, 0, 'upload/17-05-24-1495630902.JPG'),
