ed="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Tsy nahafa-po sy tsy nahitam-bokany ny fifampidinihana niarahana tamin&rsquo;ny minisiteran&rsquo;ny fampianarana ambony. Taorian&rsquo;ny fivoriana nataon&rsquo;izy ireo omaly dia nambaran&rsquo;ny SECES fa mitsahatra ny asa fampianarana sy ny asa fikarohana manerana ny toeram-pianarana eto amin&rsquo;ny Oniversiten&rsquo;Antananarivo sy ny any amin&rsquo;ireo foibem-pikarohana nasionaly rehetra mandra-pisian&rsquo;ny vahaolana. Miantso filankevitra nasionaly tsy ara-potoana ny tompon&rsquo;andraikitra isan-tsokajiny ao anatin&rsquo;ny SECES ny 1-2 jona izao mba handraisana fanapahan-kevitra hentitra manoloana ny dingana efa natao sy ny mety ho fitadiavam-bahaolana. Aorian&rsquo;io no mety hanaovana fitokonana faobe raha toa ka tsy misy ny vahaolana mafonja avy amin&rsquo;ny fanjakana dia fanomezana ny zon&rsquo;izy ireo. Vahaolana naroson&rsquo;ny minisitera sy ny governemanta ny fiandrasana ny volavolan-dal&agrave;na mifehy ny tetibolam-panjakana 2018 izay mifanipaka tanteraka tamin&rsquo;ny fifanarahana natao teny Mahazoarivo ny 10 septambra 2015. Nandritra ny &ldquo;loi de finance initial 2017&rdquo; no tokony hanomezana ireo zo sy tombontsoan&rsquo;ny mpampianatra mpikaroka dia<span style="mso-spacerun: yes;">&nbsp;&nbsp; </span>ny &ldquo;indemnit&eacute; de logement&rdquo; sy &ldquo;indemnit&eacute; de r&eacute;sidence&rdquo;, hoy ny SECES. Tsy fitakiana vaovao, araka izany, ny an&rsquo;ny SECES fa fanatanterahana ny fifanarahana efa nisy saingy arirariran&rsquo;ny fanjakana. Miato aloha izany ny fampianarana eny amin&rsquo;ny anjerimanontolo raha tsy tanteraka ny fitakian&rsquo;ny mpampianatra. Mbola baraingo tanteraka ny hitohizan&rsquo;ny fampianarana. Andrasana kosa izay ho fihetsiky ny mpianatra. </span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-24-1495631165.jpg');
