ty="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Maro ny kolikoly avo lenta eto amin&rsquo;ny firenena, ka olom-bitsy no migalabona amin&rsquo;ny harena sy ny volam-panjakana. Izay no mahatonga ny fitakiana isan-karazany. Mila manana fahefana manao izany ny fanjakana raha jerena amin&rsquo;ny resa-bola be mihodina anaty afera maloto isan-karazany ataon&rsquo;ny mpitondra. Mampiato ny asany ny Sendikan&rsquo;ny mpampianatra mpikaroka sy mpikaroka mpampianatra na ny SECES amin&rsquo;izao fotoana izao noho ny tsy fanatanterahan&rsquo;ny fanjakana ny fifanarahana sy didim-panjakana efa vita sonia ny 10 septambra 2015. Milaza ny hiroso amin&rsquo;ny fitokonana faobe izy ireo raha tsy voavaly alohan&rsquo;ny fivoriambe tsy ara-potoana ataon&rsquo;izy ireo ny 1-2 jona ny fahazoan&rsquo;izy ireo ny zony. Ny mpianatra koa mety tsy hipetra-potsiny manoloana ny fitokonan&rsquo;ny SECES. Ny fitakiana nataon&rsquo;izy ireo momba ny fampiakarana ho 100% ny vatsim-pianarana sy ny fampidinana ny saran&rsquo;ny fisoratana anarana tsy nivaly hatreto. Milaza ny hanao fitokonana mandritra ny 2 andro manomboka ny 29 mey ihany koa ny mpiasan&rsquo;ny ladoany mba hamaliana hanomezan&rsquo;ny fanjakana ny zon&rsquo;izy ireo, ary hampitomboina ho 5 andro izy io raha mbola minia be marenina ny mpitondra. Raha ny fanazavan&rsquo;ny eo anivon&rsquo;ny fadin-tseranana anefa dia 5 miliara ariary eo ho eo ao anatin&rsquo;ny iray andro ny fampidiram-bolan&rsquo;ny fadin-tseranana. Hisy fiantraikany lehibe amin&rsquo;ny fampidiram-bola ao anatin&rsquo;ny kitapombolam-panjakana izany satria 10 miliara no ho very mandritra ny hetsika ary ho tonga 25 miliara ariary raha mitohy ho 5 andro. Miraviravy tanana anefa ny fitondrana ary mamono afo amin&rsquo;ny fanaovana hetsika sosialy raha dinihina amin&rsquo;ny fihetsiky ny filoha.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-26-1495798499.jpg'),
