sera raha nanao be marenina tany ho any foana hatrizay. Inona no ao ambadik&rsquo;ireny teny malefaka sy fakana ny fon&rsquo;ny olona ireny ? Raikitra indray ny lemilemin-dradity hamandrihana an-dravorona. Mila mailo ny rehetra satria ny tanana zatra mitsotra tsy afaka ny hivokona intsony, ka sao ho sodokan&rsquo;ny iray lovia eto !</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></p>', 0, 1, 0, 'upload/17-05-26-1495798555.jpg');
