class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;ka nitondra ny heviny momba izany indray ny filohan&rsquo;ny Sendikan&rsquo;ny Mpitsara eto Madagasikara Faniry Ernaivo ny alarobia teo. Ny fitorianay any amin&rsquo;ny zandary ary tsy mbola nandeha hatramin&rsquo;izao fa tsy fantatra marina ny antony, hoy ny filohan&rsquo;ny Sendikan&rsquo;ny Mpitsara eto Madagasikara manoloana ny raharaha Riana Andriamandavy VII. Nandeha ny resaka fa efa nisy minisitra naka teny amin&rsquo;ny zandarimariam-pirenena ny antontan-taratasin&rsquo;ady nitoriana ity loholona ity, kanefa sady tsy nandiso no tsy nanamarina ny izany ny filohan&rsquo;ny SMM. Tsy fantatra mazava kosa izay tena fampiharana ny lal&agrave;na ataon&rsquo;ny mpitondra manoloana ny raharaha mahasaringotra ireo olon&rsquo;ny HVM 2 ireo. Ny hitantsika izao dia ny governemanta no nanao izay fanambarana izay ary nohamafisin&rsquo;ny minisitry ny serasera hoe izaho mihitsy amin&rsquo;ny maha filohan&rsquo;ny SMM ahy no heverin&rsquo;izy ireo fa tokony henjehina fa mandika lal&agrave;na nefa ilay lal&agrave;na lazainy amin&rsquo;io tsy fantany , hoy i Faniry Ernaivo. Ny fandraisako an&rsquo;izay dia hoy aho amin&rsquo;ny minisitry ny serasera hoe mianara aloha lal&agrave;na, ary miandry izay hataony aho, hoy izy tamin&rsquo;ny hafatra sy teny mahery miantefa amin&rsquo;ny minisitry ny serasera Harry Laurent Rahajason na Rolly Mercia. Maro ny tsy fanarahan-dal&agrave;na misy eto amintsika, anisan&rsquo;ny ngezabe io raharaha Claudine Razaimamonjy io, ary izahay tsy hanaiky mihitsy ny tsy fanarahan-dal&agrave;na momba ny kaomisionina hatsangana handinika ny mbola hitazonana ity ramatoa ity. Dokotera 4 no mandrafitra io kaomisionina io ary nanangan-tena ireo komity ireo, hoy izy. Notsiahivina fa 45 andro ny lal&agrave;na hahafahana mitazona olona voafonja hotsaboina saingy ny dokotera no mahalala izay aretiny, ka dia miandry ny rehetra. Raha ohatra izy ireo ka sahy mbola hanohy ny fitazonana io olona io dia tompon&rsquo;andraikitra eo anatrehan&rsquo;ny lal&agrave;na, hoy i Faniry Ernaivo.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-26-1495798628.jpg'),
