ed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--><span class="5yl5" lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ny resaka mandeha dia mivoy ny hanesorana an&rsquo;i Mahafaly Solonandrasana Olivier i Rivo Rakotovao. Tsy sahy anefa ny filoham-pirenena noho ny tahotra ny hipoahan&rsquo;ny afera maro satria mahalala ny aty vilanin&rsquo;ny mpitondra tsara ny praiminisitra ka tsy ho sarotra ho azy ny hanapoaka ny afera ho fanta-poko fanta-pirenena. Re aza fa efa mifandray amina vondrom-pinoana lehibe iray ity minisitra ity sy ny olona iray tena akaiky ny filoha ary efa nanolotra anaran&rsquo;olona hatao praiminisitra. Izay no mety tsy nahitana an&rsquo;i Rivo Rakotovao teny Mahamasina nandritra ny fizarana sakafo nataon&rsquo;ny filoham-pirenena mivady afak&rsquo;omaly satria niara-dalana tamin&rsquo;ny filoha teny an-toerana ny praiminisitra.<span style="mso-spacerun: yes;">&nbsp; </span>Mbola mahabe resaka ihany koa ny momba ireo fanomezana. Ny feo niely dia saika hozaraina ho an&rsquo;ny traboina izy ireny. Ny minisiteran&rsquo;ny mponina no tokony hanao ny hetsika tahaka ireny. Misy tsy fifankahazoana ve ao sa te hanindry sy hanakona ny minisitry ny mponina tsotr&rsquo;izao ? May volon-tratra ny filoham-pirenena ary te hiseho fa mbola eo manarona ny tsy mety, manambitamby vahoaka, ary dia vory lanona tao Mahamasina ny mpitondra kanefa tsy tondra-drano, tsy hain-trano, tsy rivodoza. Teren&rsquo;ny adin-tsaina angamba dia raikitra ny fizarazana e ! Tsy hay na fifanandrifian-javatra fa taorian&rsquo;ny famoriam-bahoaka nataon&rsquo;i Marc Ravalomanana tany Mahajanga iny teny Mahamasina iny. Tsy mahaliana ny olona anefa ny filoha raha tsy misy tombontsoa ao, ka dia raikitra ny fizarazana zavatra ary re fa hitety faritra mihitsy ato ho ato. Sasanangy samy hafa anefa ny miseho. Ny an&rsquo;i Marc Ravalomanana </span></span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US;">mizara foto-kevitra hanomanana ny hoavin&rsquo;ny firenena no ataony, fanomezana tsy mahavita taona hoenti-manakona ny tsy firaharahiana ny vahoaka tao anatin&rsquo;ny 3 taona, ary hanambakana azy amin&rsquo;ny fifidianana ho avy kosa no tanjon&rsquo;ny filoha ankehitriny.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-26-1495798689.jpg');
