rid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph; text-indent: 35.4pt;"><span class="5yl5"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Fanambarana izay manameloka ny fanaovan&rsquo;ny fitondrana foibe tsinontsinona ny kaominina tamin&rsquo;ny fampiasana ny kianja mitafon&rsquo;i Mahamasina sy ny zavatra nataon&rsquo;ny HVM tao. Mila mifampidinika aloha ary mifanakalo hevitra fa tsy tonga dia manitsaka ny lalan&rsquo;ny hafa fotsiny. Naheno aho ary nahita koa avy any Mahajanga fa manampy sy manome fanomezana an&rsquo;ireo sahirana ny fanjakana. Tsy manakana ny Ben&rsquo;ny tan&agrave;na fa anjarany ny miasa miaraka amin&rsquo;ny fitondram-panjakana. Anjaran&rsquo;ny fitondram-panjakana koa ny mifampidinika aminy fa tsy manao izay saim-pantany fotsiny, raha naravona ny fanambarany.<span style="mso-spacerun: yes;">&nbsp; </span>Ny eran-tany dia mahafantatra fa tratran&rsquo;ny kere ny vahoakantsika any amin&rsquo;ny faritra Atsimo, koa maninona raha any amin&rsquo;ny faritra Atsimo aloha no mandeha ianao dia mba homena fanomezana ireo olona sahirana ireo ? Raha ny any no mba mahazo ireny sobika iray ireny dia faly izy, hoy i Marc Ravalomanana. Fa ianareo ihany koa anefa manontany anay hoe manaova raha mahavita dia ho hitantsika eo ary fa samy hanao izany. Ianareo fitondram-panjakana milaza hoe tena manao ny ara-dal&agrave;na izahay fa raha manara-dal&agrave;na tsy midika fa hanitsaka ny an&rsquo;ny hafa. Raha mahafantatra ny asa sy ny andraikitry ny kaominina amin&rsquo;ny fampandrosoana ianareo dia izy no akaiky ny vahoaka na eo amin&rsquo;ny fandriampahalemana na eo amin&rsquo;ny fanabeazana (EPP). Aza miedinedina sy mientanentana sy mihevotrevotra fa samy mahay lal&agrave;na isika ! Samy manana mpanolontsaina mpanao lal&agrave;na koa ! </span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">SARY BD Rivo</span></em></span></p>\r\n<p class="MsoNormal" style="text-al