Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;">&nbsp;Mafy ny fanakianana ka miditra amin&rsquo;ny fanaovana serasera matanjaka ny eo anivon&rsquo;ny fiadidiana ny Repoblika. Hatramin&rsquo;ny vadiny faza manomboka miseho vahoaka indray. Miha manatona ny fifidianana ary manomboka manova fomba firesaka sy fomba fiaina ny filoham-pirenena mivady. Miezaka mizarazara zavatra, manao fitsidihana etsy sy eroa, te haneho fa manao asa soa sy mitsinjo ny vahoaka. Mafy ny handao fahefana ka manovokovoka sy manakona ny laza ratsy sy ny tsy firaharahiana vahoaka. Izao vao may volon-tratra sy mamaky takotra. Tsy hay na mbola hanaiky hambakaina sy hodomina tapany handoa erany indray ny Malagasy na mba ho tonga saina amin&rsquo;izay ka tsy hanaiky hatao tohatra fiakarana intsony&nbsp;! </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; color: red;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;">&nbsp;</p>', 0, 1, 0, 'upload/17-05-26-1495798800.jpg');
