a ity. Efa mandeha koa ny ry Jean ny resaka fa andrana nataonareo fotsiny hono ireny fa mbola ho avy ny tena izy. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Aoka re ry Jean marina a ! Aleo hitsimbadika ho tsaratsara kokoa amin&rsquo;izay ny tantara e !</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco </span></strong></p>', 0, 1, 0, 'upload/17-05-26-1495798847.jpg'),
