eWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormalCxSpMiddle" style="line-height: normal;"><span style="font-size: 18.0pt;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirongatra be ny asan-dahalo sy ny vono olona ary saika isan&rsquo;andro dia misy omby very hatrany, hoy izy. Na ny omby miditra ny tsena aza dia mahagaga fa voasakan&rsquo;ny dahalo ihany koa kanefa efa misy miaramila manaraka azy. Ny omby sisa tonga eny amin&rsquo;ny tsena koa anefa dia mbola iharan&rsquo;ny kolikolin&rsquo;ireo zandary sy tompon&rsquo;andraikitra eo anivon&rsquo;ny faritra. Voatery manakatona ny tsenany ireo mpandraharaha vokatry ny tsy fandriampahalemana kanefa i Tsiroanomandidy no anisan&rsquo;ny mpamatsy omby be indrindra eto amintsika. Raha ny tokony ho izy, hoy ity mpandraharaha ity dia ny alakamisy teo no nisy omby niakatra farany teto an-drenivohitra satria izay no nifanarahanay mpihary omby raha nivory ny 13 mey teo.<span style="mso-spacerun: yes;">&nbsp; </span>Efa tsy voafehin&rsquo;ireo tompon&rsquo;andraikitra intsony moa ny toe-draharaha ka dia mitaky ny fialan&rsquo;ireo tompon&rsquo;andraikitra rehetra ao amin&rsquo;ny faritr&rsquo;i Bongolava sy ny manodidina mihitsy izy ireo. Na ny zandarimaria na ny prefektiora sy ny atitany voakasiky ny fanadiovana daholo fa manamaimbo ny ezaka ataon&rsquo;ny fitondrana, hoy izy.Milaza ny tsy hihemotra amin&rsquo;ny fanapahan-keviny ireto mpandraharaha amin&rsquo;ny omby ireto ary ny 4 jona izao no tena hiato tanteraka ny famatsiana omby ireo tsena anatiny, tafiditra ao anatin&rsquo;izany Antananarivo, raha araka ny fanazavana azo hatrany.</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija</span></strong></p>', 0, 1, 0, 'upload/17-05-29-1496044254.JPG'),
