: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Fanombohana ihany ny eto Antananarivo fa hiitatra manerana ny Nosy ny hetsika. Mizara 3 ny fanofanana. Ny voalohany dia fanamafisana an&rsquo;ilay maha antoko TIM, dia ny tanjona kendreny sy ny takiana amin&rsquo;ireo mpikambana olom-pirenena Tiako i Madagasikara. Ny faharoa dia ny fanomezana azy ireo ny tsara ho fantatra mahakasika ny raharaham-pirenena sy ny vinan&rsquo;ny antoko TIM<span style="mso-spacerun: yes;">&nbsp; </span>amin&rsquo;izao fotoana. Fahatelo ny fampandraisan&rsquo;anjaran&rsquo;izy ireo amin&rsquo;ny atrikasa izay atao mba hisy valiny andrasana aminy aorian&rsquo;ny fampiofanana. Natintranterin&rsquo;i Marc Ravalomanana ny momba ny demokrasia sy ny fampihavanam-pirenena, ka nilazany fa tena mihidy aman-trano ao ny fitondrana. Mino aho fa ho sempotra ao ireo ny farany, ity aho eto, hoy izy. Tsy mbola nisy firenena teto ambonin&rsquo;ny tany manidy varavarana toy izao ka milamina. Anjaran&rsquo;ny fitondrana no mieritreritra fa ny anay TIM, izay izaho no filoha nasionaliny, dia atao aloha ny fanofanana ireo depiote, senatera, ny Dis-TiM ny zavatra tokony harahana. Tsy maintsy miomana satria raha ny fifidianana tena izy sy mandeha amin&rsquo;ny rariny sy ny hitsiny izany, tena ho sarotra na tsy hisy mihitsy. Aiza ve ka sefo fokontany, izy ihany no nanendry azy dia io ihany no hisolotena ny CENI dia izay tiany atao eo no ataony. Amin&rsquo;ny maha antoko lehibe ny antoko TIM dia ilaina ny fampiofanana ireo mpitantana sy ny mpitarika eny anivon&rsquo;ny distrika ireny ary ny antoko TIM dia mamolavola olom-pirenena vanona sy mandray andraikitra. Ny lal&agrave;na mifehy ny antoko politika rahateo dia mitaky ny fanofanana ireo mpikambana ao aminy izay ho olom-pirenena vanona amin&rsquo;ny fotoana rehetra mihitsy, hoy kosa ny loholona Olga Ramalason.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-29-1496044326.jpg');
