am-pirenena fitsidihana tany an-toerana ny 16-18 mey teo. Fantatra fa ny 15 jona izao no hanainga eto an-tanindrazana<span style="mso-spacerun: yes;">&nbsp; </span>hihazo an&rsquo;ity toerana ity ny delegasiona Malagasy ahitana mpitantana sy teknisianina 3 ary mpilalao 7 mianadahy izay nofidian&rsquo;ireo mpanazatra avy amin&rsquo;izy 16 mianadahy nanaraka ny fampivondronana nanomboka ny 7 mey lasa teo. Ireo mpilalao 10 ambiny dia mody any amin&rsquo;ny ligy niaviany avy aloha saingy mijanona ho ekipa nasionalin&rsquo;ny Boxe manomboka eto ka hatevenin&rsquo;ireo ho tompondaka amin&rsquo;ny &ldquo;championnat national&rdquo; hatao any Mahajanga amin&rsquo;ny 20-30 aogositra 2017. Samy notoloran&rsquo;Atoa G&eacute;g&eacute; Bosco &ldquo;surv&ecirc;tement&rdquo; tsirairay avy moa na ireo handeha na ireo mijanona ary koa ireo mpanazatra sy mpitantana ao amin&rsquo;ny federasion&rsquo;ny ady totohondry. Mampanantena ny hahazo fandresena maro ka hitondra amboara aty an-tanindrazana izahay amin&rsquo;izao dia izao, hoy ny Dtn Rajosivah Simon, mba hahafahana miatrika ny &ldquo;Mondial Boxe&rdquo; hotontosaina any Hamburg Alemaina amin&rsquo;ny volana<span style="mso-spacerun: yes;">&nbsp; </span>novambra<span style="mso-spacerun: yes;">&nbsp; </span>izao.</span></p>\r\n<p class="MsoNoSpacing"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ireo mpilalao vehivavy 2 samy avy eto Analamanga</span></em></strong><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"> : </span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">-Andriamiarisoa Miora Tina (- 48 kg) </span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp;</span>-Manitra Tsiory Andr&eacute;e (-60 kg) </span></p>\r\n<p class="MsoNoSpacing"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ireo<span style="mso-spacerun: yes;">&nbsp; </span>mpilalao lehilahy 7</span></em></strong><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"> :</span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">-Analamanga 2 dia Rajaonarison Julio (- 60 kg) sy Andrianinja Nirina Aim&eacute; (-56kg), </span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">-Atsinanana 2 dia Andrianarivelo Marco Jer&ocirc;me (-52kg) sy Mahatonga C&eacute;drick (-64kg) </span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">-Matsiatra Ambony dia i Heriniaina Nomenjanahary Tony (-49kg).</span></p>\r\n<p class="MsoNoSpacing"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNoSpacing"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNoSpacing"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>', 0, 1, 0, 'upload/17-05-29-14