tra fampandoavan&rsquo;ireo hetra tsy voaefa ny avy eo anivon&rsquo;ny minisiteran&rsquo;ny hetra sy ny fadin-tseranana. Tsy mbola hiroso amin&rsquo;ny fanakatonana sy ny fanononana ny anaran&rsquo;ireo orinasa aloha mba hitsinjovana ny amin&rsquo;ny tsy hisian&rsquo;ny fahaverezan&rsquo;asa, raha ny fanazavana hatrany.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp;</span></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 0, 1, 0, 'upload/17-05-29-1496044511.jpg');
