Efa tsy hiakatra eto an-drenivohitra sy faritra maro intsony koa ny henan&rsquo;omby izay anisan&rsquo;ny mirakitra harena sy kolontsaina ary hita hatrany amin&rsquo;ny fanatontosana fomba amam-panao eto an-toerana. Mety tsy hihinam-bary sy henan&rsquo;omby intsony koa ve ao aoriana kely ao ? Dia hijanona ho vakiraoka mandrakizay koa fanampin&rsquo;izay satria na dia hatramin&rsquo;ireo fivoriana efa nalaza ho hafahafa hatry ny ela dia io fa voaray teto koa.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija</span></strong></p>', 0, 1, 0, 'upload/17-05-29-1496044560.jpg'),
