S" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Tanjon&rsquo;ny fiaraha-miasa eo amin&rsquo;ny telo tonta ny fanentanana ny vahoaka hahay hitondra tena ara-pahasalamana amin&rsquo;ny alalan&rsquo;ny fampisitrahana azy ireo ny torohevitra tsara ho fantatra sy ny fanapahan-kevitra mila raisina. Fanambin&rsquo;ny Telma Madagascar ny hanentana Malagasy 3 tapitrisa mahery hatramin&rsquo;ny faran&rsquo;ny taona 2017 amin&rsquo;ny alalan&rsquo;ny SMS (Soratra Maro Sosona). Asa tena sarotra ny fampitam-baovao ara-pahasalamana, hoy ny minisitry ny Fahasalamam-bahoaka ny profesora Mamy Lalatiana Andriamanarivo.&nbsp; Toky nomen&rsquo;ny fitondrana Malagasy tamin&rsquo;ny fanaovan-tsonia ny fanambaran&rsquo;i Abuja moa ny fanokanana ny 15%-n&rsquo;ny tetibolam-panjakana ho an&rsquo;ny sehatry ny fahasalamana manomboka ny taona 2015. Niiba hatrany anefa io vola natokana ho an&rsquo;ny fahasalaman&rsquo;ny vahoaka Malagasy io&nbsp;: 6,1% ho an&rsquo;ny tetibola 2016, 5,5% ho an&rsquo;ny 2017 ary hilatsaka 4,6% ho an&rsquo;ny taona 2018. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-fareast-language: FR;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-29-1496044779.jpg'),
