ika. Mba ahirato ny maso ry Jean dia todiho sy haraho ny vaovao hatrany atsimo ka hatrany avaratra fa aza sodokan&rsquo;ny fihetsika feno fihatsaram-belatsihy a ! Isika mody hizarana iray harona fa ny tanimbarintsika sy ny tanintsika an&rsquo;aliny hektara efa amidin-dry be kolikoly ambongadiny amin&rsquo;ny kely maso. Isika kosa mbola variana mankafy ny tsiron&rsquo;ny tapi-maso kely tsy mahavita taona, fa ny olona efa manao dom-bera any ho any ary maneso. Aza mba vendrana sy mora hambakaina ihany fa voafantsika amin&rsquo;ny kely foana ! </span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco tsy jamba</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-29-1496044850.jpg'),
