="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Nilaza mihitsy ny vondrona vaovao &ldquo;Hery ho an&rsquo;ny Fanovana&rdquo;, ahitana ny Dinika Fanavotam-Pirenena (DFP) tamin&rsquo;ny alalan&rsquo;i Tolojanahary Maharavo na Doudou fa ao anatin&rsquo;ny 10 andro no hamitana ny sata hifanarahana amin&rsquo;ny fiaraha-mitantana izay hampahafantarin&rsquo;izy ireo ny sehatra iraisam-pirenena. </span><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Sinema indray ity sa vonona amin&rsquo;ny zava-drehetra na inona na inona ataon&rsquo;ny mpitondra ireto ? Vonona amin&rsquo;ny fanonganana sy fandrodanana izao fitondrana izao ve ireo mpanao politika raha toa ka minia midingin-drambo sy tsy hanaiky lembenana amin&rsquo;ny fiaraha-mintantana ny HVM&nbsp;? Raha ny lojika politika mantsy dia tsy hanaiky lembenana ny fitondrana Rajaonarimampianina izay lany tamin&rsquo;ny fifidianana demokratika. Efa maro ihany izay nilaza handrodana ny fitondrana izay fa tsy nisy tafavoaka ary mbola resaka no betsaka. Tsy azo tsinontsinoavina kosa ny fanehoan-kevitra sy fanehoan-kery narahina fanambarana goavana tahaka ireny fa efa mety manana ny hoenti-miatrika sy manatanteraka ny tanjony izy amin&rsquo;ny fandrodanana ny mpitondra eto amin&rsquo;ny firenena&nbsp;; fandrodanana izay tsy voatery hoe hitrangana gidragidra sy poa-basy.Efa niaraha-nahita rahateo ny fanonganana ny filoha Rajaonarimampianina nataon&rsquo;ny depiote herintaona mahery lasa izay saingy ny HCC no nanavotra an&rsquo;ingahy filoha. Na ireo hery politika sy mpanao politika sokajiana ho manana ny tanjany eto amin&rsquo;ny firenena aza efa somary miandany sy mankasitraka ny fanambaran&rsquo;ity vondrona vaovao ity. Manampy trotraka ny hetsika sendikaly tombanana hirarakopana amin&rsquo;io herinandro io, izay midika fa mafampana tanteraka ny toe-draharaha.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Toky R</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 1, 1, 0, 'upload/17-05-29-1496057989.jpg'),
