enUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;Ny volana febroary 2017 teo kosa vao tena nikofokofoka ny mpitondra nangataka ny fankatoavana avy amin&rsquo;ireo firenena mpiara-miasa saingy tsy mety teraka Ambatobevohoka. Efa heno tsikelikely moa ny anaran&rsquo;ireo olona mahatoky na namana akaiky ny fitondrana eritreretina ho ambasadaoron&rsquo;ny firenena Malagasy any ivelany na tsy mbola ofisialy aza. &nbsp;Efa mazava be nandritra ny fanovana ireo mpikambana vitsy tao anatin&rsquo;ny governemanta Mahafaly Solonandrasana farany rahateo ny fanapahan-kevitry ny filohan&rsquo;ny Repoblika izay mikatona amin&rsquo;ireo hery politika voasokajy ho mpifaninana amin&rsquo;ny fifidianana hotontosaina ny taona 2018. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Olana ara-bola</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">Talohan&rsquo;ny taona 2009 nisian&rsquo;ny fanonganam-panjakana nandritra ny fitondrana Ravalomanana no nisy fanendrena ambasadaoro Malagasy farany niasa tany ivelany. Tsy afaka nanendry masoivoho noho ny tsy fankatoavana avy amin&rsquo;ny fianakaviambe iraisampirenena moa ny fitondrana tetezamita lavareny. Tsy kapoakan&rsquo;ny fitondrana Rajaonarimampianina kosa io lafiny fifandraisana ara-diplomatika io na dia mivoaka matetika any ivelany aza ny filohan&rsquo;ny Repoblika, araka ny fahitan&rsquo;ireo mpandinika ny fiainam-pirenena. Manampy trotraka ihany koa ny tetibola manify natokan&rsquo;ny minisiteran&rsquo;ny Raharaham-bahiny ho an&rsquo;ny diplaomasia sy ny fiaraha-miasa. Manodidina ny 1,5 miliara ariary hatrany mantsy izy io nanomboka ny taona 2016 hatramin&rsquo;ny taona 2019. &nbsp;&nbsp;</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: red; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">Ramano F. </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;"><span style="font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal">&nbsp;</p>', 0, 1, 0, 'upload/17-05-29-1496059335.JPG');
