false" Priority="73" SemiHidden="false"\r\n   UnhideWhenUsed="false" Name="Colorful Grid Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;a Stanislas Boriborintany faha-2 sy ny mpanolotsain&rsquo;ny tan&agrave;nan&rsquo;ny CUA Razandrindrainy Login. Ny fampivondronana an&rsquo;ireto tanora TIM ireto no tanjona voalohany, araka ny fanazavana azo teny an-toerana ary koa ny fanomanana ny fifidianana birao hitantana ity rafitra ity izay hatao atsy ho atsy. Amin&rsquo;ny mahatanora azy ireo dia nafana ny korana sy lalao teny Imerinkasinina izay nofaranana tamin&rsquo;ny fiarahana nifampizara ny nofon-kena mitam-pihavanana. Nambaran&rsquo;ny depiote Rastany fa tsy mbola nanohana mpanao politika hafa afa tsy i Marc Ravalomanana ny tenany ary tsy hoe manohana bontolo fa nahatsapa kosa fa tsy mbola nisy filoham-pirenena vonona ny nampandroso an&rsquo;i Madagasikara afa tsy io lehilahy io. &laquo;&nbsp;Havondrony ka ndao hiray hina hamerina ny filoha Ravalomanana hitantana an&rsquo;i Madagasikara indray ary lasa izao fa tsy<span style="mso-spacerun: yes;">&nbsp; </span>hipody intsony&nbsp;&raquo;, hoy izy. Nanjaka ny firaisankinan&rsquo;ny antoko TIM teny Imerinkasinina ny sabotsy teo. Tazana nanotrona teny avokoa na ny Distim 2&egrave; na ny delegen&rsquo;ny mera sy ireo lefiny na ireo mpanolotsain&rsquo;ny tan&agrave;na TIM na ireo solontenan&rsquo;ny fokontany 24 ao amin&rsquo;ity Boriborintany ity.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>', 0, 1, 0, 'upload/17-05-29-1496059452.JPG'),
(171, 27, 19, 0, '2017-05-29', 'Aleo manonofy aloha', 'edito/Aleo-manonofy-aloha-2017-05-29-171', 'Mba fahalalam-pomba angamba no mahatonga ny olona sasany mitoraka voninkazo ny fitondrana HVM misy eto Madagasikara amin’izao fotoana, fa raha hoe ny asa atao sy ny fomba fitantanana ary ny fanolorana vahaolana mahomby dia ratsy dia ratsy ny naoty.', 'Mba fahalalam-pomba angamba no mahatonga ny olona sasany mitoraka voninkazo ny fitondrana HVM misy eto Madagasikara amin’izao fotoana, fa raha hoe ny asa atao sy ny fomba fitantanana ary ny fanolorana vahaolana mahomby dia ratsy dia ratsy ny naoty.', '<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Hita hoe miezaka manazava ihany ny tompon&rsquo;andraikim-panjakana maro, anisan&rsquo;izany ny filohampirenena saingy efa lalina loatra ny hantsana, saron&rsquo;ny fahantrana sy ny fahasahiranana ny olona koa tsy manam-potoana handinihana sy handalinana izay fanazavan-kevitra ataon&rsquo;ny mpitondra intsony.Ilay izy rahateo moa 3 taona aty aoriana vao atao.Efa lasa solon&rsquo;anaran&rsquo;ny filoha ankoatr&rsquo;ilay hoe ra-evotrevotra ny hoe i Rainitelo na ilay sahy nilaza fa ho foana ao anatin&rsquo;ny 3 volana ny delestazy.Vao omaly alahady fetin&rsquo;ny reny anefa izao no nisy faritra maro teto Antananarivo no tsy nisy herinaratra nandritra ny 3 ka hatramin&rsquo;ny 7 ora.Na ahoana na ahoana fanazavana omen&rsquo;ny Jirama dia efa tsy te hahalala intsony ny olona satria leon&rsquo;ilay fampanantenana poakaty sy ny filazana fa sahirana sy mila mihafy isika kanefa ny mpitondra toa miha matavy isan&rsquo;andro ary misolo fiara isaky ny mihetsika.Famahana ny olana ara-tsosialy miaraka amin&rsquo;ny asa fanarenana ny firenena sy ny fandaminana no tontolo politika..ireo no laharampahamehana 3 goavana tokony handanian&rsquo;ny governemanta ron-doha isan&rsquo;andro sy isany.Mety ho vitan&rsquo;izy ireo ve izany sa mijanona ho nofinofin&rsquo;ny olom-pirenena manantena tsy misy fotsiny&nbsp;?</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">RTT</span></p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="true"\r\n  DefSemi