no migalabona amin&rsquo;ny harena sy ny volam-panjakana. Izay no mahatonga ny fitakiana isan-karazany. Mila manana fahefana manao izany ny fanjakana raha jerena amin&rsquo;ny resa-bola be mihodina anaty afera maloto isan-karazany ataon&rsquo;ny mpitondra. Mampiato ny asany ny Sendikan&rsquo;ny mpampianatra mpikaroka sy mpikaroka mpampianatra na ny SECES amin&rsquo;izao fotoana izao noho ny tsy fanatanterahan&rsquo;ny fanjakana ny fifanarahana sy didim-panjakana efa vita sonia ny 10 septambra 2015. Milaza ny hiroso amin&rsquo;ny fitokonana faobe izy ireo raha tsy voavaly alohan&rsquo;ny fivoriambe tsy ara-potoana ataon&rsquo;izy ireo ny 1-2 jona ny fahazoan&rsquo;izy ireo ny zony. Ny mpianatra koa mety tsy hipetra-potsiny manoloana ny fitokonan&rsquo;ny SECES. Ny fitakiana nataon&rsquo;izy ireo momba ny fampiakarana ho 100% ny vatsim-pianarana sy ny fampidinana ny saran&rsquo;ny fisoratana anarana tsy nivaly hatreto. Milaza ny hanao fitokonana mandritra ny 2 andro manomboka ny 29 mey ihany koa ny mpiasan&rsquo;ny ladoany mba hamaliana hanomezan&rsquo;ny fanjakana ny zon&rsquo;izy ireo, ary hampitomboina ho 5 andro izy io raha mbola minia be marenina ny mpitondra. Raha ny fanazavan&rsquo;ny eo anivon&rsquo;ny fadin-tseranana anefa dia 5 miliara ariary eo ho eo ao anatin&rsquo;ny iray andro ny fampidiram-bolany. Hisy fiantraikany lehibe amin&rsquo;ny fampidiram-bola ao anatin&rsquo;ny kitapombolam-panjakana izany satria 10 miliara no ho very mandritra ny hetsika ary ho tonga 25 miliara ariary raha mitohy ho 5 andro. Miraviravy tanana anefa ny fitondrana ary mamono afo amin&rsquo;ny fanaovana hetsika sosialy raha dinihina amin&rsquo;ny fihetsiky ny filoha.</span></span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span class="5yl5"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-29-1496059661.jpg'),
