ang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Hitako mihitsy i Jean Fidikely sy ny madamanareo nitety faritra dia mody hoe fetin&rsquo;ny reny, hono, kanefa toy ilay amin&rsquo;ny herintaona angamba no tena tsinjovina e ! Na i Jean be koa aza kay nanao ilay fikanareo amin&rsquo;izay na dia nanakiana aza teo aloha teo.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco </span></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-29-1496059896.jpg');
