ine-height: normal;"><span lang="EN-US" style="font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">. Toromarika no nomen&rsquo;ny filohan&rsquo;ny Fjkm ny mpitandrina Irako Andriamahasozoa Ammi nandritra ny toriteniny dia ny hoe : &ldquo;mias&agrave; ianareo amin&rsquo;ny fifaliana sy ny fitiavana, mias&agrave; amin&rsquo;ny fahazavan-tsaina sy ny fahendrena, mias&agrave; amin&rsquo;ny finoana sy fanantenana. Ny teny tao amin&rsquo;ny Timoty II 1,8 manao hoe : &ldquo;koa aza menatra ho vavolombelon&rsquo;ny Tompontsika&rdquo; no lohahevitra nitantanana ity fanompoam-pivavahana omaly teny Faravohitra ity. Nanentana ny mpino Kristianina Fjkm rehetra kosa i Marc Ravalomanana mba hifanampy sy hifanome tanana, hifampitondra am-bavaka satria goavana ny asa atrehana. Mila manam-pitiavana isika manao asa, hoy izy miasa am-pitiavana fa tsy sanatria an-katerena ary hombam-bavaka isan&rsquo;andro. Aoka tsy ho menatra fa tena ho vavolombelon&rsquo;i Kristy tokoa ary tena mijoro amin&rsquo;ny maha Fjkm, hoy hatrany i Marc Ravalomanana. Ny mpitandrina Andriamasinoro Fidimalala no nitarika ny fotoana teny Faravohitra io omaly io. Tsara homarihana ihany koa fa ny 18,19 ary 20 aogositra izao no fanokafana amin&rsquo;ny fomba ofisialy any Antsiranana<span style="mso-spacerun: yes;">&nbsp; </span>ny jobily faha-50 taonan&rsquo;ny Fjkm.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: normal;"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: FR;">RTT</span></p>', 0, 1, 0, 'upload/17-05-29-1496060283.jpg'),
