pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp; Mitady finiavana hamaha olana izahay, hoy ny filohan&rsquo;ny sendika (Sempidou), Herizo Andrianavalona mba tsy hiitaran&rsquo;ny fitokonana. Hisy moa ny fifanatonana amin&rsquo;ny tompon&rsquo;andraikitry ny minisitera anio hijerena ny fomba fandoavana azy ity. Hiato kosa ny fitokonana rahampitso. Mitohy ny alakamisy ka hatramin&rsquo;ny alatsinainy, raha tsy misy ny vahaolana. Fepetra hafa no hiraisina aorian&rsquo;io raha tsy mbola mahafa-po ny fandehan&rsquo;ny rraharaha. Marihina fa mitentina 5 miliara ariary isan&rsquo;andro ny vola ampidirin&rsquo;ity sampandraharaha ity amin&rsquo;ny kitapom-bolam-panjakana ary anisan&rsquo;ny mandray anjara amin&rsquo;ny fandoavana ny karaman&rsquo;ny mpiasam-panjakana sy fampandehanan-draharaha amin&rsquo;ny ankapobeny izy.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mirija</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">L&eacute;gende: Fitokonana tetsy Antaninarenina omaly</span></p>', 0, 1, 0, 'upload/17-05-31-1496212556.JPG');
