zay manao ny asa rehetra, hoy Rtoa Tsaboto Joslina, mpandrindra nasionaly ny tendro sy ny masoivoho CNaPS. Zo fototra ary<span style="mso-spacerun: yes;">&nbsp; </span>tafiditra ao anatin&rsquo;ny fanambarana maneran-tany momba ny zon&rsquo;olombelona ny fiahiana ara-tsosialy. Mbola ambany anefa ny tahan&rsquo;ny misitraka izany eto Madagasikara, indrindra fa ireo miasa eo amin&rsquo;ny sehatra tsy miankina na dia efa misy<span style="mso-spacerun: yes;">&nbsp; </span>aza ny CNaPS,<span style="mso-spacerun: yes;">&nbsp; </span>izay didin&rsquo;ny lal&agrave;na fa misahana izany eto Madagasikara. Izany indrindra no antony nahatonga ny CNaPS nanentana ny mpitsara sy mpisolovava, ny mpitarika fikambanana, ny mpiasa sy mpampiasa, ny sendikalista, ary ny mpanao gazety hiara-misalahy amin&rsquo;ny fampanjakana ny fiahiana ara-tsosialy tsy miangatra eto Madagasikara, hoy Rakotondradano Hanitry ny Aina izay mpandrindra ny tetikasa eo anivon&rsquo;ny CNaPS foibe. Nandritra ny roa andro dia nofanina momba ny CNaPS sy ny asany ary ny maha zava-dehibe amin&rsquo;ny fananan&rsquo;ny mpiasa ny zo ara-tsosialy sy ny adidin&rsquo;ny mpampiasa izay tsy maintsy efaina izy ireo, ka nahatratra 166 ireo mpiofana. Fa nisy ihany koa ny tantsoroka sy tolo-kevitra nataon&rsquo;ny ekipan&rsquo;ny CNaPS tamin&rsquo;ireo orinasa sasany nila izany. Tafatsangana any Nosy Be ihany koa ny &ldquo;Club CNaPS Zandriolona&rdquo; izay ao amin&rsquo;ny Lyc&eacute;e Mixte no misy azy, ka mpianatra miisa 150 ao amin&rsquo;ny kilasy faharoa no voahosotra ho &ldquo;Club CNaPS Zandriolona&rdquo;, ka miisa 5 ireo mpanabe mikarakara ireo ankizy ireo.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-31-1496212673.JPG'),
