 an-dapa any momba ny tsindry bokotra isan-karazany ataony amin&rsquo;ny resaka fanalana na fanendrena olom-panjakana ambony eto amin&rsquo;ny firenena. Efa niteraka resabe teto amin&rsquo;ny firenena io tamin&rsquo;ny fanesorana an&rsquo;i Jean Ravelonarivo sy ny fanendrena an&rsquo;i Solonandrasana Mahafaly izay voalaza fa anisan&rsquo;ireo namana akaikin-dRamatoa Voahangy R. Milalao ny seraserany izy amin&rsquo;izao fotoana izao ary tsy ahoany intsony ny kiana isan-karazany sy ny firesahana momba ny fiainany manokana, fa dia avelany hiteny izay miteny, miezaka hatrany kosa ny tenany maka ny fon&rsquo;ny olona. </span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Samy nandrasan&rsquo;ny maro, ohatra, ny tohin&rsquo;ilay resaka nivoaka tamin&rsquo;ny gazety iray izay niresaka manokana momba azy ka niresahan&rsquo;io gazety io sy nametrahany fanontaniana momba ny fampirafesana nataon&rsquo;ny vadin&rsquo;ny filoham-pirenena. Sady tsy nanamarin-tena no tsy nandiso na koa nanenjika io orinasan-tserasera io i Voahangy Rajaonarimampianina, ka dia nangina ho azy ny resaka. Any amin&rsquo;ny politika sy asa sosialy izy no miezaka manarona ireny kiana isan-karazany nahazo azy ireny raha ny fahitana azy. Tsikaritra ho tsy mahatoky ny vadiny amin&rsquo;ny resaka politika, indrindra ny fanomanana ny fifidianana 2018 izy, ka miditra an-tsehatra mihitsy amin&rsquo;ny fanarenana sy fanadiovana ny filoham-pirenena mba hitiavan&rsquo;ny vahoaka azy sy hampandaniana indray ny filoha am-perinasa amin&rsquo;ny fifidianana. Nalaza tsy tamana teto Madagasikara intsony ny vadin&rsquo;ny filoha teo aloha. Tsy izay intsony no miseho fa efa miezaka mametra-tena ho olon&rsquo;ny fiarahamonina sy mitakosona amin&rsquo;ny vahoaka, mpizara sakafo ho an&rsquo;ny mahantra, mpitsidika sy mpiaro ny zon&rsquo;ny voafonja izy. Ny kabary tsara rindra hakana ny fon&rsquo;ny reny sy ny vahoaka nandritra ny fetin&rsquo;ny reny teo moa dia manaporofo fa renin&rsquo;ny Malagasy tokoa izy. Mendri-piderana ny fihetsika toy izany ary fitaratra ho an&rsquo;ny vadina manampahefana rehetra raha amin&rsquo;ny hitsim-po tokoa fa tsy mifono ambadika politika, ka tratry ny hoe domina tapany handoa erany eto indray ny vahoaka Malagasy, izay mora hambakaina sy mora fitahina.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">&nbsp;</span></p>', 1, 1, 0, 'upload/17-05-31-1496218048.jpg'),
(182, 28, 17, 0, '2017-05-30', 'Samy be tsaho !', 'taratasy-ho-ani-jean/Samy-be-tsaho--2017-05-30-182', 'Dia mihomehy irery mihitsy aho ry Jean mandinika anao miala bala sy mamafa ny zavatra nambaranao taloha. Ilay resaka telo volana indray no horesahiko eto ry Jea fa sao ianao gaga a !', 'Dia mihomehy irery mihitsy aho ry Jean mandinika anao miala bala sy mamafa ny zavatra nambaranao taloha. Ilay resaka telo volana indray no horesahiko eto ry Jea fa sao ianao gaga a !', '<!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>FR</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n   <w:UseFELayout/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"/>\r\n   <m:brkBin m:val="before"/>\r\n   <m:brkBinSub m:val="&#45;-"/>\r\n   <m:smallFrac m:val="off"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val="0"/>\r\n   <m:rMargin m:val="0"/>\r\n   <m:defJc m:val="centerGroup"/>\r\n   <m:wrapIndent m:val="1440"/>\r\n   <m:intLim m:val="subSup"/>\r\n   <m:naryLim m:val="undOvr"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]-->\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;Sahinao mihitsy mantsy no miteny indray ankehitriny fa aleo tsy maika tsy faingana a ! Atsipinao any amin-dry menasofina indray ny rihitra hoe mila voatsiary sy tsy manome drala. Fa ianao ve mamo sa naninona no sahy niteny an&rsquo;iny hoe telo volana iny ? Valala tsy an-tanana tsy hatolo-jaza fa ny anao kosa efa tena hafa mihitsy a ! Tsy omeko tsiny r&rsquo;ise ilay akama iray raha lasalasa ny vavany nanao fampitahana tamin&rsquo;ny teny nataon&rsquo;ise sy ilay fanelezana tsaho hoe nirodana ny tonelina iray eto Iarivo. Avy hatrany dia nosamborina tsy nisy hatak&rsquo;andro ary dia mialokaloka eny Ambaniatsinana izy. Ary inona moa izany no azo ilazanao ilay nataonao <span style="mso-spacerun: yes;">&nbsp;</span>? Moa va tsy toy ny nilaza abobo sy atsanga tsy aman&rsquo;orana ihany va ianao ? Mahery aloha ianao sy ny akamanao fa tsy mba bedy raha mamafy laingy sy manely tsaho e ! Efa tsara karakara ihany tokoa angamba ry bebaoty ka tsipazana kely dia tsy sahy mikitika anareo efa andrarezin&rsquo;ny famafazan-dainga sy aferafera ? Ny alika tokoa jamban&rsquo;ny taolana fa raolombelona jamban&rsquo;ny drala ka tsy atao mahagaga e !</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Marco</span></em></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<!-- [if gte mso 9]><xml>\r\n <w:LatentStyles DefLocked