serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Tamin&rsquo;ny 6 ora maraina dia efa rakotra mpiadina tao amin&rsquo;ity kianja iray ity, natrehin&rsquo;ny ray aman-dreny sy ny namana. Tamin&rsquo;ny 7 ora kosa no nanomboka ny adina. Tovovavy mpiadina iray no naratra rehefa nanatanteraka ilay hazakazaka lavitr&rsquo;ezaka 100 metatra raha tovovavy iray ihany koa no bevohoka ka <span style="mso-spacerun: yes;">&nbsp;</span>navadiky ny tompon&rsquo;andraikitra hanatevin-daharana ireo mpanao teoria avy hatrany. Araka ny fanadihadiana natao dia mahatratra 74.550 ny isan&rsquo;ireo mpiadina voasoratra anarana hiatrika ity adina ara-panatanjahantena Bakal&ocirc;rea ity ho an&rsquo;ny eto an-drenivohitra. Miparitaka amina foibem-panadinana miisa dimy izy ireo ary kianja lehibe miisa efatra kosa no mandray azy. Hatramin&rsquo;ny omaly folakandro dia nahatratra enina ireo mpiadina tsy tonga tetsy amin&rsquo;ny kianjaben&rsquo;i Mahamasina izay fantatra fa mbola azo<span style="mso-spacerun: yes;">&nbsp; </span>raisina ihany raha mitondra taratasy fanamarinana avy amin&rsquo;ny dokotera na antony hafa toy ny tsy fahazoany ny taratasy fiantsoana ara-potoana. <span style="mso-spacerun: yes;">&nbsp;</span>Tsiahivina fa tsy misy ahiana ny momba io tovovavy mpiadina iray naratra io. Efa noraisin&rsquo;ny dokotera an-tanana rahateo ny fikarakarana azy.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">Legende : Nandritra ny fifaninanana </span></em></p>', 0, 1, 0, 'upload/17-05-31-1496218690.jpg'),
