t; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Akory anefa ny hagagan&rsquo;ireo olona tonga maraina mba hanatanjantena fa tsy avelan&rsquo;ireo mpiambina ny vavahady hiditra izy ireo. Nahazo baiko avy amina tompon&rsquo;andraikitra iray ao amin&rsquo;ny kaominina tsy hanokatra ny vavahady fidirana ry zareo raha tsy amin&rsquo;ny 5 ora sy 30 maraina. Raha izany dia mazava fa tena misy olona sahy manohitra ny didy navoakan-dRtoa Ben&rsquo;ny tan&agrave;na izay tompon&rsquo;andraikitra voalohany eto amin&rsquo;ny tan&agrave;nan&rsquo;i Iarivo eo amin&rsquo;ny fandaminana ny kaominina tantaniny.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Rabri</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red;">&nbsp;</span></em></strong></p>', 0, 1, 0, 'upload/17-05-31-1496221485.JPG');
