dy hifanakalozan-kevitra sahady ihany koa ny mikasika ny rafitra Force de changement. Zava-dehibe io sata io, hoy ny mpikarakara, Tolojanahary Maharavo, fa tsy ilaintsika ny fitsarana avo (Haute cour de justice) izay tsy hisy sahy hanangana na oviana izany. Ao anatin&rsquo;io sata io, hoy izy, no hametrahana ny tanjona amin&rsquo;ny fitantanana sy ny velirano mikasika ny tsy azo atao rehetra mba ho amin&rsquo;izay fotoana izay raha mibirioka ny mpitondra dia hosazian&rsquo;ny lal&agrave;na velona.</span></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Mirija </span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-31-1496239082.JPG'),
