nao antso avo amin&rsquo;ny mpitondra mba hanome laharam-pahamehana io kitro ifaharan&rsquo;ny fampandrosoam-pirenena io. Raha tsy manana vina ny mpitondra dia horebireben&rsquo;ny hery avy any ivelany hatrany. Miantso ny rehetra mba hanome laharam-pahamehana ny tombontsoam-pirenena aloha vao ny an&rsquo;ny any ivelany. Omaly moa dia nanao dinika mikato-trano teny Ankatso ireo mpampianatra mpikaroka mivondrona ao anatin&rsquo;ny Seces mba hifampita vaovao sy nidinika mikasika ny tohin&rsquo;ny hetsik&rsquo;izy ireo.</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Mirija</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-05-31-1496239196.jpg');
