N-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Efa nahazo ny toromarika ny amin&rsquo;izany ireo ministera rehetra voakasika anisan&rsquo;izany ny minisiteran&rsquo;ny fampianarana ambony noho ny fihetsiketsehana nataon&rsquo;ny mpianatra, niitatra tany amin&rsquo;ny mpampianatra mpikaroka avy eo. Fa eo ihany koa ny minisiteran&rsquo;ny vola sy ny tetibola izay miahy ny fadin-tseranana izay niditra tamina fitokonana ihany koa tamin&rsquo;ity herinandro ity. Fa noresahana maharitra teny Mahazoarivo koa omaly ny resaka fitandroana ny filaminana sy ny fandriampahalemana. Nilatsaka ny didy&nbsp;ary tsy azo atao ny mivorivory sy manao fihetsiketsehana an-dalambe amin&rsquo;ity volana jona ity, izany dia mba ho fitandroana ny filaminana noho ny fanamarihana ny faha 57 taona niverenan&rsquo;ny fahaleovantena.Nahazo io baiko hentitra ion y manampahefana isan-tsokajiny, indrindra fa ny eto Antananarivo ary mampihatra avy hatrany ny lal&agrave;na.Misy ny tsilintsofina re fa toa hoe manam-baovao momba an&rsquo;ireo olona mikasa ny hidina an-dalambe hanao fitakiana ny fitondram-panjakana ka ny azy no nalefany aloha. Manomboka mafana rahateo ny toe-draharaha politika ary totoafo ny fanakianana ny fitondrana. Etsy an-kilany, efa tsikaritra manambatra hery ireo sokajiana ho mpanohitra ary mivory isaky ny mihestika mametraka paikady.Tsy misy izany eto ny indra-fo fa hisambotra avy hatrany ny mpitandro filaminana raha misy ireo midina an-dalambe, raha ity fanapahan-kevitry ny governemanta ity no jerena, fihetsika izay efa miendrika didy jadona.Vao afak&rsquo;omaly rahateo no nanizingizina ny antoko HVM fa matanjaka sy mahavita azy, izany hoe tsy mila ny hafa ary tsy mila sembatsembanana amin&rsquo;ny zavatra ataony.Andrasana izay ho fihetsik&rsquo;ireo mpanohitra ny fitondrana. Hifitsaka ve satria matahotra fisamborana sa ho sahy hihetsika ihany ?</span></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">RTT</span></p>', 1, 1, 0, 'upload/17-05-31-1496239534.JPG'),
