rsquo;ny faramparan&rsquo;ny &laquo;&nbsp;mandat&nbsp;&raquo; an&rsquo;izy ireo dia ho sahy hanala &laquo;&nbsp;traite&nbsp;&raquo; 4 x 4 an-tapitrisany ireto depiote eny Tsimbazaza ireto. Mandeha ny feo eny an-toerana ankehitriny fa misy firesadresahana tamin&rsquo;ireo<span style="mso-spacerun: yes;">&nbsp; </span>depiote tsy an-kanavaka na amin&rsquo;ny vondrona parlemantera inona na avy amin&rsquo;ny antoko inona, ny hanomezana azy ireo an&rsquo;io 4 x 4 io rehefa manaiky fa hanohana ny kandid&agrave;m-pitondrana Hery Rajaonarimampianina amin&rsquo;ny fifidianana hatao amin&rsquo;ny taona 2018. Heno koa etsy an-kilan&rsquo;izay fa matoa tsy tohizana ny fanamboarana ny lalam-baovao natao tamin&rsquo;ny Frankofonia mivoaka etsy 67 ha iny na dia efa hiaraha-mahita aza ny hafitsoky ny amboteazy eto an-drenivohitra, dia satria tafiditra ao anatin&rsquo;ny kajikajy ho famalifaliana ny vahoaka hifidy an&rsquo;ity kandid&agrave; ity ihany amin&rsquo;io taona 2018 izany ka tsy hokitihana intsony raha tsy tonga ny fotoanan&rsquo;ny fampielazan-kevitra amin&rsquo;io taona io.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';">Rabri</span></strong></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">4 x 4 Mazda BT 50 efa misy &laquo;&nbsp;cocarde&nbsp;&raquo; miantsona eny Tsimbazaza</span></em></strong></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-31-1496239650.JPG');
