iority="19" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="21" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"/>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"/>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"/>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Tableau Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;Naneho ny heviny mahakasika izany Raharinaivo Falimanana, <span style="mso-spacerun: yes;">&nbsp;</span>talen&rsquo;ny sekoly tsy miankina Sedera eny Amboniloha omaly. Nambarany fa ho azy ireo, sekoly tsy miankina izay eo ambany fiahian&rsquo;ny fiangonana FJKM dia tena mety aminy tokoa ity lal&agrave;na napetraky ny minisiteran&rsquo;ny Fanabeazam-pirenena ity. Ho azy ireo mantsy dia tsy mihoatra ora efatra isan-kerinandro akory ny<span style="mso-spacerun: yes;">&nbsp; </span>fampianarana finoana ho an&rsquo;ny mpianatra izay tsy hanereny velively ireo mpianatra avy amin&rsquo;ny finoana hafa tonga mandrato fianarana ao aminy. Mikasika ny fanomanana ny fanadinana fifindran-kilasy sy ny fanadinam-panjakana manokana dia nomarihin-dRaharinaivo Falimanana talen&rsquo;ny sekoly Sedera fa efa hatramin&rsquo;ny ela izy ireo no niomana tamin&rsquo;izany ka tsy dia misy loatra ny olana. Vao any amin&rsquo;ny kilasy ambany ny mpianatra dia efa omanina hiatrika fanadinana.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Legende : Raharinaivo Falimanana, talen&rsquo;ny sekoly sedera eny Amboniloha eo ambany fiahian&rsquo;ny fiangonana FJKM </span></em></p>', 0, 1, 0, 'upload/17-05-31-1496239859.JPG');
