y fanjakana HVM, kanefa ny filoha Hery Rajaonarimampianina mihitsy no nilaza tany am-piandohana fa handray an-tanana ny fampihavanam-pirenena. </span><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mandra-pahoviana no hanidy trano samirery ao sy hihevi-tena ho mafy sy matanjaka ? Ekena fa misy ny mandray an-tendrony ny fampihavanam-pirenena ho fitadiavan-tseza saingy ny mila mifanaraka tsara ny rehetra amin&rsquo;ny fampihavanana tokony hapetraka. Tsy mitondra mankaiza ny fanidiana trano sy ny tsy firaharahaina ny hevitry ny hafa, ary maro no nilaza ho mafy sy matanjaka teto amin&rsquo;ny firenena saingy misy fetrany ny zava-drehetra. Dia tena tsy vonon-kihavana tsotr&rsquo;izao mihitsy ve ka ny hambom-po diso toerana no mibaiko amin&rsquo;ny fitantanana ny firenena, izay efa tena latsaka any anaty lavaka mangitsokitsoky ny fahantrana ?</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-05-31-1496239963.jpg'),
