na ho an&rsquo;ny Ben&rsquo;ny tan&agrave;na izay nambarany fa mbola tsy tonga akory raha efa haelin&rsquo;ny sasany sahady ny tsaho fa efa mandehandeha any ary efa nanaovana fampielezan-kevitra.<span style="mso-spacerun: yes;">&nbsp; </span>Renivohitr&rsquo;i Madagasikara ny kaominina Antananarivo hoy izy ka moa tsy mendrika ny hanana fiara ve ny Ben&rsquo;ny tan&agrave;na Lalao Ravalomanana izay tsy ho entiny hanaraka azy rehefa tsy Ben&rsquo;ny tan&agrave;na intsony izy fa azon&rsquo;ny hafa dimbiasana. Efa nahazoana alalana ihany koa ny fividianana io fiara io hoy hatrany Andriamorasata Julien ary ny orinasa Toyota no nahazo ny tolo-bidy. Tsy maintsy hividy fiara ho an&rsquo;ny Ben&rsquo;ny tan&agrave;na ny kaominina noho izany hoy hatrany ary tsy hahantra mandrakizay noho izany tokony ho faly aza ireo mpanolon-tsain&rsquo;ny tan&agrave;na sasany. Tsy adinony ihany koa ny nanazava momba ny prime omena ireo mpiasa mivondrona ao amin&rsquo;ny sendika nandritra izany. Tsy maintsy omena prime ny mpiasa hoy<span style="mso-spacerun: yes;">&nbsp; </span>Julien Andriamorasata saingy <span style="mso-spacerun: yes;">&nbsp;</span>iray volana ihany no azo hatao na ilay antsoina hoe : faha-13-n&rsquo;ny volana satria tsy misy maneran-tany izany fanomezana mpiasa faha-13 sy faha-14-n&rsquo;ny volana izany.<span style="mso-spacerun: yes;">&nbsp; </span>Nomarihiny moa fa na dia mivory miaraka amin&rsquo;ny mpanohitra hatrany aza ireo sendikan&rsquo;ny mpiasa dia vonona ny hikarakara azy ireo hatrany ny kaominina. Farany izay tsy kely dia nasian&rsquo;ity lefitra faharoan&rsquo;ny Ben&rsquo;ny tan&agrave;nan&rsquo;Antananarivo ity resaka ihany koa ny mikasika ny fanadihadiana lalina ( inspection) izay hampitahorana azy ireo matetika. Ataovy izany hoy Julien Andriamorasata ary hatomboy nanomboka tamin&rsquo;ny andron&rsquo;ny tetezamita ahitana taratra izay tena mampihatra ny fanjakana tsara tantana. Tsy matahotra izany ny kaominina Antananarivo renivohitra hoy hatrany izy noho izany aoka mba samy hifanaja. Notsiahiviny moa fa nahatratra 40 miliara Ar ny trosa nobaben&rsquo;ny kaominina tamin&rsquo;ny andron&rsquo;ny tetezamita izay mbola misy fiantraikany amin&rsquo;izy ireo hatrany mandraka ankehitriny.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-06-01-1496319588.JPG');
