 ary ankehitriny fa may ny endim-boanjon&rsquo;ny filoha, ary tsapa amin&rsquo;ny zavatra ataony fa maka tahaka sady te hanindry mafy an&rsquo;i Marc Ravalomanana izy. Mitety faritra i Marc Ravalomanana dia manaraka ihany koa ny filoha Rajaonarimampianina. Ilay fihetsika fanaon&rsquo;i Marc Ravalomanana tsy mihafahafa amin&rsquo;ny fitakosinana amin&rsquo;ny vahoaka aza moa dia ezahina mihitsy ny manao &ldquo;kopikole&rdquo; azy, raha tsy hilaza afatsy ny fihetsiny tany Mahajanga nitsidika tsena sy niresaka tamin&rsquo;ny olona teny an-dalambe. Nanao fitsidihana tany ivelany indray i Marc Ravalomanana ka anisan&rsquo;izany ny tany Alemaina sy Pays Bas narahana fihaonana sy ny fifanakalozan-kevitra amin&rsquo;ireo teratany Malagasy mila ravinahitra any ivelany, toy ny nataony tany Frantsa, Etazonia&hellip; dia mba lasa any Alemaina ihany koa ingahy filoha, ary hamory ireo teratany Malagasy mila ravinahitra any an-toerana. Hararaotina ny resaka fanasan&rsquo;ny ny solombavambahoakan&rsquo;ny Repoblika federalin&rsquo;iAlemaina dia ny Bundestag mba hahafahana mamboatra ny ho avy politika sy toa hampisehoana amin&rsquo;i Marc Ravalomanana fa tsy izy irery ihany no afaka mankany ivelany sy mifampiraharaha amin&rsquo;ny vahiny. Ilay fandaharana isan-kerinandro fotoam-bita amin&rsquo;izao fotoana moa dia fandikana tsotra izao ny fandaharana &ldquo;Ny tenin&rsquo;ny filohampirenena&rdquo; nataon&rsquo;i Marc Ravalomanana isaky ny alahady amin&rsquo;ny 6 ora hariva tao amin&rsquo;ny RNM, folo taona lasa izay.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></p>\r\n<p class="MsoNormal" style="text-align: justify; text-justify: inter-ideograph;"><strong style="mso-bidi-font-weight: normal;"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Toky R</span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 16.0pt; line-height: 115%;">&nbsp;</span></p>', 0, 1, 0, 'upload/17-06-01-1496319680.jpg'),
