o manokana dia efa tsy izy intsony io fitondrana misy ankehitriny eto amintsika io, nefa miankina amin&rsquo;ireo solombavambahoaka rehetra ny fanapahan-kevitra ny amin&rsquo;izany zavatra anontanianareo izany&nbsp;&raquo;. Raha ny fihainoako ny tatitra natomboka nataon&rsquo;ny praiminisitra teo indray izay mbola hotohizan&rsquo;ireo minisitra samihafa ao amin&rsquo;ny governemanta tarihany dia horonantsary na &laquo;&nbsp;film&nbsp;&raquo; efa nandeha lava no henoko tao ka naleoko nivoaka miandry ny anjara fandraisam-pitenenana<span style="mso-spacerun: yes;">&nbsp; </span>hataoko vao miverina ao an-dapa ao aho fa mbola depiote maromaro ihany moa no eo anoloako. </span></strong></p>\r\n<p class="MsoNormal"><strong><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Ntsoavina Evariste</span></strong></p>\r\n<p class="MsoNormal"><strong><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; color: red; mso-ansi-language: EN-US;">&nbsp;</span></em></strong></p>', 0, 1, 0, 'upload/17-06-01-1496319751.JPG');
