uo;ny antenimieram-pirenena eny Tsimbazaza ihany omaly ny tarehimarika sasantsasany milaza fa fotodrafitrasa nahatratra 300 no vita mikasika ny resaka tetikasa fitsinjaram-pahefana eny anivon&rsquo;ireo kaominina. Vola mitentina 2,50 miliara ariary, hoy ny tatitra, no lany nanamboarana lalankely sy trano fivoahana saingy ireo depiote izay nanontaniana anefa saika nitatitra avokoa fa tsy naheno ny akon&rsquo;izany tamin&rsquo;ireo vahoakany. Mbola politika tokoa ve ilay atao sa tapi-maso ?</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; mso-ansi-language: EN-US;">Mirija </span></strong></p>', 0, 1, 0, 'upload/17-06-01-1496319848.JPG'),
