><span lang="EN-US" style="font-size: 16.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></p>\r\n<p class="MsoNormal"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;"><span style="mso-spacerun: yes;">&nbsp;</span>Amin&rsquo;ny ankapobeny mantsy dia tsy afaka mampiana-janaka araka ny tokony ho izy intsony ireo Ray aman-dReny miaina eny ambanivohitra noho ny tsy fahampian&rsquo;ny ho enti-manana. Ny fikambanana WTDM <span style="mso-spacerun: yes;">&nbsp;</span>avy any Angletera no nanolo-tanana ny kaominina tamin&rsquo;izany. Zezika, masomboly, siny, angady ary ranom-panafody famonoana bibikely no natolotra azy ireo tamin&rsquo;izany ka ray aman-dreny miisa 100 no nahazo tombontsoa. Tanjona raha araka ny fanazavan&rsquo;ny Ben&rsquo;ny tan&agrave;na Alain Ratsimbazafy ny mba hahafahana manohana ara-pitaovana ireo ray aman-dreny ireo<span style="mso-spacerun: yes;">&nbsp; </span>entina hanatsarana ny asa fambolena sy fiompiana sahaniny, ho fitsinjovana ireo kilonga madinika. Mbola hitohy any amin&rsquo;ny fokontany hafa ny hetsika.</span></p>\r\n<p class="MsoNormal"><strong style="mso-bidi-font-weight: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">Pati</span></strong></p>\r\n<p class="MsoNormal"><em style="mso-bidi-font-style: normal;"><span lang="EN-US" style="font-size: 16.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;">&nbsp;</span></em></p>', 0, 1, 0, 'upload/17-06-01-1496320004.jpg');

