(1, '2017-03-12', '23:00:00', 'Tsy nandeha ny jiro  androany tontolo teto an-tanana', 'Tsy nandeha ny jiro  androany tontolo teto an-tanana', 0),
(2, '2017-03-22', '16:30:00', ' Fanabeazana: Nilaza ny Minisitry ny fanabeazam-pirenena Paul Rabary androany fa tsy hisy intsony ny fanomezana...', ' Fanabeazana: Nilaza ny Minisitry ny fanabeazam-pirenena Paul Rabary androany fa tsy hisy intsony ny fanomezana fahazoan-dàlana hampianatra na "Attestation d\'Enseingner" (AE), fa tsy maintsy manaraka fiofanana avokoa ireo te hahazo izany.', 0),
(3, '2017-03-23', '16:00:00', ' Fampihavanam-pirenena: Andrasana ny fanendrena ireo olona 9 handrafitra ny komity hifantina ireo mpikambana eo anivon\'ny Filan-kevitry ny Fampihavanana Malagasy (FFM). Manana 75 andro izy ireo hifantenana ireo mpikambana 22 ...', ' Fampihavanam-pirenena: Andrasana ny fanendrena ireo olona 9 handrafitra ny komity hifantina ireo mpikambana eo anivon\'ny Filan-kevitry ny Fampihavanana Malagasy (FFM). Manana 75 andro izy ireo hifantenana ireo mpikambana 22, izay hakana iray avy isaky ny faritra. Ny filoham-pirenena no hanendry ny 11 ka hahatonga ireo mpikambana ho 33. Ho rava kosa ny komity mpifantina rehefa voarafitra ny FFM.', 0),
(4, '2017-03-23', '15:03:00', 'Antsirabe _Fitsaram-bahoaka: Vehivavy iray tokony ho 50 taona no matin’ny fitsaram-bahoaka omaly. Mpitari-posy iray naka aina no saika haroniny ny vavany...', 'Antsirabe _Fitsaram-bahoaka: Vehivavy iray tokony ho 50 taona no matin’ny fitsaram-bahoaka omaly. Mpitari-posy iray naka aina no saika haroniny ny vavany. Efa fanaon’ity ramatoa ity ny mangarom-bava, ka izay rehetra tratrany dia maty avokoa izay tratrany.', 0),
(5, '2017-03-23', '12:00:00', 'Ladoany: Namoaka ny tatitra momba ny fampidiram-bolany ho sampan-draharahan\'ny fadin-tseranana ka 306,2 miliara ariary...', 'Ladoany: Namoaka ny tatitra momba ny fampidiram-bolany ho sampan-draharahan\'ny fadin-tseranana ka 306,2 miliara ariary izany tao anatin\'ny roa volana voalohan\'ity taona 2017 ity.', 0),
(6, '2017-04-03', '17:30:00', ' Herisetra natao tamina mpianatra _Naneho hevitra ny Minisitra Paul Rabary: Nanao fanambarana tamin\'ny alalan\'ny tambajotra ara-tsosialy ny Minisitry ...', ' Herisetra natao tamina mpianatra _Naneho hevitra ny Minisitra Paul Rabary: Nanao fanambarana tamin\'ny alalan\'ny tambajotra ara-tsosialy ny Minisitry fanabeazam-pirenena, ka nilaza fa tsy rariny ary tsy azo ekena intsony ny fikasihan-tànana ny ankizy manoloana ny herisetra nihatra tamin\'ny mpianatra niseho tao amin\'ny Kolejy La croyance eny Anjanahary androany. Handray fanapahan-kevitra ny Minisitera ka na tsoahana ny fahazoan-dàlana fisokafan\'ny sekoly na hotsoahana ny taratasy fahazoan-dàlan\'ny mampianatra an\'ilay mpampianatra nanao herisetra.', 1),
(7, '2017-05-06', '09:20:00', '\r\n\r\n Polisim-pirenena: Hampitomboina ho 1150 ireo mpianatra ho polisy ho raisina amin\'ity taona ity. Ny 10 jona no fara fisoratana anarana sy fandrais...', '\r\n\r\n Polisim-pirenena: Hampitomboina ho 1150 ireo mpianatra ho polisy ho raisina amin\'ity taona ity. Ny 10 jona no fara fisoratana anarana sy fandraisana ny antontan-taratasy ho an\'ireo tanora liana amin\'izany ary ny 15-16 jolay no hizoran\'ny fifaninana.\r\n\r\n   ', 0),
(8, '2017-05-08', '09:40:00', ' Finoana katolika _Diosesin\'i Maintirano: Tafapetraka amin\'ny fomba ofisialy omaly ny Monsenera Gustavo Bombin Espino, izay voatendry hitantantana ny ...', ' Finoana katolika _Diosesin\'i Maintirano: Tafapetraka amin\'ny fomba ofisialy omaly ny Monsenera Gustavo Bombin Espino, izay voatendry hitantantana ny diosezin\'i Maintinirano, diosezy vaovao ary faha-22 eto Madagasikara. Tamin\'ny alalan\'ny lamesa lehibe no nanamarihana izany.', 0),
(9, '2017-05-09', '11:30:00', 'Làlam-pirenena faha -4 _Tetezan\'i Kamoro: Araka ny fanomezam-baovaon\'ny Minisiteran\'ny asa vaventy, dia amin\'ny tapaky ny volana jona no vinavinaina ...', 'Làlam-pirenena faha -4 _Tetezan\'i Kamoro: Araka ny fanomezam-baovaon\'ny Minisiteran\'ny asa vaventy, dia amin\'ny tapaky ny volana jona no vinavinaina ho vita ny tetezan\'i Kamoro eo amin\'ny PK 406+400, izay nasiam-panamboarana nanomboka ny 15 febroary. Hijanona ho fananam-panjakana sy hatao vakoka kosa ireo fitaovana tsy nilaina tamin\'ny fanamboarana.', 1),
(10, '2017-05-10', '10:00:00', ' Baolina kitra _Champion\'s league: Anio alina no hanatanterahana ny lalao famerenana eo amin\'ny dingana manasa-dàlana hifanandrinan\'ny Atletico de Ma...', ' Baolina kitra _Champion\'s league: Anio alina no hanatanterahana ny lalao famerenana eo amin\'ny dingana manasa-dàlana hifanandrinan\'ny Atletico de Madrid sy ny Real Madrid. Tsiahivina fa efa nandresy 3-0 ry Christiano Ronaldo. Izay tafavoaka amin\'ireo ekipa 2 ireo hanao famaranana amin\'ny Juventus de Turin.', 1),
(11, '2017-05-10', '09:40:00', ' Antsalova : Nihena ho 70.000 Ariary ny sarandalana Antsalova-Maintirano (120km) raha 80.000 Ariary teo aloha ary tsy nisy entana tonga nefa dia niaka...', ' Antsalova : Nihena ho 70.000 Ariary ny sarandalana Antsalova-Maintirano (120km) raha 80.000 Ariary teo aloha ary tsy nisy entana tonga nefa dia niakatra am-pitoerana teo ny vidin’entana any an-toerana, izay nahagaga ny Vahoaka mpanjifa. 600 Ariary amin’izao ny kapoakan’ny ny vary, 4 000 Ariary ny kapoakan\'ny kafe, 1600 Ariary ny kapoakan\'ny tsaramaso maina. Ny menaka sakafo nanjary 10.000 Ariary ny 1,5 litatra.', 1),
(12, '2017-05-10', '11:00:00', ' Any Ivelany _Etazonia: Noroahin\'ny filoham-pirenena Amerikanina Donald Trump ny Lehiben\'ny sampam-pitsikilovana FBI James Comey. Anton\'izany ny fomba...', ' Any Ivelany _Etazonia: Noroahin\'ny filoham-pirenena Amerikanina Donald Trump ny Lehiben\'ny sampam-pitsikilovana FBI James Comey. Anton\'izany ny fomba nitondrany ny fanadihadiana ireo adiresy mailaka hosoka voalaza fa nampiasain\'i Hillary Clinton tamin\'ny fifidianana filoham-pirenena, izay tsy nahomby.\r\n\r\n', 1),
(13, '2017-05-10', '11:30:00', 'Polisim-pirenena: Nakarina galona ho "contrôleur général de police" ny nandritra ny filan-kevitry ny minisitra omaly I Erick Michel Wouli Soumah Id...', 'Polisim-pirenena: Nakarina galona ho "contrôleur général de police" ny nandritra ny filan-kevitry ny minisitra omaly I Erick Michel Wouli Soumah Idrissa, Tale Jeneralin\'ny polisim-pirenena. ', 1),
(16, '2017-05-12', '08:30:00', ' anatanjahantena _Rugby: Sambany hampidirina eto amintsika ny lalao Rubgy ho an\'ny olona manana fahasembanana mitondra ireny seza misy kodiarana ireny...', ' anatanjahantena _Rugby: Sambany hampidirina eto amintsika ny lalao Rubgy ho an\'ny olona manana fahasembanana mitondra ireny seza misy kodiarana ireny, ka "Wheelchair Seven\'s" no anaran\'izy io, izay lalaovina olona 7 avy ny andaniny sy ny ankilany. Hisy ny lalao fanehoana sy varavarana misokatra momba izany eny amin\'ny Complexe Sportif Ampefiloha rahapitso sabotsy 13 mey.', 1),
(17, '2017-05-12', '09:00:00', ' Bakalorea: Niakatra 2,64% ny tahan\'ny mpiadina amin\'ity taona ity. Mahatratra 182522 izany raha toa ka 177697. Nitombo 3,50% ny sokajy A2 ary nihena ...', ' Bakalorea: Niakatra 2,64% ny tahan\'ny mpiadina amin\'ity taona ity. Mahatratra 182522 izany raha toa ka 177697. Nitombo 3,50% ny sokajy A2 ary nihena 2,31 ny sokajy A1. 0,20% kosa ny fitomboan\'ny sokajy C ary 1,40% ny sokajy D. Mbola vitsy ny mpiadina ho sokajy teknika mitaha amin\'ny ankapobeny satria 9820 izy ireo. ', 1),
(18, '2017-05-12', '09:30:00', 'Fanendrena sy fanalana mpiasam-panjakana amin\'ny toerany: Nilaza ny praiminisitra Mahafaly Solonandrasana Olivier fa tsy misy hidiran\'ny resaka fanasa...', 'Fanendrena sy fanalana mpiasam-panjakana amin\'ny toerany: Nilaza ny praiminisitra Mahafaly Solonandrasana Olivier fa tsy misy hidiran\'ny resaka fanasaziana izany fa famindran-toerana tsotra ihany. \r\n•  \r\n', 1),
(19, '2017-05-12', '09:45:00', ' Bakalorea: 74 taona ny zokiny indrindra ary 12 taona kosa ny zandriny indrindra amin\'ireo mpiadina amin\'ity taona ity. ...', ' Bakalorea: 74 taona ny zokiny indrindra ary 12 taona kosa ny zandriny indrindra amin\'ireo mpiadina amin\'ity taona ity. ', 1),
(20, '2017-05-12', '10:00:00', 'Ady amin\'ny tsy fanjarian-tsakafo: Maherin\'ny 400 tapitrisa dolara isan-taona no ilaina amin\'izany eto Madagasikara. Mahatratra 47% ny tahan\'ny tsy fa...', 'Ady amin\'ny tsy fanjarian-tsakafo: Maherin\'ny 400 tapitrisa dolara isan-taona no ilaina amin\'izany eto Madagasikara. Mahatratra 47% ny tahan\'ny tsy fanjarian-tsakafo mitarazoka, ka tanjona ny hampihenana izany ho 38% amin\'ny alalan\'ny paikadim-pirenena momba ny ady amin\'ny tsy fanjarian-tsakafo na ny PNAN III. Milaza ny hampitombo hatrany ny tetibola amin\'ny ady amin\'ny tsy fanjarian-tsakafo ny fanjakana na dia efa avo telo heny aza no natao. ', 1),
(21, '2017-05-12', '11:00:00', 'Mahajanga: Misokatra amin\'ny fomba ofisialy anio ny fivoriam-be andiany faha-4 momba ny fahasalamana izay fantatra amin\'ny anarana hoe "Hépato-Gastro...', 'Mahajanga: Misokatra amin\'ny fomba ofisialy anio ny fivoriam-be andiany faha-4 momba ny fahasalamana izay fantatra amin\'ny anarana hoe "Hépato-Gastro-Entérologie de Madagascar". Lohahevitra maro no horesahina ao anatin\'izany ka isan\'ireo ny resaka sakafo ara-pahasalamana. 25 eo ho eo ireo manam-pahaizana hanao famelabelarana, ka rahapitso 13 mey vao hifarana tanteraka ny hetsika. ', 0),
(22, '2017-05-12', '11:15:00', ' Farafangana: Velon-taraina ny vahoaka noho manoloana ny delestazy mahery vaika miseho any an-toerana. Tsiahivina fa efa niteraka ny fahatezeran\'ny mp...', ' Farafangana: Velon-taraina ny vahoaka noho manoloana ny delestazy mahery vaika miseho any an-toerana. Tsiahivina fa efa niteraka ny fahatezeran\'ny mponina tany an-toerana ity resaka delestazy ity, ka nandoran\'izy ireo ny biraon\'ny Jirama ny 15 oktobra 2016. ', 0),
(23, '2017-05-12', '12:00:00', '\r\nAntenimieram-pirenena: Mbola tsy tonga eny an-toerana ny volavolan-dalàna mikasika ny harena an-kibon\'ny tany, hoy ny lehiben\'ny Kaominisionina mom...', '\r\nAntenimieram-pirenena: Mbola tsy tonga eny an-toerana ny volavolan-dalàna mikasika ny harena an-kibon\'ny tany, hoy ny lehiben\'ny Kaominisionina momba ny harena an-kibon\'ny tany eny amin\'ny antenimiera. \r\n', 0),
(24, '2017-05-12', '12:30:00', ' Riana Andriamandavy VII: Efa eto an-tanindrazana ity loholona ity ary milaza ho tsy mahalala ny resaka fampiantsoan\'ny zandary azy. Ny tonian\'ny famp...', ' Riana Andriamandavy VII: Efa eto an-tanindrazana ity loholona ity ary milaza ho tsy mahalala ny resaka fampiantsoan\'ny zandary azy. Ny tonian\'ny fampanoavana ambony Randrianasolo Jacques kosa dia nanamafy fa efa nalefa eny amin\'ny zandary ny taratasy momba ny fitoriana azy. ', 0),
(25, '2017-05-12', '13:30:00', ' Tontolo iainana: Hatao eto Antananarivo ny 15 mey ary tsy hifarana raha tsy ny 28 mey ny hetsika momba ny zava-maniry sy ny voahary, izay fantatra am...', ' Tontolo iainana: Hatao eto Antananarivo ny 15 mey ary tsy hifarana raha tsy ny 28 mey ny hetsika momba ny zava-maniry sy ny voahary, izay fantatra amin\'ny anarana hoe IFPECO (International festival of plants, ecology and colours). ', 0),
(26, '2017-05-12', '14:20:00', ' Tontolon\'ny fiarakodia: Hanatanteraka seho mikasika ny tanjaky ny fiara "Ford" eny amin\'ny toerana fanaovana hazakazaka fiarakodia eny Ivato ny orina...', ' Tontolon\'ny fiarakodia: Hanatanteraka seho mikasika ny tanjaky ny fiara "Ford" eny amin\'ny toerana fanaovana hazakazaka fiarakodia eny Ivato ny orinasa mpivarotra fiara vaovao Materauto rahapitso 13 mey. Maro ireo liana sy mankafy ny resaka spaoro mekanika no hijery izany. ', 0),
(27, '2017-05-12', '14:50:00', ' Mpanolontsain\'ny filoha: Mivoaka ny vaovao ankehitriny fa noroahina tsy ho mpanolontsain\'ny filoham-pirenena i Nicole Randrianarison, ilay ramatoa na...', ' Mpanolontsain\'ny filoha: Mivoaka ny vaovao ankehitriny fa noroahina tsy ho mpanolontsain\'ny filoham-pirenena i Nicole Randrianarison, ilay ramatoa nahatrarana volabe 3 tapitrisa Euros tany Frantsa ny volana desambra 2015. ', 0),
(28, '2017-05-12', '15:20:00', 'Sambava _Trangam-piarahamonina: Tovovavy 1 vao 15 taona maty novonoin\'ny vadiny, ary naleviny an-tsokosoko ny 10 lasa teo. Zana-badin\'ny vadin\'ny raha...', 'Sambava _Trangam-piarahamonina: Tovovavy 1 vao 15 taona maty novonoin\'ny vadiny, ary naleviny an-tsokosoko ny 10 lasa teo. Zana-badin\'ny vadin\'ny rahalahiny ihany izy io. ', 0),
(29, '2017-05-15', '07:00:00', ' Fakana an-keriny: Nisy naka an-keriny omaly maraina tokony ho tamin\'ny 10 ora sy sasany nandritra ny fotoam-pandevenana teny Ilafy ny teratany karana...', ' Fakana an-keriny: Nisy naka an-keriny omaly maraina tokony ho tamin\'ny 10 ora sy sasany nandritra ny fotoam-pandevenana teny Ilafy ny teratany karana antsoina hoe Yanish Ismael, zanak\'i Danil tompon\'ny Vondron\'orinasa SMTP, izay ahitana ny La City, Socolait, ABC. Nitifitra tamin\'ny basy kalachnikov ireo 12 lahy naka an-keriny, ka zandary iray mpiaro ny fianakaviana naratra. Nitsoaka niaraka tamin\'ny fiara Mazda izy ireo avy eo.', 1),
(30, '2017-05-15', '08:00:00', ' FJKM Ambavahadimitafo: Naongan\'ny ampahan\'ny mpino sy ny mpihevi-draharaha ny sabotsy hariva teo ny mpitandrina. Resaka trosa miavosa izay tsy mazava...', ' FJKM Ambavahadimitafo: Naongan\'ny ampahan\'ny mpino sy ny mpihevi-draharaha ny sabotsy hariva teo ny mpitandrina. Resaka trosa miavosa izay tsy mazava no ambara ho antony. \r\n \r\n', 1),
(31, '2017-05-15', '08:30:00', ' Fanatanjahantena _Taranja Tenisy: Fandresena miisa 3 no efa azon\'ny Malagasy eo amin\'ny fiadiana izay ho tompondakan\'ny Afrika Aostraly latsaky ny 12...', ' Fanatanjahantena _Taranja Tenisy: Fandresena miisa 3 no efa azon\'ny Malagasy eo amin\'ny fiadiana izay ho tompondakan\'ny Afrika Aostraly latsaky ny 12 taona na ny U12. Teo amin\'ny sokajy lehilahy dia nandresy an\'i Botswana tamin\'ny seta 3-0, ary io isa 3-0 io ihany koa no nandrentsika an\'i Maurice. Mbola 3-0 ihany koa no nandavoan\'ny sokajy vehivavy ny ekipan\'i Botswana. \r\n\r\n', 1),
(32, '2017-05-15', '09:00:00', 'Frantsa: Andrasana amin\'ity alatsinainy ity ny anaran\'izay ho praiminisitra ho tendren\'ny filoha Frantsay vaovao Emmanuel Macron. Rahampitso talata 16...', 'Frantsa: Andrasana amin\'ity alatsinainy ity ny anaran\'izay ho praiminisitra ho tendren\'ny filoha Frantsay vaovao Emmanuel Macron. Rahampitso talata 16 mey kosa no hitsangana ny governemanta. ', 1),
(33, '2017-05-16', '08:30:00', ' Lozam-pifamoivoizana tany Anjozorobe: Hatao anio 16 may ny fitsarana ny raharaha nahafatesana olona 47 noho ny lozam-pifamoivoizana tany Anjozorobe n...', ' Lozam-pifamoivoizana tany Anjozorobe: Hatao anio 16 may ny fitsarana ny raharaha nahafatesana olona 47 noho ny lozam-pifamoivoizana tany Anjozorobe ny 28 janoary. Saika hatao ny 19 aprily izany saingy tsy feno ny antontan-taratasin’ireo namoy ny ainy. Nahazo fahafahana vonjimaika kosa ilay tompon\'ny fiara.', 0),
(34, '2017-05-16', '09:00:00', ' : Raharaha Fernand Cello: Namoaka taratasy ny Banky BFV fa tsy nahazo taratasy fanoherana na fitarainana momba fahaverezana taratasim-bola mitondra n...', ' : Raharaha Fernand Cello: Namoaka taratasy ny Banky BFV fa tsy nahazo taratasy fanoherana na fitarainana momba fahaverezana taratasim-bola mitondra ny laharana CC27165026, izay nambara ho nangalarin\'i Fernand Cello, ka nampidirana am-ponja azy nanomboka ny 7 mey.', 1),
(35, '2017-05-16', '09:30:00', ' : CEDS: Lasa any Japon nanatanteraka dia fibeazana ny mpianatra andiany faha-13 ao amin\'ity ivon-toeram-piofanana ara-diplomatika sy stratejika ity....', ' : CEDS: Lasa any Japon nanatanteraka dia fibeazana ny mpianatra andiany faha-13 ao amin\'ity ivon-toeram-piofanana ara-diplomatika sy stratejika ity.', 1),
(36, '2017-05-16', '10:00:00', ' : Praiminisitra Mahafaly Solonandrasana Olivier: Ho hentitra ny fanapahan-kevitra sy sazy ho an\'ireo tomponandraiki-panjakana voaporofo fa tafiditra ...', ' : Praiminisitra Mahafaly Solonandrasana Olivier: Ho hentitra ny fanapahan-kevitra sy sazy ho an\'ireo tomponandraiki-panjakana voaporofo fa tafiditra ao anatin\'ny resaka halatra lavanila. Milaza ny hidina ifotony any amin\'ireo faritra mena amin\'ny halatra lavanila mihitsy izy sy ny ekipany.', 1),
(37, '2017-05-16', '10:15:00', ' : Raharaha Claudine Razaimamonjy: Nangataka fahafahana vonjimaika ny mpisolovava an\'ity mpanolontsain\'ny filoham-pirenena voarohirohy tamina kolikoly...', ' : Raharaha Claudine Razaimamonjy: Nangataka fahafahana vonjimaika ny mpisolovava an\'ity mpanolontsain\'ny filoham-pirenena voarohirohy tamina kolikoly avo lenta ity omaly. Tsiahivina fa efa namoahana didy fampidirana am-ponja vonjimaika ity ramatoa izy, saingy mbola tsy nihatra izany noho ny resaka fitsaboan-tenany.', 1),
(38, '2017-05-16', '10:30:00', ' : Antenimieram-pirenena: Miisa 23 ireo volavolan-dalàna hodinihina mandritra ny fivoriana ara-potoana. Ny 30-31 mey izao kosa no hanatanterahana ny ...', ' : Antenimieram-pirenena: Miisa 23 ireo volavolan-dalàna hodinihina mandritra ny fivoriana ara-potoana. Ny 30-31 mey izao kosa no hanatanterahana ny fifanatrehana amin\'ny governemanta raha tsy misy ny fiovana.', 1),
(39, '2017-05-16', '10:45:00', 'Ambodilazana Toamasina II: Tanàna 17 mety horavana noho ny fitrandrahana kraoma hatao any an-toerana. Tsy manaiky izany ny mponina izay efa manangon-...', 'Ambodilazana Toamasina II: Tanàna 17 mety horavana noho ny fitrandrahana kraoma hatao any an-toerana. Tsy manaiky izany ny mponina izay efa manangon-tsonia mba hanoherana ity fitrandrahana harena an-kibon\'ny tany, ka hanesorana azy ireo amin\'ny tanànany ity.', 1),
