(72, '2017-05-19', '10:30:00', ' Fanatanjahantena _Rugby: Ny 4 jona izao no hatao ny famaranana ny fiadiana ny tompondakan\'ny Ranomasimbe Indianina eo amin\'ny ekipa tompondaka, izay ...', ' Fanatanjahantena _Rugby: Ny 4 jona izao no hatao ny famaranana ny fiadiana ny tompondakan\'ny Ranomasimbe Indianina eo amin\'ny ekipa tompondaka, izay hifanandrinan\'ny FTM avy eto Madagasikara sy ny Le Port avy atsy Sain Paul La Réunion. Ny sabotsy 13 mey teo no tokony natao ny lalao saingy tsy tratra noho ny tsy fahatomombanan\'ny "Visa" ho an\'ny ekipa Malagasy. \r\n\r\n', 1),
(73, '2017-05-19', '11:00:00', ' Mahabo _Lozam-pifamoivoizana: 1 maty ary 5 naratra mafy vokatry ny lozam-pifamoivoizana niseho tany amin’ny RN35, 10Km hidirana an’I Mahabo omaly...', ' Mahabo _Lozam-pifamoivoizana: 1 maty ary 5 naratra mafy vokatry ny lozam-pifamoivoizana niseho tany amin’ny RN35, 10Km hidirana an’I Mahabo omaly hariva tokony ho tamin\'ny 6ora hariva. Fiara avy nitety tsena tany Befotaka no niharan-doza vokatry ny fahatapahan’ny “direction”. Marihina fa fianakaviana iray ireo niharan-doza ireo. ', 1),
(74, '2017-05-19', '11:30:00', ' Bianco: Hiroso amin\'ny fanasaziana ireo tompon\'andraikitra tokony hanao fanambaram-panana kanefa tsy nanao izany ny Bianco manomboka ny 1 jona, araka...', ' Bianco: Hiroso amin\'ny fanasaziana ireo tompon\'andraikitra tokony hanao fanambaram-panana kanefa tsy nanao izany ny Bianco manomboka ny 1 jona, araka ny fanambaran\'ny lehibeny Jean Louis Andriamifidy. Ny 16 mey lasa teo dia mbola 47,19% tamin\'ireo tomponandraikitra ara-panjakana isan-tsokajiny efa naka ny andinindininy no mbola tsy nanao izany. ', 1),
