(76, '2017-05-19', '12:30:00', 'Rugby Malagasy: Nodimandry i Razafindrakoto Robin na ko hoe Rainisoa. Izy dia anisan\'ny mpilalao zandriny indrindra nandray anjara nandritra ny lalao ...', 'Rugby Malagasy: Nodimandry i Razafindrakoto Robin na ko hoe Rainisoa. Izy dia anisan\'ny mpilalao zandriny indrindra nandray anjara nandritra ny lalao natao tany Frantsa ny taona 1957, efa nilalao tao amin\'ny Club CHEMINOT sy AMBONDRONA ary dadaben\'ny ireo Mpilalaon\'ny Makis roa antsoina hoe Solobe sy Deka. Marihina fa 81 taona izy izao nindaosin\'ny fahafatesana izao. ', 1),
(77, '2017-05-19', '13:00:00', ' SECES: Tsy manaiky ny tsy fanatanterahin\'ny fanjakana ny zon\'izy ireo voafaritry ny didim-panjakana 1214/2009 mikasika ny "Indemnité de logement" sy...', ' SECES: Tsy manaiky ny tsy fanatanterahin\'ny fanjakana ny zon\'izy ireo voafaritry ny didim-panjakana 1214/2009 mikasika ny "Indemnité de logement" sy "Indemnité de résidence", izay efa niy fifanarahana tamin\'ny 10 septambra 2015 izy ireo kanefa tsy tanteraka hatramin\'izao. Efa nampanantenaina fa hampidirina ao anatin\'ny "Loi de finance initiale 2017", izay efa nilaozana lavitra izy saingy tsy tanteraka, ka milaza izy ireo fa tandindonina fampiatoana ny fampianarana amin\'ny oniveriste 6. ', 1),
