(81, '2017-05-22', '09:15:00', ' : Raharaha boaderozy tany Singapour: Nametraka fitoriana miantefa amina olona tsy fantatra na "Plainte contre X" noho nu hosoka sy fampiasana hosoka ...', ' : Raharaha boaderozy tany Singapour: Nametraka fitoriana miantefa amina olona tsy fantatra na "Plainte contre X" noho nu hosoka sy fampiasana hosoka ka nahafahana nanondrana boaderozy 30000 isa tany Singapour ny taona 2014 ny fanjakana, ka eny amin\'ny fitsarana Ambaratonga voalohany Anosy no nametrahana izany.', 1),
(82, '2017-05-22', '08:00:00', ' : Tontolon\'ny fiarakodia: Efa nivoaka ny fiara tsy mataho-dàlana na 4X4, marika Karenjy dia ny Mazana II, izay novokarina teto Madagasikara. Eny ami...', ' : Tontolon\'ny fiarakodia: Efa nivoaka ny fiara tsy mataho-dàlana na 4X4, marika Karenjy dia ny Mazana II, izay novokarina teto Madagasikara. Eny amin\'ny COMACAT (Compagnie malgache de caoutchouc) eny Ankorondrano no ahitana azy io.', 1),
(83, '2017-05-22', '08:15:00', ' : Ivandry _Lozam-pifamoivoizana: Olona 2 no indray maty nodomin\'ny fiara kely iray omaly tokony ho tamin\'ny 6 ora hariva. Ny fahatapahan\'ny hisatra n...', ' : Ivandry _Lozam-pifamoivoizana: Olona 2 no indray maty nodomin\'ny fiara kely iray omaly tokony ho tamin\'ny 6 ora hariva. Ny fahatapahan\'ny hisatra no voalaza fa nahatonga ny loza. Saika niharan\'ny fitsaram-bahoaka ireo olona 2 tao anaty fiara.', 1),
(84, '2017-05-22', '08:30:00', ': Claudine Razaimamonjy: Araka ny didim-pitondrana laharana 4673/60 tamin\'ny 10/11/1960 dia 45 ihany fe-potoana hahafahan\'ny olona iray voatazona am-p...', ': Claudine Razaimamonjy: Araka ny didim-pitondrana laharana 4673/60 tamin\'ny 10/11/1960 dia 45 ihany fe-potoana hahafahan\'ny olona iray voatazona am-ponja hahafahany mitsabo tena. Tapitra omaly izany 45 andro izany ho an\'i Claudine Razaimamonjy. Andrasana ny fanapahan-kevitry fanjakana sy ny fitsarana.', 1),
(85, '2017-05-22', '09:00:00', ' Rocade Andohatapenaka _Lozam-pifamoivoizana: Fiara tsy mataho-dàlana iray nivadika ambony ambany io maraina io. Tsy nisy ny aina nafoy....', ' Rocade Andohatapenaka _Lozam-pifamoivoizana: Fiara tsy mataho-dàlana iray nivadika ambony ambany io maraina io. Tsy nisy ny aina nafoy.', 1),
(86, '2017-05-22', '09:25:00', ' Fakana an-keriny: Nodimandry omaly teny amin\'ny hopitaly ilay polisy mpiambina an\'i Yanish Ismael, zanaky ny mpandraharaha karana tompon\'ny La City I...', ' Fakana an-keriny: Nodimandry omaly teny amin\'ny hopitaly ilay polisy mpiambina an\'i Yanish Ismael, zanaky ny mpandraharaha karana tompon\'ny La City Ivandry, Socolait... nisy an-keriny teny Ankadikely Ilafy ny 14 mey lasa teo. Tsiahivina fa notifirin\'ireo mpaka an-keriny ka voa teo amin\'ny kibony io polisy io. Tsy mbola votsotra kosa i Yanish Ismael hatramin\'izao.', 1),
(87, '2017-05-22', '09:45:00', ' : Anosibe _Haintrano: Tranohazo miisa 50 no indray kilan\'ny afo vokatry ny haindrano niseho ny omaly hariva tokony ho tamin\'ny 7 ora. Afon-dabozia ta...', ' : Anosibe _Haintrano: Tranohazo miisa 50 no indray kilan\'ny afo vokatry ny haindrano niseho ny omaly hariva tokony ho tamin\'ny 7 ora. Afon-dabozia tao amin\'ny tokantrano iray no niteraka ny loza raha ny fanazavan\'ny manodidina. Fianakaviana hatrany amin\'ny 200 kosa no tsy manan-kialofana amin\'izao fotoana izao', 1),
(88, '2017-05-22', '10:00:00', ': Lozam-pifamoivoizana teny Ivandry: Tazonina sy halaina am-bavany eny amin\'ny Kaomisarian\'i Tsaralalàna ilay mpamily nahafaty olona miisa 2 omaly ha...', ': Lozam-pifamoivoizana teny Ivandry: Tazonina sy halaina am-bavany eny amin\'ny Kaomisarian\'i Tsaralalàna ilay mpamily nahafaty olona miisa 2 omaly hariva. Voalaza fa "inspecteur des impôts" io mpamily io ary monina eny Faravohitra.', 1),
(89, '2017-05-22', '10:25:00', ' Maroantsetra _Mpianatra namoy ny ainy: Mpiadina iray namoy ny ainy taorian\'ny adina ara-panatanjahantena ho an\'ny fanadinam-panjakana bakalorea ny fa...', ' Maroantsetra _Mpianatra namoy ny ainy: Mpiadina iray namoy ny ainy taorian\'ny adina ara-panatanjahantena ho an\'ny fanadinam-panjakana bakalorea ny faran\'ny herinandro teo.', 1),
(90, '2017-05-22', '11:00:00', ' Tsenabe "Grande Braderie de Madagascar": Ny alarobia 24 mey ka hatramin\'ny 28 mey izao no hanatanterahana izany eny amin\'ny Lapan\'ny fanatanjahantena...', ' Tsenabe "Grande Braderie de Madagascar": Ny alarobia 24 mey ka hatramin\'ny 28 mey izao no hanatanterahana izany eny amin\'ny Lapan\'ny fanatanjahantena Mahamasina.', 1),
(91, '2017-05-22', '11:20:00', ' : Vontovorona _Grevin\'ny mpianatra: Manao fitokonana ny mpianatra eny amin\'ny Oniversite politeknika Vontovorana amin\'izao fotoana izao mba hitakiana...', ' : Vontovorona _Grevin\'ny mpianatra: Manao fitokonana ny mpianatra eny amin\'ny Oniversite politeknika Vontovorana amin\'izao fotoana izao mba hitakiana ny fampiakarana ny vola fampitaovana ho azy ireo. Raikitra ny fanakanan-dàlana sy ny tora-bato. Efa mihantrana eny an-toerana ihany koa ny mpitandro filaminana. ', 1),
(92, '2017-05-22', '11:45:00', ' Antenimierandoholona: Hisy ny fivoriana mikaton-trano isaky ny 2 volana hanaovana ny dinika sy ny fifanakalozana mba hanamafisana orina ny anjara asa...', ' Antenimierandoholona: Hisy ny fivoriana mikaton-trano isaky ny 2 volana hanaovana ny dinika sy ny fifanakalozana mba hanamafisana orina ny anjara asan\'ny loholona amin\'ny maha mpanolontsaina manokana, indrindra fa eo amin\'ny lafiny ara-toekarena azy ireo. ', 1),
(93, '2017-05-22', '12:00:00', 'Vidim-bary: Nanome baiko ny mpandraharaha tamin\'ny alalan\'ny horonantsary mivoaka isan-kerinandro amin\'ny tranonkala "Youtube" sy ny pejy "Facebook", ...', 'Vidim-bary: Nanome baiko ny mpandraharaha tamin\'ny alalan\'ny horonantsary mivoaka isan-kerinandro amin\'ny tranonkala "Youtube" sy ny pejy "Facebook", izay fantantara amin\'ny anarana hoe Fotoam-bita i Hery Rajaonarimampianina fa tsy azo ekena ny fanararaotana ary ho hentitra ny fanjakana amin\'ny fanenjehana ireo mpanararaotra amin\'ny vidim-bary. Tsy tokony hihoatra ny 2000ariary ny kilao raha ny fanazavany.', 1),
(94, '2017-05-23', '11:00:00', ' Jirama: Hisy ny fahatapahan-jiro noho ny antony teknika ho an\'ireto faritra ireto: Ambodivona, Ambohimanarina, Andraharo, Ambohibao,...', ' Jirama: Hisy ny fahatapahan-jiro noho ny antony teknika ho an\'ireto faritra ireto: Ambodivona, Ambohimanarina, Andraharo, Ambohibao,', 1),
(95, '2017-05-23', '11:30:00', ' : Lozam-pifamoivoizana teny Ivandry: Mbola tazonina eny amin’ny Kaomisarian’I Tsaralalàna ilay vehivavy mpamily nitondra ilay fiara nahafaty olo...', ' : Lozam-pifamoivoizana teny Ivandry: Mbola tazonina eny amin’ny Kaomisarian’I Tsaralalàna ilay vehivavy mpamily nitondra ilay fiara nahafaty olona 2 teny Ivandry ny alahady lasa teo. Mbola tsaboina eny amin’ny hopitaly HJRA kosa ilay ramatoa sy ny zanany vao 8 volana izay tapa-tongotra aman-tànana nandritra ity loza mahatsiravina ity. ', 1),
(96, '2017-05-23', '10:45:00', ' : Sainte Marie _Trangam-piarahamonina: Vazaha iray nanodinkodinana sy saika hanolana zazavavy kely 3 mbola tsy ampy taona. Nohidiany tao an-tranony i...', ' : Sainte Marie _Trangam-piarahamonina: Vazaha iray nanodinkodinana sy saika hanolana zazavavy kely 3 mbola tsy ampy taona. Nohidiany tao an-tranony izy 3 ireo saingy tafaporitsaka ny 2 izay vao 8 taona sy 11 taona, ka ireo no nampandre fokonolona sy ny mpitandro filaminana. Hatolotra ny fitsarana any Toamasina anio io vazaha io.', 0),
(97, '2017-05-23', '11:00:00', '•	\r\n : Jirama: Hisy ny fahatapahan-jiro noho ny antony teknika ho an\'ireto faritra ireto: Ambodivona, Ambohimanarina, Andraharo, Ambohibao, Talatama...', '•	\r\n : Jirama: Hisy ny fahatapahan-jiro noho ny antony teknika ho an\'ireto faritra ireto: Ambodivona, Ambohimanarina, Andraharo, Ambohibao, Talatamaty.\r\n', 0),
