(99, '2017-05-23', '12:00:00', ' Goverenemanta-Solombavambahoaka: Hatao ny alarobia 31 mey izao ny fifanatrehana eo amin’ny governemananta sy ny solombavambahoaka, ka mandritra iza...', ' Goverenemanta-Solombavambahoaka: Hatao ny alarobia 31 mey izao ny fifanatrehana eo amin’ny governemananta sy ny solombavambahoaka, ka mandritra izany no hanaovan’ny mpikamban’ny governemanta ny asa vitany, arahin’ny ady hevitra eo amin’izy ireo sy ny depiote.', 1),
(100, '2017-05-23', '12:30:00', ' Lozam-pifamoivoizana teny Ivandry: Hiakatra fampanoavana anio ilay mpamily nifaoka olona 5, ka nahafaty olona 2 teny Ivandry ny alahady teo. Voamarin...', ' Lozam-pifamoivoizana teny Ivandry: Hiakatra fampanoavana anio ilay mpamily nifaoka olona 5, ka nahafaty olona 2 teny Ivandry ny alahady teo. Voamarina amin\'izao fotoana izao fa nandray zava-pisotro misy alikaola io mpamily io.', 1),
(101, '2017-05-23', '13:00:00', ' SECES: Nanapa-kevitra ny Sendikan\'ny mpampianatra-mpikaroka sy ny mpikaroka-mpampianatra (SECES) fa hampiato ny fampianarana eny amin’ny oniversite...', ' SECES: Nanapa-kevitra ny Sendikan\'ny mpampianatra-mpikaroka sy ny mpikaroka-mpampianatra (SECES) fa hampiato ny fampianarana eny amin’ny oniversite ny taorian’ny 72 ora nomen\'izy ireo satria tsy nahitam-bokany ny fifampidinihana niarahana tamin’ny Minisiteran’ny fampianarana ambony.', 1),
(102, '2017-05-23', '13:30:00', ' Baolina kitra _CAN U17: Tanterahina rahapitso 24 mey ny ny lalao manasa-dàlana izay hifanandrinan\'i Ghana sy Niger eo amin\'ny lalao voalohany, arahi...', ' Baolina kitra _CAN U17: Tanterahina rahapitso 24 mey ny ny lalao manasa-dàlana izay hifanandrinan\'i Ghana sy Niger eo amin\'ny lalao voalohany, arahin\'ny fifandonan\'i Mali sy Guinée, ka amin\'ny 5 ora sy sasany sy amin\'ny 8 ora sy sasany ora any Gabon no hizoran\'ny lalao.\r\n', 1),
(103, '2017-05-23', '14:00:00', ' : Antsahamanitra _Fampisehoana evanjelika: Tanterahina anio manomboka amin\'ny 6 ora hariva ny fampisehoana envanjelika hataon\'ny tarika Hillsong Fran...', ' : Antsahamanitra _Fampisehoana evanjelika: Tanterahina anio manomboka amin\'ny 6 ora hariva ny fampisehoana envanjelika hataon\'ny tarika Hillsong France eny amin\'ny kianjan\'Antsahamanitra.', 1),
(104, '2017-05-23', '15:00:00', ' : Tionelina Ambanidia: Miely ny feo amin\'izao fotoana izao fa nirodana ity tionelina ity. Milaza kosa ny eo anivon\'ny sampana mpamonjy voina fa tsaho...', ' : Tionelina Ambanidia: Miely ny feo amin\'izao fotoana izao fa nirodana ity tionelina ity. Milaza kosa ny eo anivon\'ny sampana mpamonjy voina fa tsaho nahelin\'ny mpikirakira ny "internet" izany fa tsy marina velively.', 1),
(105, '2017-05-23', '15:30:00', ' Fakana an-keriny: Nilaza ny filoham-pirenena Hery Rajaonarimampianina androany fa hapetraka sy horaisina ny fepetra momba ny trangana fakana an-kerin...', ' Fakana an-keriny: Nilaza ny filoham-pirenena Hery Rajaonarimampianina androany fa hapetraka sy horaisina ny fepetra momba ny trangana fakana an-keriny eto Madagasikara. Nanamarika anefa izy fa ny rehetra no tompon\'andraikitra amin\'izany fa ny mpitondra irery.', 1),
(106, '2017-05-24', '09:00:00', 'Famoahana vola vaovao: Nankatoavina omaly nandritra ny filankevitry ny governemanta omaly ny rijantenin-dalàna momba ny famoahan\'ny Banky Foiben\'i Ma...', 'Famoahana vola vaovao: Nankatoavina omaly nandritra ny filankevitry ny governemanta omaly ny rijantenin-dalàna momba ny famoahan\'ny Banky Foiben\'i Madagasikara vola amin\'ny endriny vaovao. Hivoaka ny volana jolay ny vola vaovao 2000Ar, 5000Ar, 10 000Ar ary ny 2000Ar. Ny volana septambra kosa no hivoaka ny 100Ar, 200Ar, 500Ar, 1000Ar. Hanan-kery hatrany kosa ireo vola teo aloha mandra-pivoakan\'ny didim-panjakana manatsahatra ny fampiasana azy.', 1),
(107, '2017-05-24', '09:30:00', ' Tsenabe "Grande Braderie de Madagascar": Misokatra amin\'ny fofmba ofisialy anio alarobia 24 mey eny amin\'ny Lapan\'ny fanatanjahantena Mahamasina ry t...', ' Tsenabe "Grande Braderie de Madagascar": Misokatra amin\'ny fofmba ofisialy anio alarobia 24 mey eny amin\'ny Lapan\'ny fanatanjahantena Mahamasina ry tsy hifarana raha tsy ny 28 mey izao ny "Grande braderie de Madagascar". \r\n•  \r\n', 1),
(108, '2017-05-24', '10:00:00', ' : Voafonja: Miisa 23 ireo tanora voafonja hiatrika ny fanadinam-panjakana amin\'ity taona ity. Ny 8 amin\'izy ireo dia hiatrika ny fanadinana CEPE, 12 ...', ' : Voafonja: Miisa 23 ireo tanora voafonja hiatrika ny fanadinam-panjakana amin\'ity taona ity. Ny 8 amin\'izy ireo dia hiatrika ny fanadinana CEPE, 12 hanao BEPC ary ny 3 hiatrika ny bakalorea. Marihina fa mandranto fianarana ao amin\'ny fonjana hitazonana azy izy ireo. ', 1),
(109, '2017-05-24', '10:30:00', ' : Politika _Fihaonana eny Andrainarivo: Hisy ny fihaonana sy dinika ataon\'ireo hery politika tsy mankasitraka ny fitondrana hotanterahina eny amin\'ny...', ' : Politika _Fihaonana eny Andrainarivo: Hisy ny fihaonana sy dinika ataon\'ireo hery politika tsy mankasitraka ny fitondrana hotanterahina eny amin\'ny hotely Panorama Andrainarivo anio 24 mey amin\'ny 2 ora tolakandro. Hodinihin\'izy ireo amin\'izany ny fomba hoenti-miara-mitantana ny firenena satria tena tsy mahavita mihitsy ny fitondrana araka ny hevitr\'izy ireo. Isan\'ny mitarika ity fihaonana ity ny DFP (Dinika Fanavotam-Pirenena) tarihin\'i Tolojanahary Maharavo na Doudou. ', 1),
(110, '2017-05-24', '11:00:00', ': Famatsiana omby : Anio no fotoana nomen’ireo mpandraharahan’ny omby avy amin’ny foko 18 any amin’ny distrikan’i Tsiroanomandidy hanapahana...', ': Famatsiana omby : Anio no fotoana nomen’ireo mpandraharahan’ny omby avy amin’ny foko 18 any amin’ny distrikan’i Tsiroanomandidy hanapahana hevitra amin’ny hampiatoana ny famatsiana omby manerana ny Nosy noho ny tsy fandriampahalemana sy ny fananararaotana ataon’ny zandaryt. Tsy manaiky ny hampiakarana ho 150 000ariary ny saran’ny FIB (Fiche Individuelle des Bovidés) ihany ko aizy ireo. ', 1);
