(111, '2017-05-24', '11:30:00', ' Fanatanjahantena _ Tremplin Tennis : Tanterahina eny amin’ny Ivon-toerana ara-panatanjahantena eny Vontovorona manomboka rahapitso 25 mey ary tsy h...', ' Fanatanjahantena _ Tremplin Tennis : Tanterahina eny amin’ny Ivon-toerana ara-panatanjahantena eny Vontovorona manomboka rahapitso 25 mey ary tsy hifarana raha tsy ny alahady 28 mey ny fifaninana ara-panatanjahantena eo amin’ny taranja dia ny « Tremplin Tennis », izay natokana ho an’ny sokajy latsaky ny 10 taona. ', 1),
(112, '2017-05-24', '12:00:00', ' Franc Maçonnerie: Tanterahina manomboka anio 24 mey eny amin\'ny hotely Carlton Anosy ny fivoriana faha-15n\'ny "Franc maçon, ka 80 ireo antsoina hoe...', ' Franc Maçonnerie: Tanterahina manomboka anio 24 mey eny amin\'ny hotely Carlton Anosy ny fivoriana faha-15n\'ny "Franc maçon, ka 80 ireo antsoina hoe " Grandes Loges" miatrika izany ary eo ho eo 300 ny "Grands Maîtres" sy "Grands Officiers". ', 1),
(113, '2017-05-24', '12:03:00', ': Lalam-pirenena faha-4 _Halatra entana eny ambony fiara: Olona 4 tompon\'antoka amina fangalarana entana eny ambony tafon\'ny fiara sarona tany Ankazom...', ': Lalam-pirenena faha-4 _Halatra entana eny ambony fiara: Olona 4 tompon\'antoka amina fangalarana entana eny ambony tafon\'ny fiara sarona tany Ankazomborona ary hatolotra ny fitsarana any Mahajanga anio. ', 1),
(114, '2017-05-24', '14:00:00', ': Grande Braderie de Madagascar: Mifantoka betsaka amin\'ny fanamarihana ny fetin\'ny reny ny alahady 28 mey izao ny ankamaroan\'ny entana hamidy amin\'it...', ': Grande Braderie de Madagascar: Mifantoka betsaka amin\'ny fanamarihana ny fetin\'ny reny ny alahady 28 mey izao ny ankamaroan\'ny entana hamidy amin\'ity hetsika ara-barotra ity, saingy tsy mahasakana ny entana sy vokatra hafa izany. Fepetra napetraky ny mpikarakara kosa ny fihenam-bidy 15 ka hatramin\'ny 50%, hoy ny mpikarakara. \r\n•  \r\n', 1),
(115, '2017-05-24', '15:00:00', ' : Hajia vaovao: Hivoka manomboka rahapitso 25 mey ny hajia momba ny "XVème conférence mondiale des grandes loges régulières", ary ho hita sy hami...', ' : Hajia vaovao: Hivoka manomboka rahapitso 25 mey ny hajia momba ny "XVème conférence mondiale des grandes loges régulières", ary ho hita sy hamidy eny amin\'ny biraon\'ny paositra rehetra. ', 1),
(116, '2017-05-26', '09:45:00', ' Toamasina _Halatra lavanila : Vahaolana amin’ny halatra lavanila ny fanokafana ny taom-piotazana ho an’ireo faritra mbola tsy ao anatin’izany t...', ' Toamasina _Halatra lavanila : Vahaolana amin’ny halatra lavanila ny fanokafana ny taom-piotazana ho an’ireo faritra mbola tsy ao anatin’izany taom-piotazana izany, hoy ny Tonian’ny mpampanoa lalàna ao Toamasina. Tsiahivina fa polisy 2 lahy no naiditra am-ponja ao Ambalatavoahangy nanomboka ny alarobia 24 mey teo noho izy ireo nahatrarana lavanila maitso 217kg.\r\n', 1),
(117, '2017-05-26', '10:15:00', 'Baolina kitra _CAN U17: Ny ekipam-pirenen\'i Ghana sy Mali no hanao ny lalao famaranana amin\'ny fiadiana ny tompondakan\'i Afrika eo amin\'ny sokajy lats...', 'Baolina kitra _CAN U17: Ny ekipam-pirenen\'i Ghana sy Mali no hanao ny lalao famaranana amin\'ny fiadiana ny tompondakan\'i Afrika eo amin\'ny sokajy latsaky ny 17 taona hatao ny alahady 28 mey izao. Tsiahivina fa samy nandresy tamin\'ny alalan\'ny "Tirs au but" izy ireo tamin\'ny lalao manasa-dàlana, ka ny Ganeanina nandavo an\'i Niger ary ny Malianina nandresy an\'i Guinée. ', 1),
(118, '2017-05-26', '10:50:00', ' Toamasina _Hetsika ara-miaramila « Ivondro 2017 » : Miaramila vahiny miisa 2 no naratra tamin’ny filatsahna tamin’ny elonaina tao amin’ny far...', ' Toamasina _Hetsika ara-miaramila « Ivondro 2017 » : Miaramila vahiny miisa 2 no naratra tamin’ny filatsahna tamin’ny elonaina tao amin’ny faritry ny seranam-piaramanidina Ambalamanasy omaly. Tsiahivina fa nanomboka omaly ny « Ivondro 2017 », sarin’ady sy fanazaran-tena ara-miaramila ho an’ny tafika aty amin’ny tapany atsimon’ny ranomasina Indianina, izay tsy hifarana raha tsy ny 30 mey izao. ', 1),
(119, '2017-05-26', '11:15:00', ' Antenimieram-pirenena : Ity andrim-panjakana ity no hiantoka ny fandaniana rehetra amin’ny fikarakarana ny vantana mangatsiakan’ny Solombavambaho...', ' Antenimieram-pirenena : Ity andrim-panjakana ity no hiantoka ny fandaniana rehetra amin’ny fikarakarana ny vantana mangatsiakan’ny Solombavambahoakan’i Marolambo Laivao Nitadiavina, izay nodimandry tampoka teny amin’ny « Clinique » iray teny Ankadifitsy noho ny fihetsehana tampoka teo amin’ny aretina efa nitaiza azy. ', 1),
