(162, '2017-05-31', '09:30:00', ' Famonoana teratany sinoa: Delegasionina sinoa ahitana polisy misahana ny fanadihadiana ny heloka bevava 2, dokotera 2, mpitsara ambony 2 ary mpandrah...', ' Famonoana teratany sinoa: Delegasionina sinoa ahitana polisy misahana ny fanadihadiana ny heloka bevava 2, dokotera 2, mpitsara ambony 2 ary mpandraharahan\'ny fonja 2 no tonga eto Madagasikara amin\'izao fotoana izao mba hanao fanadihadiana lalina tamin\'ny famonoana teratany sinoa mivady teny amin\'ny Hotely Paon d\'Or Ivato ny 16 martsa lasa teo. Hiara-hiasa amin\'ny manam-pahefana Malagasy izy ireo. Marihina fa efa nisy ny sinoa iray antsoina hoe Jiang Shao Wei sy ny sakaizany Malagasy voasambotra noho ity raharaha ity. \r\n•  \r\n', 1),
(163, '2017-05-31', '10:00:00', ' Fikasihan-tànana mpianatra: Hivoaka anio 31 mey ny didim-pitsarana ilay mpampianatra mpampianatra nikasi-tanana mpianatra teny amin\'ny kolejy La Cro...', ' Fikasihan-tànana mpianatra: Hivoaka anio 31 mey ny didim-pitsarana ilay mpampianatra mpampianatra nikasi-tanana mpianatra teny amin\'ny kolejy La Croyance Anjanahary taorian\'ny niakarany fitsarana ny 24 mey ka namerenana azy tany am-ponja indray miandry io didim-pitsarana io. Marihina fa efa nisintona ny fitoriany ny renin\'ilay zaza voakasi-tànana. ', 1),
(164, '2017-05-31', '10:30:00', ' Sekoly Politeknika Vontovorona _Fitakian’ny mpianatra : Anio tolakandro no hihaona amin’ireo tomponandraikitra avy amin’ny Minisiteran’ny fam...', ' Sekoly Politeknika Vontovorona _Fitakian’ny mpianatra : Anio tolakandro no hihaona amin’ireo tomponandraikitra avy amin’ny Minisiteran’ny fampianarana ambony sy ny avy amin’ny sekoly Politeknika Vontovorona ireo solontenan’ny mpianatra mba hiaraha-mandinika ny momba ny fitakian’izy ireo hampidinana ny saram-pisoratana anarana. ', 1),
(165, '2017-05-31', '11:00:00', 'Antenimieram-pirenena _Fankatoavana volavolan-dalàna : Nankatoavina ny volavolan-dalàna momba ny fanomezana mari-boninahitra ary nolavina kosa ny mo...', 'Antenimieram-pirenena _Fankatoavana volavolan-dalàna : Nankatoavina ny volavolan-dalàna momba ny fanomezana mari-boninahitra ary nolavina kosa ny momba ny lalàna mifehy ny fifamoivoizana. Isan’ny voaresaka tao anatin’io volavolan-dalàna momba fifamoivoizana io ny mikasika ny fiara avy any amin’ny havanana ny familiana. \r\n•  \r\n', 1),
(166, '2017-05-31', '11:30:00', ' Didim-pitsarana: Nivoaka androany ny didim-pitsarana momba ilay fikasihan-tànana mpianatra teny Anjanahary. Sazy mihatona 8 volana no azon\'ilay mpam...', ' Didim-pitsarana: Nivoaka androany ny didim-pitsarana momba ilay fikasihan-tànana mpianatra teny Anjanahary. Sazy mihatona 8 volana no azon\'ilay mpampianatra ary afaka madiodio kosa ilay talen\'ny sekoly. ', 1),
(167, '2017-05-31', '11:30:00', ' Didim-pitsarana: Nivoaka androany ny didim-pitsarana momba ilay fikasihan-tànana mpianatra teny amin\'ny Kolejy La Croyance Anjanahary. Sazy mihatona...', ' Didim-pitsarana: Nivoaka androany ny didim-pitsarana momba ilay fikasihan-tànana mpianatra teny amin\'ny Kolejy La Croyance Anjanahary. Sazy mihatona 8 volana no azon\'ilay mpampianatra ary afaka madiodio kosa ilay talen\'ny sekoly.', 1),
(168, '2017-05-31', '12:00:00', ' : Bianco _Fanambaram-pananana: Rahapitso 1 jona ny fe-potoana farany nomen’ny Bianco ireo tsy mbola nahavita fanambaram-pananana. Zara raha misy 16...', ' : Bianco _Fanambaram-pananana: Rahapitso 1 jona ny fe-potoana farany nomen’ny Bianco ireo tsy mbola nahavita fanambaram-pananana. Zara raha misy 161 amin’ny 1725 tokony hanao izany no nahavita azy io, kanefa ny lalàna no manery ireo tomponandraiki-panjakana hanao fanambaram-pananana. Mandragaranga sazy ny Bianco amin\'izao fotoana izao. \r\n•  \r\n', 1),
(169, '2017-05-31', '12:30:00', 'Andro maneran-tany ho an\'ny tsy fifohana sigara: Ankalazaina anio io andro io ka misy ny hetsika mifandraika amin\'izany tanterahina eny amin\'ny hopita...', 'Andro maneran-tany ho an\'ny tsy fifohana sigara: Ankalazaina anio io andro io ka misy ny hetsika mifandraika amin\'izany tanterahina eny amin\'ny hopitaly HJRA amin\'izao fotoana izao. ', 1),
(170, '2017-05-31', '13:00:00', ' SECES: Hisy ny fihaonann\'ny Sendikan\'ny mpampianatra mpikaroka sy ny praiminisitra anio mba hiandian-kevitra sy hitadiavam-bahaolana eo amin\'ny olan\'...', ' SECES: Hisy ny fihaonann\'ny Sendikan\'ny mpampianatra mpikaroka sy ny praiminisitra anio mba hiandian-kevitra sy hitadiavam-bahaolana eo amin\'ny olan\'ny mpampianatra mpikaroka. \r\n•  \r\n', 1),
(171, '2017-05-31', '13:30:00', ' Mahajanga _Trangam-piarahamonina: Vehivavy 30 taona hita faty tao an-tranony tao amin\'ny fokontany Aranta afak\'omaly 29 mey. Nifatotra ny tànany ary...', ' Mahajanga _Trangam-piarahamonina: Vehivavy 30 taona hita faty tao an-tranony tao amin\'ny fokontany Aranta afak\'omaly 29 mey. Nifatotra ny tànany ary nihohoka teo ambony fandriana izy. Naolana avy eo novonoina izy raha ny fanamarihan\'ny mpitsabo avy amin\'ny BMH satria mbola nahitana ranon\'aina tavela teo amin’ny maha vehivavy azy. \r\n•  \r\n', 1),
(172, '2017-05-31', '14:00:00', ' : Orinasa Telma _Tambajotra "Internet":Hisy ny fanamboarana vonjimaika amin\'ny rohy sy fifandraisana iraisam-pirenena ho an\'ny tambajotra "internet" ...', ' : Orinasa Telma _Tambajotra "Internet":Hisy ny fanamboarana vonjimaika amin\'ny rohy sy fifandraisana iraisam-pirenena ho an\'ny tambajotra "internet" rahapitso 1 jona manomboka amin\'ny 3 ora maraina ary haharitra 6ora eo ho eo io fanamboarana io, izay mety hiteraka fikorontanana amin\'ny fampiasana ny "internet". ', 1),
(173, '2017-05-31', '14:30:00', 'Iray volan\'ny teny Malagasy: Hosokafana amin\'ny fomba ofisialy eny amin\'ny Akademia Tsimbazaza rahapitso 1 jona ny "Iray volan\'ny teny Malagasy". Aori...', 'Iray volan\'ny teny Malagasy: Hosokafana amin\'ny fomba ofisialy eny amin\'ny Akademia Tsimbazaza rahapitso 1 jona ny "Iray volan\'ny teny Malagasy". Aorian\'io dia hetsika antsoina hoe « Tsafasiry an-tononkalon’i Di… sy Dox » heverin\'ny vovonan\'ny mpanoratra Havatsa-Upem hokarakaraina eny amin\'ny Tahala Rarihasina Analakely ny 10 jona. ', 1),
(174, '2017-06-01', '10:45:00', ' Fanadinana bakalorea: Mpiadina miisa 31 mety tsy ho afaka hiatrika izany amin\'ity taona ity noho ny olana maro samihafa....', ' Fanadinana bakalorea: Mpiadina miisa 31 mety tsy ho afaka hiatrika izany amin\'ity taona ity noho ny olana maro samihafa.', 1),
(175, '2017-06-01', '11:00:00', ' Fanondranana zava-mahadomelina: Naiditra am-ponja any Maorisy ireo vehivavy Malagasy 2 nahatrarana Héroïne milanja 7,6kg sy Cannabis 6,6kg sarona t...', ' Fanondranana zava-mahadomelina: Naiditra am-ponja any Maorisy ireo vehivavy Malagasy 2 nahatrarana Héroïne milanja 7,6kg sy Cannabis 6,6kg sarona tany an-toerena ny 22 mey, izay zotram-piaramanidina avy aty Madagasikara no nahatrarana azy io', 1),
(176, '2017-06-01', '11:30:00', ' Andro Iraisam-pirenena ho an\'ny ronono: Marihina anio 1 jona ny andro iraisam-pirenena ho an\'ny ronono ka misy ny hetsika mifandraika amin\'izany tant...', ' Andro Iraisam-pirenena ho an\'ny ronono: Marihina anio 1 jona ny andro iraisam-pirenena ho an\'ny ronono ka misy ny hetsika mifandraika amin\'izany tanterahina eny amin\'ny Tanàna Voara Andohatapenaka mandritra ity tontolo andro ity. ', 1),
(177, '2017-06-01', '12:00:00', ' : Iray volan\'ny teny Malagasy: Misokatra amin\'ny ofisialy anio 1 jona eny amin\'ny Akademia Tsimbazaza ny "Iray volan\'ny teny Malagasy". Aorian\'io dia...', ' : Iray volan\'ny teny Malagasy: Misokatra amin\'ny ofisialy anio 1 jona eny amin\'ny Akademia Tsimbazaza ny "Iray volan\'ny teny Malagasy". Aorian\'io dia hisy ny hetsika hetsika antsoina hoe « Tsafasiry an-tononkalon’i Di… sy Dox » heverin\'ny vovonan\'ny mpanoratra Havatsa-Upem hokarakaraina eny amin\'ny Tahala Rarihasina Analakely ny 10 jona. ', 1),
(178, '2017-06-01', '12:30:00', 'Seranampiaramanidina Ivato: Nahazo fiara famonjena voina avy amin\'ny seranam-piaramanidin\'i Saint Pierre any La Reunion ny seranam-piaramanidina Ivato...', 'Seranampiaramanidina Ivato: Nahazo fiara famonjena voina avy amin\'ny seranam-piaramanidin\'i Saint Pierre any La Reunion ny seranam-piaramanidina Ivato tamin\'ny alalan\'ny ADEMA, ka androany maraina no nanolorana izany. ', 1),
(179, '2017-06-01', '13:00:00', ' Manakara: Manala baraka ny mpandraharahan\'ny fonja ny lehiben\'ny fampanoavana any Manakara rehefa manao fitsidihana ny fonja ary nanevanteva ireo mpa...', ' Manakara: Manala baraka ny mpandraharahan\'ny fonja ny lehiben\'ny fampanoavana any Manakara rehefa manao fitsidihana ny fonja ary nanevanteva ireo mpandraharahan\'ny fonja hoe tsinontsinona fa azo gadraina no antony nisian\'ny firontanana omaly, ka nandravan\'izy ireo ny fitsarana ireo mpandraharahan\'ny fonja nohelohin\'ny fitsarana higadra 2 taona an-tranomaizina, araka ny fanazavan\'ny filohan\'ny Sendikan\'izy ireo Realy César Diderot. ', 1),
(180, '2017-06-01', '13:30:00', ' Baolina kitra _Filaharana maneran-tany: Laharana faha-97 maneran-tany ny Barean’I Madagasikara amin’izao fotoana izao, araka ny filaharana navoak...', ' Baolina kitra _Filaharana maneran-tany: Laharana faha-97 maneran-tany ny Barean’I Madagasikara amin’izao fotoana izao, araka ny filaharana navoakan’ny FIFA androany 1 jona. Izao isika vao tafiditra ao anatin’ny ny antsoina hoe “TOP 100” hatramin\'ny volana febroary 1994. Marihina fa nahazo toerana 14 ny ekipa Malagasy nanomboka ny mey 2017. ', 1),
(181, '2017-06-01', '14:00:00', ' Sendikan’ny mpitsara (SMM) : Manameloka tanteraka ny fihetsiky ny mpandraharahan’ny fonja izay ambarany ho manitsakitsaka ny hasin’ny fitsarana...', ' Sendikan’ny mpitsara (SMM) : Manameloka tanteraka ny fihetsiky ny mpandraharahan’ny fonja izay ambarany ho manitsakitsaka ny hasin’ny fitsarana sy ny mpiasa ao aminy manoloana ny zava-niseho tany Manakara izay tsy namelan’ny mpandraharahan’ny fonja ny hamonjana ny naman’izy ireo izay voalaza ho ananao herisetra tamin’ny voafonja ny SMM. Mamo sady nirongo fitaovam-piadiana izy ireo, araka ny fanambarana novakian’ny filohan’ny SMM, Faniry Ernaivo. ', 1),
(182, '2017-06-01', '14:30:00', ' Fenoarivo Atsinanana _Halatra lavanila: Misokatra manomboka anio ny fanadihadiana mikasika ny fahatrarana vehivavy 1 nitondra lavanila maitso tsy ara...', ' Fenoarivo Atsinanana _Halatra lavanila: Misokatra manomboka anio ny fanadihadiana mikasika ny fahatrarana vehivavy 1 nitondra lavanila maitso tsy ara-dalàna 183 kg, izay efa nodorana avokoa. Ahitana zandary, mpamboly, mpandraharaha ireo ahiana ho mpiray tsikombakomba tamin\'ity raharaha ity. \r\n•  \r\n', 1),
(183, '2017-06-01', '15:00:00', ' Tontolon\'ny ronono: 6,5% ihany vokatra ronono tonga any amin’ny sehatry ny Indostria eto amintsika. Isan\'ny mbola olana ihany koa ny kalitaon\'ny ro...', ' Tontolon\'ny ronono: 6,5% ihany vokatra ronono tonga any amin’ny sehatry ny Indostria eto amintsika. Isan\'ny mbola olana ihany koa ny kalitaon\'ny ronono. 5 litatra isan-taona isan’olona ihany ny tahan’ny fanjifana ronono eto amintsika raha toa ka mahatratra 10 ka hatramin\'ny 25 litatra ny any Afrika. Kendrena ny hampitombo izany ka laharaham-pahamehana ny fampiakrana ny kalitao. Hatrany amin’ny 30 tapitrisa litatra isan-taona kosa ny vokatra vita amin’ny ronono miditra eto Madagasikara. ', 1);

